            m_map[1000000] = "<BASEFONT COLOR=#DFDFC0><DIV ALIGN=RIGHT>NEXT";
            m_map[1000001] = "<BASEFONT COLOR=#DFDFC0>PREVIOUS";
            m_map[1000002] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Welcome to the Ultima Online Tutorial! This and the following windows will explain how to play Ultima Online. You can use the scrollbar on the right to scroll this text up and down. Press the <B>NEXT</B> button when you are ready to begin!</CENTER></BASEFONT></BODY>";
            m_map[1000003] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we will learn how to talk in the world of Britannia. First, type the word <B>Hello</B>. See how it appears at the bottom of your screen? This is where you will see the text you type while in the game. When you press enter, it will appear to the players around you. Now press the <B> Enter </B> key. </CENTER></BASEFONT></BODY>";
            m_map[1000004] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>When you pressed the <b> Enter </b> key, the text you had typed appeared above your head. This lets other people know you are speaking. Also, when you see text above the head of someone else you will know they are speaking. Now we will learn how to walk and move around in the world. Move the cursor around your character. See how it changes? This will show you the direction you are going to move in. Clicking the right mouse button will make your character walk. Move the cursor near your character and single click the right mouse button. </CENTER></BASEFONT></BODY>";
            m_map[1000005] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Great Job! You now know how to walk! Now follow the blue footprints on the ground by clicking and holding down the right mouse button. This will make your character continually walk instead of taking one step at a time. Continue following the footprints down the hall to a set of blue magical runes. Walk onto them when you arrive. </CENTER></BASEFONT></BODY>";
            m_map[1000006] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Perfect! Now we will learn how to <B>Pathfind</B>. Pathfinding is an automated walk which will make your character walk around any obstacles in their way. This is activated when you quickly click the right mouse button twice. Move the mouse cursor over the <B> Red </B> runes on the other side of the walls, and double-click the right mouse button.</CENTER></BASEFONT></BODY>";
            m_map[1000007] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Did you notice how your character walked around the obstacles? This is called <B>Pathfinding</B>. Double-clicking the right mouse button will activate Pathfinding when you want it. While your character is moving, it will say Pathfinding above your head. Follow the red footprints down this hallway. </CENTER></BASEFONT></BODY>";
            m_map[1000008] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we will learn how to <B>Run</B>. To Run, click and hold down the right mouse button and move the cursor closer to the edge of the screen. This will make your character Run in that direction instead of walking. Run down this hallway and follow the Blue footprints. </CENTER></BASEFONT></BODY>";
            m_map[1000009] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You're doing great! Now continue following the blue footprints. </CENTER></BASEFONT></BODY>";
            m_map[1000010] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now you will see a pair of metal doors ahead of you. Walk over and stand in front of the doors. </CENTER></BASEFONT></BODY>";
            m_map[1000011] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You are standing to the side of the doors! Move over to stand directly in front of them. </CENTER></BASEFONT></BODY>";
            m_map[1000012] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we will learn how to <B>Use</B> objects. To Use an object place your cursor on it and double click the left mouse button. Doing this will allow you to open doors, open chests, and use things like spinning wheels and tools. Double left clicking on some food will let you eat it if you're hungry. Try to open the doors in front of you. </CENTER></BASEFONT></BODY>";
            m_map[1000013] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Perfect! Did you notice how the doors opened when you <B>used</B> them? Now you can walk into the next room. Please go through the open door. </CENTER></BASEFONT></BODY>";
            m_map[1000014] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we will learn more about your character, or avatar. An avatar is your in-game representation. It is how other people can interact with you. By <B>using</B> your avatar you can open your <B>Paperdoll</B>. The paperdoll allows you to see your current status, access important information and abilities, and customize your character. Double Left Click your cursor on yourself to open your paperdoll. </CENTER></BASEFONT></BODY>";
            m_map[1000015] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>This is your paperdoll. It shows you what clothing you are currently wearing and what items you have equipped. The buttons on the right of your paperdoll are very important as they allow you to access game features. The topmost button, <B>Help</B>, will request assistance from one of our in game staff, or direct you to online information. The Help button will also help guide you to the best place to receive answers about Ultima Online. You'll be able to choose an option that best describes your situation. Press the Next button to continue.</CENTER></BASEFONT></BODY>";
            m_map[1000016] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we'll look at the <B>Options</B> button. This will allow you to change your in-game settings, such as screen resolution and text color. The <B>Logout</B> button will permit you to leave the world of Ultima Online. Below that is the <B>Skills</B> button. This will show you a more detailed listing of your character's abilities. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000017] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The <B>Journal</B> button will open up a log of recent speech and actions said and seen by you. The <B>Chat</B> button will take you to an in-game chat room to talk with other players. The <B>Peace</B> button will allow you to go into combat mode to attack monsters. We'll learn how to use that shortly. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000018] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>At the bottom, the <B>Status</B> button will give you information about your Avatar's attributes and statistics. Before we cover those, let's learn about the <B>Backpack</B>. Your backpack is in the lower right corner of your paperdoll. It is where all of your items are stored when you are not wearing or using them. It can be opened by using it. Open it now by double left clicking the cursor on it. </CENTER></BASEFONT></BODY>";
            m_map[1000019] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Wonderful! This is your backpack. It is where you can put the items that you find and need during your adventures through Britannia. Right now, there is a banana inside your backpack. We're going to use it to learn a few more ways you can interact with items. To <B>Look</B> at an item in the world, single left click on it with the cursor. A description will appear above the item when you do this. Look at the banana by moving the cursor over the banana and clicking the left mouse button once. </CENTER></BASEFONT></BODY>";
            m_map[1000020] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>See how the description appears above the object? You can look at any object in the world with a single left click. Let's learn how to pick up things. Picking up an object is done by single, left clicking on it, just as you did to look at it, and then holding the mouse button down. You can then drag the item around. The item will stick to the end of the mouse cursor while you are holding it. Pick up the banana by moving the mouse cursor over it, and left clicking and holding the left mouse button down. </CENTER></BASEFONT></BODY>";
            m_map[1000021] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>GREAT! You have now picked up the banana. Move the mouse cursor around. See how the banana moves accordingly and follows it? This is how you <B>Move</B> objects around in Britannia. Move the mouse cursor back over the backpack and release the left button. This will drop the banana back inside your backpack. </CENTER></BASEFONT></BODY>";
            m_map[1000022] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You appear to have missed your backpack! The banana has been returned to your backpack for you. Clicking on, holding and dragging is how things can be moved around in the world. Objects in your backpack can be <B>Used</B> just like objects in the world can be used. For example, double left clicking on the banana will let you <B>Eat</B> it. Eat the banana now. </CENTER></BASEFONT></BODY>";
            m_map[1000023] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now you know how to <B>Move</B> an object in the world. Objects in your backpack can be <B>Used</B> just like objects in the world. For example, moving the cursor over the banana and double-clicking the left mouse button will let you <B>Eat</B> it. Eat the banana now. </CENTER></BASEFONT></BODY>";
            m_map[1000024] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>YUM! You ate the banana. There is now a blue Hat in your backpack. Clothing and other equipment can be worn and removed. This is done by picking up and dragging the equipment over to your paperdoll. First, pick up the hat. Again, you do this by moving the cursor over it, and clicking and holding down the left mouse button on it. </CENTER></BASEFONT></BODY>";
            m_map[1000025] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You are now holding the hat. Be careful! You don't want to release the mouse button, as that would drop it. Drag the hat over to your head in the paperdoll and release the button. Doing this will <B>Equip</B> the hat. </CENTER></BASEFONT></BODY>";
            m_map[1000026] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Oops! You appear to have dropped the hat! I have returned it to your backpack. Try to pick up the hat again. Do this by moving the cursor over it, and left clicking and holding down the button. </CENTER></BASEFONT></BODY>";
            m_map[1000027] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>GREAT! You have <B>Equipped</B> the hat. See how it appears on your avatar as well as your paperdoll? You can equip clothing, weapons and armor in the same way as the hat. Now, let's learn how to take it off. Move the mouse cursor over the hat on your paperdoll, and left click and hold down the mouse button to pick it up. </CENTER></BASEFONT></BODY>";
            m_map[1000028] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now you are holding the hat again. Drag the hat over the backpack and release the left mouse button to drop it in. </CENTER></BASEFONT></BODY>";
            m_map[1000029] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Oops! You appear to have missed the backpack! The hat has been returned to your backpack. Now that you know how to use and manipulate items in the world we are going to learn a little bit about moving the in-game windows around. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000030] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Wonderful! Now that you know how to use and manipulate items in the world we are going to learn a little bit about moving the in-game windows around. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000031] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>First, look in the lower right corner of your paperdoll. Do you see the <B>Dash symbol (-)</B>? This is the <B>Minimize</B> button. It appears on almost all of the windows in Ultima Online. Single left clicking on it will shrink down the window for convenience. Left click on the paperdoll minimize button, or dash symbol. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000032] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>See how the paperdoll has shrunk down to a button-looking window that says <B>Character</B>? This is the minimized version of the paperdoll window. It can be moved around by left clicking and dragging just like any other window. To restore the paperdoll, you just double left click on the Character window. Double left click on it now.</CENTER></BASEFONT></BODY>";
            m_map[1000033] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we'll learn how to <B>Close</B> a window. To close any window, simply single right click on it. Single right click on your paperdoll window. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000034] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>To reopen your paperdoll, simply double left click on your avatar. Now you know how to move, minimize, restore, and close all of the windows available to you. Press the Next button to continue.</CENTER></BASEFONT></BODY>";
            m_map[1000035] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now you'll have a chance to use a little of what you have just learned. Inside of this room is a Red <B>Moongate</B>. A Moongate is a magical portal, which will teleport you elsewhere. The moongate is inside the smaller room with 8 doors. Walk over to these doors, and <B>Use</B> them. (Hint: Double left click on the doors!). After you have opened the doors, walk into the moongate. </CENTER></BASEFONT></BODY>";
            m_map[1000036] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we're going to learn more about your avatar. Move the mouse cursor over your avatar. Now single click the left mouse button, hold it down, and drag the cursor off of your character. Press the Next button when you have done this. </CENTER></BASEFONT></BODY>";
            m_map[1000037] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>This is your <B>Status Bar</B>. It is a handy representation of your avatar's characteristics. There are 3 major characteristics shown here. The first, and most important is the topmost bar. This represents your avatar's <B>Health</B>. Health shows you how hurt your character is. Your Health decreases when you are wounded. As your Health drops lower, the blue bar will shrink. Let's see what this looks like. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000038] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Your Health has been lowered to half. See how the bar is now half blue and half red? The blue portion of the bar shows you how close you are to your maximum in that characteristic. So if you have very little blue left, watch out! Your other characteristics will work the same way. Health regenerates naturally over time. Press the Next button to continue and restore your Health to full. </CENTER></BASEFONT></BODY>";
            m_map[1000039] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The next characteristic, shown as the middle bar, is <B>Mana</B>. Mana shows you how much magical energy that your character has available. Casting a spell will decrease your available Mana. Mana regenerates naturally over time. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000040] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The last characteristic is the bottom bar. This bar measures your current <B>Stamina</B>. The stamina bar lets you know how tired you are. Running, fighting, and other physical activities will decrease your stamina. Be careful not to let your stamina reach 0, as you will become too tired to move! Stamina, just like Health and Mana, regenerates over time. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000041] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we're going to take a closer look at your status. The Status Bar can be maximized to a more detailed Status window by double left clicking on the bar. Maximize the bar now. Press the Next button when you have done this. </CENTER></BASEFONT></BODY>";
            m_map[1000042] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>As you can see this window gives you much more detail about your character. It gives you the number value of your current and maximum Health, Mana, and Stamina, as well as several other statistics. The first statistic, <B>STR</B> is your <B>Strength</B>. This is a measure of how strong and durable your avatar is. The higher your strength is, the more Health you have, and the more you excel at physical activity. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000043] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The next statistic is <B>DEX</B> which stands for your <B>Dexterity</B>. This represents how agile and quick you are. If your Dexterity is very high, you will be able to dodge attacks, and perform physical activities more quickly. Dexterity also affects the amount of Stamina you have. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000044] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The last Statistic is <B>INT</B> which is for your <B>Intelligence</B>. This represents how smart you are. A character with a high Intelligence will excel at mental activities such as spell casting. Intelligence also determines the amount of Mana that you have available. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000045] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Next, <B>SEX</B> shows whether your character is Male or Female. Below that is <B>AR</B> or Armor Rating. AR represents how well protected your character is. The higher the AR, the better protected from damage you are. Press the Next button to continue.</CENTER></BASEFONT></BODY>";
            m_map[1000046] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Next are the number values of Health, Stamina and Mana. Below that is <B>Gold</B>. This tells you how much money you currently have. Below that is <B>Weight</B>. Weight is an indicator of how much you are carrying. The more weight you are carrying, the more stamina you will lose during normal physical activity. Excessive weight will prevent you from moving at all! Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000047] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now that you are more familiar with your character, close the Status window with a single right click. Now follow the Red footprints down the hall. </CENTER></BASEFONT></BODY>";
            m_map[1000048] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Continue to follow the footprints into the next room. Inside you will see a number of avatars. These are NPC's, or Non-Player Characters. NPC's are avatars that are run by the game. In this case, these NPC's are <B>Shopkeepers</B>. Shopkeepers will buy and sell items from players. Walk over to one of the NPC's and stand right next to them. </CENTER></BASEFONT></BODY>";
            m_map[1000049] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>NPC's have a paperdolls just like you do. You open an NPC's paperdoll, just as you would open your own.  Simply double left click on them. </CENTER></BASEFONT></BODY>";
            m_map[1000050] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The NPC paperdoll shows information about the NPC just as yours does. The clothing and equipment worn are shown as well as the NPC's name and profession. The <B>Status</B> of an NPC can be opened from the paperdoll as well. Close the NPC Paperdoll with a single right click. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000051] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we're going to learn how to buy and sell from an NPC. NPC's respond to speech, just like players do, but they require gold for their wares. Some gold has been placed in your backpack. Like all of your other items, gold is stored in your backpack. Open your paperdoll with a double left click on your avatar. Then, open your backpack with a double left click. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000052] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now close your Paperdoll. (HINT: Single right click on it.). Your backpack will remain open. Inside of your backpack you will see some <B>Gold</B>. Looking at the stack of gold will show you the amount you possess. You currently have 10 gold pieces. We are going to use this gold to buy something from this Shopkeeper. Press the Next button to continue. </CENTER></BASEFONT></BODY>";
            m_map[1000053] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>To let a NPC shopkeeper know you wish to buy from them, you must type in <B>Vendor Buy</B>. Type this in now and press the Enter key. </CENTER></BASEFONT></BODY>";
            m_map[1000054] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>This is the <B>Buy</B> window. Here you can make your selection from the wares of a shop. In this case, this vendor sells loaves of bread. The top portion of the window shows the name of the item, the cost, and the amount available. The bottom portion will display what items you have selected as well as the total cost of your items. Let's purchase a loaf of bread. This is done by double-clicking the left mouse button on the <B>Bread</B> description in the top window. Press the Next button after you have done this. </CENTER></BASEFONT></BODY>";
            m_map[1000055] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The available loaves of bread has been dropped by one and a loaf of bread has been placed in the bottom portion of the window. You are able to increase and decrease the quantity of items by using the <B>+ (plus)</B> and <B>-(minus)</B> buttons on the bottom half of the window.  To complete the transaction, single left click on the large red checkmark at the bottom left of the window. Press the Next button after you have done this.</CENTER></BASEFONT></BODY>";
            m_map[1000056] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Great! Now you have a loaf of bread in your backpack. But you are also a few gold poorer. You only have 4 gold now. You can sell items to NPC's as well. They won't pay as much for an item as it is worth though. It's just not profitable for them! Let's sell the loaf of bread back to the NPC. Type <B>Vendor Sell</B>, and press the enter key. </CENTER></BASEFONT></BODY>";
            m_map[1000057] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>The <B>Sell</B> window is arranged the same way as the Buy window. Instead of the shopkeeper's items at the top of the window, <B>your</B> items are listed. Double-click the left mouse button on the loaf of bread description. It will appear in the bottom portion of the window. Note the amount the NPC will pay for the bread is around half of what you originally paid for it. Now single left click on the large Checkmark to finish the sale. Press the Next button to continue.</CENTER></BASEFONT></BODY>";
            m_map[1000058] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You have sold the bread! The appropriate amount of gold has been placed in your backpack and was neatly collected back into your stack of gold. Now that you are familiar with buying and selling from NPC's, let's move on to some combat! Follow the blue footprints down the hall. </CENTER></BASEFONT></BODY>";
            m_map[1000059] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Continue following the blue footprints.</CENTER></BASEFONT></BODY>";
            m_map[1000060] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>These creatures are <B>Mongbats</B>. Mongbats are but one type of monster that plagues the people of Britannia. Monsters are like NPC's, but they do not have a paperdoll. They do have a simple status bar much like your own. To open the monster's status bar, left click on the mongbat, hold and drag the mouse off of it. Press the Next button when you have done this. </CENTER></BASEFONT></BODY>";
            m_map[1000061] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>This is the Monster's status bar. It only shows the monster's Health. Like your status bar, the blue bar will gradually shrink as the monster gets closer and closer to death. When the bar is totally red, the monster will die. Now open your own status bar. Left click and drag the mouse off of you. Press the Next button when you have done this. </CENTER></BASEFONT></BODY>";
            m_map[1000062] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now we're going to learn how to go into <B>Combat</B> mode. Combat mode will allow you to attack monsters and other players. Press <B>ALT-C</B> (the ALT key and the C key at the same time). See how your status bar changes to a red color, and your avatar changes his stance? This is <B>Combat</B> mode, and it means you are ready to fight. Pressing ALT-C again will take you out of combat mode. Practice going in and out of combat mode a few times. Press the Next button to continue.</CENTER></BASEFONT></BODY>";
            m_map[1000063] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You can fight with just your fists, but to do more damage, you should use a weapon. To use one you must first equip it. A cutlass has been placed in your backpack for you to use. Open your paperdoll (Double left click on your avatar), and open your backpack. (Double left click on the backpack). To equip it we need to pick it up. Left click, hold and drag the cutlass out of the backpack. </CENTER></BASEFONT></BODY>";
            m_map[1000064] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Great! You have picked up the cutlass. Drag it onto your paperdoll and release the left mouse button to equip it. </CENTER></BASEFONT></BODY>";
            m_map[1000065] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Oops! You appear to have missed! The cutlass has been returned to your backpack. Left click and hold on it and drag it on to your paperdoll to equip it. </CENTER></BASEFONT></BODY>";
            m_map[1000066] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Your weapon is now equipped. Close your paperdoll and backpack with a single right click on each. Now you are ready to <B>Attack</B> a monster. Go into combat mode, if you are not already. (Use <B>ALT-C</B> until your character is in his aggressive stance.) Open the mongbat's status bar with a left click hold and drag (if you had closed it). Then, move right next to a monster and attack it. To attack a monster <B>Use</B> it while you are in Combat mode. Do this now. </CENTER></BASEFONT></BODY>";
            m_map[1000067] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You are now <B>Attacking</B> the monster! You will notice the mongbat has changed color and has a mini-health bar under it. This lets you know what you are in combat with. You will continue to attack the mongbat until it dies. </CENTER></BASEFONT></BODY>";
            m_map[1000068] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>HURRAH! You killed the monster. Now, <B>Use</B> the monster's corpse. This will allow you to take any treasure that the monster has. Double left click on the corpse of the monster, now. </CENTER></BASEFONT></BODY>";
            m_map[1000069] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>This is the Monster's corpse. Inside will be any equipment or treasure that the monster was carrying and has for the taking. In this case, the mongbat had a Crystal Ball. Pick up the Crystal ball with a Left click and hold. </CENTER></BASEFONT></BODY>";
            m_map[1000070] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Now drag the Crystal ball directly onto your avatar and release the left mouse button. This will allow you to pick up items from the world without opening your backpack. They will go directly into your backpack when dropped this way. </CENTER></BASEFONT></BODY>";
            m_map[1000071] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>You appear to have missed dropping on yourself. The crystal ball has been returned to the monster's corpse window. Now click and drag the Crystal ball directly onto your avatar. This will allow you to pick up items from the world without opening your backpack. They will go directly into your backpack when dropped this way. </CENTER></BASEFONT></BODY>";
            m_map[1000072] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Congratulations! You now know how to kill monsters and take their treasure. To finish up, follow the Blue Footprints. </CENTER></BASEFONT></BODY>";
            m_map[1000073] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Continue following the blue footprints into the next room. </CENTER></BASEFONT></BODY>";
            m_map[1000074] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>This red Moongate will take you to Haven. Haven is a city where you will continue your learning. </CENTER></BASEFONT></BODY>";
            m_map[1000075] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Going through this red moongate will transport you to a unique town in Britannia. The town of Haven is a place where new players become acclimated to the world. This town is a safe place to learn not only skills, but also to learn how to interact with others in Ultima Online. Haven is populated by advanced players known as Companions who will answer questions you may have concerning this world. Make sure you do not leave Haven too early as the information you can learn there will benefit your entire life in Britannia. Walk through the red Moongate when ready. </CENTER></BASEFONT></BODY>";
            m_map[1000076] = "<BODY><BASEFONT COLOR=#DFDFC0><CENTER>Going through this Red Moongate will return you to your starting city. From there you can continue your adventures through the world of Brittania. </CENTER></BASEFONT></BODY>";
            m_map[1001000] = "We are sorry, but a Game Master is not available to assist you. We have forwarded your call to a Counselor. If a Counselor does not respond, please send an email to support@owo.com with a description of your problem.";
            m_map[1001001] = "For more information on what times Game Masters are available, please visit the support.owo.com web page.";
            m_map[1001002] = "<CENTER><U>Ultima Online Help Menu</U></CENTER>";
            m_map[1001003] = "<U>General question about Ultima Online</U>: Select this option if you are having difficulties learning to use a skill, if you are lost, or if you have a general gameplay question.";
            m_map[1001004] = "<U>My character is physically stuck or cannot continue to play</U>: This choice covers cases where your character is in a location they cannot move out of.";
            m_map[1001005] = "<U>Another player is harassing me</U>: Another player is harassing your character, be it by verbal or physical means, or is breaking the Terms of Service Agreement. To see what constitutes harassment please visit <A HREF=";
            m_map[1001006] = "<U>Other</U>: If you are experiencing a problem in the game that does not fall into one of the other categories or is not addressed on the Support web page (located at <A HREF=";
            m_map[1001007] = "If you cannot find the help you require on this list, please visit our webpage at <A HREF=";
            m_map[1001008] = "<U>Visit the OWO web page</U>: You can find detailed answers to many of the most frequently asked questions on our OWO webpage. This selection will launch your web browser and take you to those answers.";
            m_map[1001009] = "<U>Report a bug or contact Origin</U>: Use this option to launch your web browser and mail in a bug report. Your report will be read by our customer support staff. We apologize for not being able to reply to individual reports.";
            m_map[1001010] = "<U>Contact a Counselor</U>: A Counselor is an experienced Ultima Online player who has volunteered their time to help answer general questions. Selecting this option will let you send a message to a Counselor. Please remember that Counselors are volunteers and may not be available at all times, so please be patient and remember to check the website for additional help.";
            m_map[1001011] = "<U>Back to the first page</U>";
            m_map[1001012] = "<U>Please review the following to make sure you wish to continue with this page:</U>";
            m_map[1001013] = "You have asked to file a complaint on another player for harassment in Ultima Online. A logfile will be reviewed by our support staff if you send in this page, and you will receive a message through mail telling you of the status of your complaint. Please make sure you have your proper e-mail address on record with us. Harassment is defined on our website at : <A HREF=";
            m_map[1001014] = "YES - I want to send a harassment log to the GMs.";
            m_map[1001015] = "NO  - I meant to ask for help with another matter.";
            m_map[1001016] = "Your account currently has young player status.  If you wish to remain In the war torn lands where Minax has taken control, you must give up  this Young player status.  If you do not wish to lose your young player status, choose 'Cancel' and you will be automatically transported to the Lands of Lord British.";
            m_map[1001017] = "You cannot perform beneficial acts on your target.";
            m_map[1001018] = "You cannot perform negative acts on your target.";
            m_map[1002000] = "Alchemy";
            m_map[1002001] = "Alchemy will allow you to create potions with both beneficial and harmful effects.  By mixing reagents in a mortar and pestle, the alchemist can pour the resulting potion into a bottle.  This potion can then be used by yourself or others at a later time.";
            m_map[1002002] = "In order to create potions, an alchemist needs a mortar and pestle and empty bottles.  You can buy a mortar and pestle, bottles, and reagents at a magic shop from an herbalist or an alchemist.";
            m_map[1002003] = "When creating potions, you will need reagents.  Reagents can be bought at a magic shop from an herbalist or an alchemist.  Different potions will require different reagents.";
            m_map[1002004] = "Anatomy";
            m_map[1002005] = "Anatomy allows you to learn certain things about the physical makeup of the beings you select.  For instance, you may be able to find out that bunny is a very weak opponent, but a demon will appear incredibly strong.";
            m_map[1002006] = "In order to use Anatomy, you will need to click on the skill from within your skill menu.  This will bring up a targeting cursor.  Select the person or monster on which you would like to use your Anatomy skill.  If you are successful, you will determine their relative strength.  You will not be able to use the Anatomy skill on Shopkeepers or Vendors.";
            m_map[1002007] = "Animal Lore";
            m_map[1002008] = "Animal Lore is a skill in which you are able to determine the health, needs, and special functions of an animal.  Animal Lore only works on the animals of Britannia, and it will not work on monsters.";
            m_map[1002009] = "In order to use Animal Lore, you will need to click on the skill from within your skill menu.  This will bring up a targeting cursor.  Select the animal on which you would like to use your Animal Lore skill.  If you are successful, you will determine the needs, health and any special functions of the animal.";
            m_map[1002010] = "Animal Taming";
            m_map[1002011] = "Animal Taming will allow you to tame an animal to which you will then be able to give simple commands.  This animal will remain with you so long as you keep it well fed and happy.  In order to determine the state of your pet, you might wish to learn Animal Lore.";
            m_map[1002012] = "In order to use your Animal Taming skill, you will need to click on the skill from within your skill menu.  This will bring up a targeting cursor.  Select the animal you would like to tame.  Once you start taming an animal, you will need to stay close to it until you tame it, or until you are told you were not successful in your attempt.  If you are successful, you will be able to name the pet.";
            m_map[1002013] = "To name your pet, you will need to left-click and drag off of the animal.  This will bring up a status box with the current animal name.  Simply click in this box and delete the current name with your backspace key.  Once the current name is clear, you are able to type in any name you like.";
            m_map[1002014] = "You will be able to give your pet commands.  If your pet is still loyal to you, it will follow your commands.  All commands are issued by saying the name of your pet and the command.  For instance ";
            m_map[1002015] = "Attack:  This will allow you to command your pet to attack another being.  Using this command will bring up a targeting cursor.   Select the being you wish to attack, and if your pet is loyal and the being is not too strong, the pet will attempt the attack.";
            m_map[1002016] = "Bring: This command will allow your pet to pick up an item and bring it back to you.  Using this command will bring up a targeting cursor.  Select the item you wish your pet to bring back.  You will need to issue the ";
            m_map[1002017] = "Come: This command will tell your pet to come to your position.";
            m_map[1002018] = "Drop:  This command will tell your pet to drop whatever it is carrying.  The item will drop on the ground, so be sure that you are in an area where you will safely be able to retrieve the item.";
            m_map[1002019] = "Fetch:  This command will allow your pet to pick up an item and bring it back to you.  Using this command will bring up a targeting cursor.  Select the item you wish your pet to bring back.  You will need to issue the ";
            m_map[1002020] = "Follow:  This command can be issued to tell your pet to follow someone.  Using this command will bring up a targeting cursor.  Select the player you wish your pet to follow.  If you wish your pet to follow you, you may simply add ";
            m_map[1002021] = "Friend:  This will allow other people to give your pet orders.  Using this command will bring up a targeting cursor.  Select the player from which you wish to allow your pet to receive orders.  If the pet is loyal, it will now receive commands from that player.";
            m_map[1002022] = "Get:  This command will allow your pet to pick up an item and bring it back to you.  Using this command will bring up a targeting cursor.  Select the item you wish your pet to bring back.  You will need to issue the ";
            m_map[1002023] = "Kill: This will allow you to command your pet to attack another being.  Using this command will bring up a targeting cursor.   Select the being you wish to attack, and if your pet is loyal and the being is not too strong, the pet will attempt the attack.";
            m_map[1002024] = "Patrol:  This will allow you to command your pet to patrol the general area in which it currently resides.  If your pet is loyal, it will patrol the area and attack intruders.";
            m_map[1002025] = "Release:  If you wish to let your pet once again enjoy freedom, use the release command.  This will free the animal, and it will no longer respond to your commands.";
            m_map[1002026] = "Stay:  This command will tell your pet to remain at its current location.  Your pet will cease to follow anyone they may have been following.";
            m_map[1002027] = "EndMusic:  This command will tell your pet to remain at its current location.  Your pet will cease to follow anyone they may have been following.";
            m_map[1002028] = "Transfer:  This will allow you to transfer the ownership of your pet. Using this command will bring up a targeting cursor.  Select the player to which you wish to give the pet . If the pet accepts the person, you will no longer own the pet and the person you have selected will be the new owner.";
            m_map[1002029] = "Archery";
            m_map[1002030] = "Archery is a combat skill in which the combatant uses the bow as the primary weapon.  Archery is unique in that it requires arrows.";
            m_map[1002031] = "If you have a bow equipped, you can attack a player, animal, NPC or monster as you normally would.  The bow / crossbow will fire so long as you have arrows / bolts in your backpack.  You can attack your target so long as you have direct line of sight to them.";
            m_map[1002032] = "An archer can use a bow, crossbow or heavy crossbow.";
            m_map[1002033] = "Two good skills which are complimentary to archery are fletching and lumberjacking.  Lumberjacking will allow you to get wood from trees, while fletching will allow you to craft this wood into shafts and make arrows.";
            m_map[1002034] = "Arms Lore";
            m_map[1002035] = "Arms Lore is the ability to determine the relative strengths of weapons or armor.  Arms Lore will even allow the lore-master to see if a weapon is poisoned or not.";
            m_map[1002036] = "In order to use Arms Lore, you will need to click on the skill from within your skill menu.  This will bring up a targeting cursor.  Select the weapon or armor on which you would like to use your Arms Lore skill.  If you are successful, you will determine the relative strength and durability of the armor or weapon.";
            m_map[1002037] = "Banking";
            m_map[1002038] = "Your bank box serves one function in the game.  It allows you to safely store items you collect over time.  Only you will have access to your bank box.  If you wish to gain access to your bank box, you will need to say ";
            m_map[1002039] = "Bankers will also deposit or withdraw money for you.  To find out your balance, you may simply say ";
            m_map[1002040] = "Begging";
            m_map[1002041] = "Begging is the ability for you to receive alms from NPCs.  When you desperately need gold, you can beg for it.  You will lose karma, but you might gain a few coins.";
            m_map[1002042] = "In order to use Begging, you will need to click on the skill from within your skill menu.  This will bring up a targeting cursor.  Select the NPC from whom you wish to beg for money.  If you are successful, and the NPC has a spare coin or two, you will be given money.  Using this skill will cause you to lose Karma.";
            m_map[1002043] = "Blacksmith";
            m_map[1002044] = "To use your blacksmith skill, you will need to be near an anvil and forge.  When standing near these you may use your tools to repair items, melt items, or craft items.  A menu will appear one you use your tool near the anvil and forge.";
            m_map[1002045] = "You will need a blacksmith's hammer, a sledge hammer, or tongs to use your blacksmithy skill.  These tools will allow you to repair armor and weapons.  If you wish to create new weapons or armor, you will need metal ingots.";
            m_map[1002046] = "A good complimentary skill to blacksmithing is mining.  Your ability to melt items down to ingots depends on your mining skill.  Also, a successful miner will provide all the raw materials a blacksmith needs to become successful.";
            m_map[1002047] = "Bowcraft / Fletching";
            m_map[1002048] = "Learning the bowcraft or fletching skill will allow you to create bows, crossbows, arrows and bolts.  For the self-sufficient archer, a good bowcraft skill is a must.  Crossbows and heavy crossbows use bolts, whereas a normal bow uses arrows.";
            m_map[1002049] = "To create bows or crossbows, you will need a bladed instrument such as a dagger or sword and boards.  Use the dagger by double-clicking on it.  This will bring up a menu.  If your skill is high enough, you will be able to attempt to make a box [???], crossbow, or heavy crossbow.  You will also be allowed to make shafts into arrows or bolts.  If you have feathers, you can double-click on the shafts and then select the feathers with the targeting cursor.  A new menu will appear with a choice of making arrows or bolts.  Select one.  If you are successful you will create bolts or arrows, depending on your choice.";
            m_map[1002050] = "Camping";
            m_map[1002051] = "Camping ill allow you to leave the world of Britannia immediately upon successful completion of building your campground.  Logging out in Britannia normally will keep your character in the world vulnerable for a short time after you have logged out. By using camping, your character will leave the world immediately when you log out.";
            m_map[1002052] = "You will need to double click on a pile of kindling to create your camp.  A fire should start if you are successful.  You will have to remain near your fire.  In a short while, you will receive a message telling you that your campground is secure.  When you see this message, it will be safe for you to use a bedroll.  Doing so will log you out instantly.";
            m_map[1002053] = "You will need kindling in order to make your camp. You can garner kindling by using any bladed item on a tree.  You will also need a bedroll, which you can purchase from a provisioner.";
            m_map[1002054] = "Carpentry";
            m_map[1002055] = "The carpenter is able to fashion useful items from wood such as furniture, musical instruments, and even additions to homes.   A carpenter uses tools such as saws, nails, and joining planes when creating items.";
            m_map[1002056] = "To use your carpentry skill, you will need a joining plane, saw, or nails.  You will be able to use these tools by double-clicking on them.  You will then be asked to select the wood from which you wish to build your items.  Select a pile of boards or logs.  Different objects you wish to create will require different amounts of wood.  Experiment to see how much you will need.  Once you have selected the wood you wish to use, the menu displaying the items you can create will appear.  Select the item you wish to create and you will attempt to make that item.";
            m_map[1002057] = "Cartography";
            m_map[1002058] = "The cartography skill has two primary uses.  It can be used to create one of several types of maps. Secondly, it is used to decode treasure maps that are sometimes found as loot on monsters.";
            m_map[1002059] = "To create a new map, first you must obtain a blank map. Then, use your cartography skill from the skill list, and click on the blank map. A window will appear giving you a choice of map types. Select the one that you would like to create. Your chances of success, and the range and quality of your map will be determined by your skill level. Your location will be the center of the map.";
            m_map[1002060] = "To decode a treasure map, simply double click it. If your cartography skill is high enough, you will successfully decode the map. After you have decoded the map, you must also be the person to dig up the treasure using the mining skill.";
            m_map[1002061] = "This skill is useful for traveling on a boat. You can plot your course on the map, then give the map to your tillerman. Simply say ";
            m_map[1002062] = "This skill is also useful to make maps for adventurers, selling maps of popular areas (such as dungeons), and selling maps to seafarers.";
            m_map[1002063] = "Cooking";
            m_map[1002064] = "Cooking allows you to bake raw food into tastier cooked food. First you must locate or build a fire. Campfires or forges will do for most dishes, however, some may require an oven. Once you have found a source of heat, double-click the food item you wish to cook, then target the forge, campfire, or oven. The cooking skill also allows you to try to combine certain foods to make new dishes.";
            m_map[1002065] = "Detecting Hidden";
            m_map[1002066] = "Detect Hidden is  useful skill in several regards. Proficiency in this skill will allow you to detect hidden players, find traps on trapped chests, and detect dungeon traps. The higher your level of proficiency with this skill, the larger your search radius will be, and the greater chance you have of detecting other sorts of traps.";
            m_map[1002067] = "To use Detect Hidden, simply use the skill from the skill list, and target the area or object you wish to search. When you successfully detect a trap, you will ";
            m_map[1002068] = "As your skill in Detecting Hidden items increases, you may even begin to see traps automatically. This is a very difficult skill to learn, and may start happening after you have passed a skill level of 80 in this skill. Your ability to detect traps in this manner is dependent on the trap level and difficulty, and should not be relied upon in all situations.";
            m_map[1002069] = "Another useful application for this skill involves the homeowner. If you are the homeowner, or friend to a house, and use the detect hidden skill in your household, you will reveal any players that may be hidden there.";
            m_map[1002070] = "Evaluate Intelligence";
            m_map[1002071] = "Evaluating intelligence allows you to learn certain things about the mental makeup of the beings you select.  If you need to know how intelligent a being is and get an idea of their potential magic using ability, your will need to learn evaluate intelligence.  A high evaluate intelligence skill also allows mages to successfully overcome the natural resistance of creatures to magic.  Therefore, a high evaluate intelligence skill may make a huge difference to a mage.";
            m_map[1002072] = "In order to use evaluate intelligence, you will need to click on the skill from within your skill menu.  This will bring up a targeting cursor.  Select the person or monster on which you would like to use your evaluate intelligence skill.  If you are successful, you will determine their relative intelligence, and perhaps their current mana level.  You will not be able to use the evaluate intelligence skill on Shopkeepers or Vendors.";
            m_map[1002073] = "Fencing";
            m_map[1002074] = "Fencing is a melee combat skill, which allows for an quick attack style of fighting.  A fencer is capable of using a kryss, spear, pitchfork, war fork, short spear or dagger in combat to great effect.";
            m_map[1002075] = "Fencing, like the other melee combat skills, requires that you have the appropriate weapon equipped.  Once you have the weapon equipped you will need to enter war mode.  You will need to double-click on an opponent to attack them.";
            m_map[1002076] = "Fishing";
            m_map[1002077] = "Use of the fishing skill will allow you to catch fish from large bodies of water. Double-click on a fishing pole, then click on a body of water. If successful, you will catch a fish. Success with this skill also depends on the availability of fish in that specific area. You can also catch other items, including treasure maps and SOS messages in bottles.";
            m_map[1002078] = "Forensic Evaluation";
            m_map[1002079] = "Use of this skill will allow you to find information about a corpse, and the events surrounding its demise. Use this skill by clicking the jewel in your skill list. You will be given a targeting cursor, target the corpse and you will be given information about the circumstances surrounding the demise. The higher your skill level, the higher your chances of determining these events, and the accuracy of your description.";
            m_map[1002080] = "This skill is also useful for other reasons. By using this skill on a living person, you may be able to determine their membership in the Thieves guild. Your ability to determine this is based on their skill level as a thief.";
            m_map[1002081] = "You can also use your detective skills to determine who recently picked the locks on locked containers and determine members of the Thieves Guild. Simply use the Forensic Evaluation skill, and target the item you wish to examine. You must be a skilled detective to begin this practice, as you will not be able to begin learning this skill until you have a skill level of 40.";
            m_map[1002082] = "Healing";
            m_map[1002083] = "Use of the healing skill will allow you to heal yourself or other players. To use the skill, simply double click a bandage, and target yourself or the person you wish to heal. If you are successful in your efforts, the recipient will regain health, and the bandage will be used up. To create bandages, simply use scissors on cloth.";
            m_map[1002084] = "If you are healing another player, you must be near them during your efforts, if you leave their vicinity, your efforts will be in vain. If you are disturbed during your work, your fingers can easily slip, and your efforts will have less or no effect.";
            m_map[1002085] = "A highly skilled healer may be able to cure poisons or even resurrect other players. To accomplish this, you must be skilled in both healing, and anatomy. To cure poison, you must have a minimum of 60 skill in each area, and above 80 skill in each area, you may be able to resurrect ghosts.";
            m_map[1002086] = "Herding";
            m_map[1002087] = "Use of this skill will allow you to herd animals. To use this skill you must have a shepherd's crook. Double click the crook, and you will be given a targeting cursor. Simply target the animal you wish to herd, and then click the location you wish the animal to move to. The higher your skill, the more likely you are to successfully herd the animal.";
            m_map[1002088] = "Hiding";
            m_map[1002089] = "The hiding skill allows you to become invisible to other players. To use this skill, simply click the gem next to it in the skill list. If successful, you will become invisible to other players and monsters. You will be revealed if you move, speak, cast a spell, loot a body, attack someone or something, and other possible ways. It can be very difficult or impossible to hide while you are being attacked, so make sure to run a good distance away from your enemy and exit combat mode before attempting to hide. While you are hidden, you are not totally impervious to detection or attack. You can be revealed by spellcasters, the Detect Hidden skill, and can be tracked using the tracking skill. You can also take damage from area effect spells, and purple potions. You must remain wary even while hidden.";
            m_map[1002090] = "Inscription";
            m_map[1002091] = "This skill is used primarily to transcribe spells onto blank scrolls. To inscribe a spell onto a scroll, you must know the spell, have enough mana, and have the appropriate reagents for that spell in your pack (reagents will be consumed in the attempt). To begin, select the inscription skill from your skill list, then select a blank scroll. A scrolling list will appear which displays all of the spells you are capable of casting. From this list, select the spell you wish to inscribe.";
            m_map[1002092] = "To copy a spell from a scroll onto a spellbook, drag the scroll onto the book. Inscription is not necessary to do this.";
            m_map[1002093] = "To cast a spell from a scroll you can simply double click the scroll, and the spell will be cast. There are intelligence and magery requirements for casting spells from scrolls, but they are substantially lower than the requirements to cast them using magery.";
            m_map[1002094] = "Item Identification";
            m_map[1002095] = "Item Identification, if used successfully, will allow you to gather information about the chosen item. To use the skill simply click on the button and then click on the item to be identified. You will be given a description that varies in detail and accuracy depending on your skill level. (Depending on the ability of the user, the evaluation may be off by up to 50%)";
            m_map[1002096] = "Once you have identified an item, you will retain knowledge about that item.  Others will not benefit from your discovery, however.  They will have to identify the item themselves.";
            m_map[1002097] = "Lockpicking";
            m_map[1002098] = "The lockpicking skill is exactly that, it is used to open locked items. In order to attempt to pick a lock, you must have a set of lockpicks in your pack. Lockpicks can be purchased from thief shopkeepers.  Double-click on your lockpicks, and then target the item to be picked. Some locks are harder to pick than others (and some, such as house doors, are impossible to pick). Your skill level will determine your success rate.  If you are successful the lock will be picked, and you can open the item.";
            m_map[1002099] = "This skill is especially useful in hunting treasure from treasure maps. The treasure chests that are found will be locked and often trapped. Use of this skill along with detect hidden (to find any traps) will prove useful.";
            m_map[1002100] = "Lumberjacking";
            m_map[1002101] = "The use of the lumberjacking skill will allow you to gain raw materials in the form of logs. The logs can then be used for carpentry, bowyering, or tinkering. Simply equip a hatchet or an axe, double click the weapon and then click on a tree. If you are successful in recovering wood it will be placed in your pack.";
            m_map[1002102] = "Mace Fighting";
            m_map[1002103] = "Mace fighting is a melee combat skill, which allows for an quick attack style of fighting.  A mace fighter is capable of using a War Axe, Club, Hammer Pick, Mace, Magic Wand, Maul, Smithy Hammer, War Hammer, War Mace, Black Staff, Gnarled Staff, Quarterstaff, and Shepherd's Crook in combat to great effect.";
            m_map[1002104] = "Due to the heavy bashing of a mace weapon, mace fighters have the ability to damage the armor of their opponents and remove their stamina.";
            m_map[1002105] = "Mace fighting, like the other melee combat skills, requires that you have the appropriate weapon equipped.  Once you have the weapon equipped you will need to enter war mode.  You will need to double-click on an opponent to attack them.";
            m_map[1002106] = "Magery";
            m_map[1002107] = "This skill will allow you to cast a variety of spells in the game. The magery skill is automatically checked when you attempt to cast a spell, and your skill level will determine your chances of success in the attempt. To cast a spell, your hands must be free of any items (except a spellbook), you must have a spellbook with the appropriate spell contained therein, and you must have the appropriate reagents in your pack. Simply open the spellbook, choose the spell that you wish to cast, and double click the spell name. You can also click once on the spell name to get a more complete description of the spell, along with a 'tile' that represents the spell. If you wish, you can 'drag' the tile to your play area, and cast the spell by double clicking on the tile. Depending on the spell that you cast, you will be given different options for the next step, but the success or failure of your casting depends on your magery level.";
            m_map[1002108] = "If your spellbook does not contain a spell you wish to use often, simply acquire a scroll for that spell, and drag it into your spellbook. This spell will be added to the spells available for your use from this book.";
            m_map[1002109] = "It is also possible to cast a spell from a scroll. The proper reagents and skill are necessary to prepare the scroll initially, so casting from a scroll requires no reagents, and can be done with a lower level of skill.";
            m_map[1002110] = "Mages benefit greatly from meditation and evaluate intelligence skills.  Meditation improves the rate at which a mage regains lost mana and evaluate intelligence allows a mage to overcome an opponent's resistance to the mage's magic.";
            m_map[1002111] = "Mining";
            m_map[1002112] = "Cultivating the mining skill enables you to harvest the seams of ore that lie in the mines and mountains of Britannia. This ore can then be smelted into ingots (using the mining skill) and the ingots can then be used to craft various items, such as armor (using the blacksmithing skill).";
            m_map[1002113] = "To mine ore you must have either a shovel or a pickaxe in your possession. Double-click on the axe or shovel and then, when the targeting cursor appears, click on a mountainside or a cave wall. If successful, you will mine either a small, medium, or large pile of ore, dependent upon a number of factors. The known ore types, in order of their prevalence, are Iron (the most common), Dull Copper, Shadow Iron, Copper, Bronze, Golden, Agapite, Verite, and Valorite.";
            m_map[1002114] = "The rarity and chances of finding various ores varies directly with the skill level necessary to mine it. The more rare the ore, the higher the skill level necessary to mine it.";
            m_map[1002115] = "A miner who is also a tinker will often be able to be self-sufficient.  Tinkers are able to create shovels and pickaxes necessary for miners.";
            m_map[1002116] = "Musicianship";
            m_map[1002117] = "Use of the musicianship skill will allow you to play an instrument. The ability to play an instrument is necessary for some other skills such as discordance, provocation, and peacemaking. To use this skill, simply double click the instrument of your choice. A music sample will play if you succeed, but an ugly noise will occur if you fail. The higher your skill level, the greater your chances of playing a pretty tune.";
            m_map[1002118] = "Parrying";
            m_map[1002119] = "This skill is used to determine your proficiency at blocking attacks with a shield. If you are using a shield, this skill is checked automatically each time that you are attacked. If successful, your attacker may miss his attack, or do less damage than normal.";
            m_map[1002120] = "Peacemaking";
            m_map[1002121] = "Use of the peacemaking skill will allow you to stop all fights in your immediate area. This skill is related to your musicianship skill, and will automatically check this skill when you use peacemaking. To use the skill, you must click the jewel in your skills list, and then click on your instrument (or the game will remember the last instrument that you played). If you are successful, all fights in the immediate area will stop, at least for a moment. The higher your musicianship and peacemaking skills, the more likely you are to be successful.";
            m_map[1002122] = "Poisoning";
            m_map[1002123] = "The poisoning skill can be used to poison a weapon or even food and drink. This will cause damage to whoever is attacked with the poisoned weapon, or to whoever consumes the food or drink. To poison a weapon simply use the skill from your skill list, and then select the vial of poison you wish to use, and finally click on the item you wish to poison. If you poison a weapon, you will lose karma.  This item will now be poisoned until you use it. Once the poisoned weapon is used you will have to repeat the process to poison it again. The same process is used to poison food or drink. Select the skill and then click on the vial of poison. Then click on the consumable, and presto! The food or drink is now poisoned for a period of time. To create the vial of poison you will need to have the reagent nightshade, and then mix it in pestle and mortar. Once it is mixed, it will pour into the empty bottle in your pack. You can then use this green potion to poison items.";
            m_map[1002124] = "When you wish to poison an item, DO NOT double click the green potion first. If you do this, you will drink the poison. This does not give you the results you had hoped for, as you will have just poisoned yourself.";
            m_map[1002125] = "Provocation";
            m_map[1002126] = "This skill is used to encourage other creatures to fight one other. You will need a musical instrument to accomplish this task. To use the skill, first select the provocation skill from the skills list, target the instrument you wish to use (or the game will remember the one you last used), and then click in turn on each of the creatures you wish to fight one another. If you are successful the two creatures will fight for a time consistent with their respective natures and dispositions. Please keep in mind that you cannot provoke other characters.";
            m_map[1002127] = "Reagents";
            m_map[1002128] = "Black Pearls are rare, and are often referred to as the reagent of movement. When finely ground into a powder, black pearls can invoke spells that teleport of propel the caster to another location.";
            m_map[1002129] = "Blood Moss takes its name from its reddish color. Prevalent in wetter surroundings (such as marshes or swamps), this type of fungi is a base reagent for spells involving locomotion or animation.";
            m_map[1002130] = "The ground paste of a ripe bulb of garlic has a reputation for warding off evil. This effect accurately describes its use as a reagent as well. Modern magicians use garlic in spells that protect the caster (or a specified target) or dispel danger.";
            m_map[1002131] = "Ginseng is hailed as the reagent of health, as its syrup bestows both healing and restoration. Common Britannia folk use it as a home remedy for fatigue and sickness, but true magicians appreciate ginseng for its magical qualities and always keep a healthy portion on hand.";
            m_map[1002132] = "Mandrake Root is harder to find than other reagents, although it is probably the most commonly used of the eight base reagents. Like blood moss, it thrives in dark, dank, areas, where most dare not venture. Those that do search out this precious root are rewarded by being able to cast spells invoking strength and energy.";
            m_map[1002133] = "The nightshade plant is as deadly as its long-standing reputation. Its touch can poison a human; in a magical spell, it invokes powers of death, damage and illusion.";
            m_map[1002134] = "Spider's silk is an inexpensive reagent, as it is quite plentiful and light on one's back, even in large quantities. However, it is so fine that massive amounts of fibers are consumed by a single spell. True to its origin as webbing, this reagent calls forth summoning and binding spells.";
            m_map[1002135] = "Foul smelling but powerful, sulphurous ash is a dusty volcanic residue. It is found mainly in Britannia's mountainous regions and is a common element of any spell releasing fire, light, or explosive energy.";
            m_map[1002136] = "Remove Trap";
            m_map[1002137] = "The skilled rogue will be able to disarm traps using the Remove Trap skill. In order to begin learning the art of removing traps you must first demonstrate proficiency at Lockpicking, and Detect Hidden. You must have a base level of 50 skill in both of those skills before you can begin your training in this area. To use the Remove Trap skill, simply use the skill from the skill list, and target the item that you wish to disarm. If you are successful in your attempt, you will disarm the trap. Failure to disarm the trap stands the possibility of setting off the trap. The higher your skill level, the more difficult the trap you can disarm. You must be very careful when using this skill, it can be quite a risky proposition. To disarm traps, you must be quite nimble, and will find that wearing gloves makes this process much more difficult.";
            m_map[1002138] = "Snooping";
            m_map[1002139] = "The Snooping skill is used to see into another player's backpack. To use the snooping skill, simply double click on another player's pack, and if you are successful, the pack will appear open to you on the screen. Be warned however that a large majority of players do not care for a player who frequents the use of this skill. This skill is best used in conjunction with stealing. To steal from other players, you must be a member of the thief's guild.";
            m_map[1002140] = "Spirit Speak";
            m_map[1002141] = "Spirit Speak is used to be able to understand the speech of ghosts. If you do not have this skill you will only be able to see a series of ";
            m_map[1002142] = "Stealing";
            m_map[1002143] = "The skilled Pickpocket may be able to steal items in several manners, from a variety of sources. You may be able to steal from monsters, chests, NPC's, or other players (if you are a member of the thieves guild, or if they are an opponent in a guild war). You can attempt to steal in two ways. First, use the skill from your skill list, and target the container, creature, NPC, or player. This is a 'random steal' and will attempt to steal an item at random from this source. The second method is to first 'snoop' the container using your snooping skill, and then select a specific object to steal. Dragging this item into your inventory will check your stealing skill to determine your chances of success. The skilled pickpocket must be very dexterous in his or her work, and will find that the more armor you are wearing, the harder it will be to steal.";
            m_map[1002144] = "There are four possible outcomes to stealing:";
            m_map[1002145] = "-  True Success: you get the item and are not noticed";
            m_map[1002146] = "-  Partial Success: you get the item, but are noticed";
            m_map[1002147] = "-  Partial Failure: you do not get the item, but are not noticed";
            m_map[1002148] = "-  Total failure: you do not get the item, and your attempt is noticed";
            m_map[1002149] = "If your attempt is noticed, the guards can be called on you, so you must be very careful when attempting these practices. It is also important to note that for two minutes after stealing, the member of the Thieves' Guild is freely attackable by anyone in the area. In towns, the proscription against starting fights still applies, so even Thieves' Guild members will be safe from random attack, even if everyone knows of their affiliation.";
            m_map[1002150] = "As mentioned above, you will not be able to steal from other players unless you are a member of the thieves guild, or unless the target is an opponent in a guild war. You can join the thieves guild in the usual manner, by finding a Thief Guildmaster and asking him to join. There will be an entrance fee, and there are several entrance requirements. Your character must have adventured in the world for at least one week, must not have any murders to his name, and must have already demonstrated proficiency in stealing (60 skill minimum). The requirements to stay in the guild are stringent as well. If you are reported for murder, you will be summarily ejected from the guild, and cannot rejoin for one week. Also, once you join the guild, you cannot leave for one week, unless ejected from the guild. Thieves Guild members cannot report murders, and thus could be considered ";
            m_map[1002151] = "Swordsmanship";
            m_map[1002152] = "Swordsmanship is a melee combat skill, which allows for a strong-arm attack style of fighting.  A swordsperson is capable of using an axe, a battle axe, a double axe, an executioner's axe, a hatchet, a large battle axe, a pickaxe, a two-handed axe, a butcher knife, a cleaver, a skinning knife, a bardiche, a halberd, a broad sword, a cutlass, a katana, a longsword, a scimitar, or a viking sword in combat to slice there opponents to ribbons.";
            m_map[1002153] = "Only the one-handed weapons of a swordsman can be poisoned.  You must be careful when using a poison weapon, as the poison will damage the weapon and make it more likely to break.";
            m_map[1002154] = "Swordsmanship, like the other melee combat skills, requires that you have the appropriate weapon equipped.  Once you have the appropriate weapon equipped, you will need to enter war mode.  You will need to double-click on an opponent to attack them.";
            m_map[1002155] = "Tailoring";
            m_map[1002156] = "Use of the tailoring skill will allow you to make a wide variety of items, ranging from bandages to clothing, and even leather armor. Your raw materials can come from a variety of sources, from hunting animals for leather, to gathering cotton and spinning thread. You can also purchase materials from a vendor and craft them into items for resale.";
            m_map[1002157] = "To get leather from a cow, you will need to kill it and skin it.  In order to skin the cow, use a bladed weapon on the carcass.  This will leave hides on the corpse.  You may also get hides from other animals.";
            m_map[1002158] = "You may purchase cloth, or you may also find cotton lying in fields.  If you do find cotton, you may use the cotton.  This will bring up a targeting cursor.  Select a spinning wheel to use the cotton on and it will produce cloth.";
            m_map[1002159] = "Once you have your raw materials, you can make a wide variety of items. You need a sewing kit to tailor these items. A sewing kit can be purchased from a tailor.  Use the sewing kit with the materials in your pack. You will be given a window presenting the categories and items that you can craft with your skill level and materials. Choose the item you wish to make, and target the material if necessary. If you are successful, the item will be placed in your pack. If you do not have room in your pack, you will be unable to create the item. As your skill level rises, you will be able to make more complex items, and your chances for success will increase. After creating some items, you may wish to dye them to increase their appeal. You can do this by purchasing a dye tub, and some dyes. Just double click the dyes and select the tub you wish to use them on, then select the color you wish the tub to be. You can then dye items by double clicking the tub, and targeting the item you wish to dye.";
            m_map[1002160] = "Taste ID";
            m_map[1002161] = "Use of Taste Identification will allow you to determine the sort of potion you have in your possession, or to determine if an object is poisoned or not. Simply use the skill from the jewel on your skill list, and then target the item you wish to taste. If successful, you will be told what kind of potion it is (if the object is a potion) or whether or not it's poisoned (if it's not a potion).";
            m_map[1002162] = "Tinkering";
            m_map[1002163] = "The tinkering skill is used to make tools for other professions, and also to make clocks, sextants, and to trap containers. With this skill you can make hammers, tongs, scissors, smoothing planes, and numerous other tools. To make these tools and assorted items you will need a set of tinker's tools. First double-click on the tinker's tools, and then select your supply of metal or wood. A window will open displaying the items that you can make from the raw materials available (either wood or metal). You will need ingots for metal and boards for wood.  Some additional items may be necessary, such as gems for rings.";
            m_map[1002164] = "To place a trap on a container you must have a chest or other container, a poison potion, explosive potion, or crossbow bolt, and a small supply of metal. Use your tinker tools, then target your metal, and choose the type of trap you wish to make. Last, target the container you wish to trap. If successful, the container will become trapped, and the trap you have created will affect the next person who illegally opens this item. Using the proper key on this container will bypass the trap and allow you to open the chest safely. The strength of your trap will be directly related to your skill as a tinker.";
            m_map[1002165] = "Tracking";
            m_map[1002166] = "The tracking skill will allow you to track animals, monsters, and people. Use the skill by clicking the jewel on your skill list. You will be presented with a window, which will allow you to choose what you wish to track. Double-click the category you wish to track (animal, human, or monster), and you will be presented with a second window listing the specific PCs or NPC's that you can track. If you are successful, and an appropriate creature can be tracked, you will be told in what direction that creature can be found. The higher your skill level in tracking, the more likely you are to successfully track an object, and the farther you will be able to track it.";
            m_map[1002167] = "Veterinary";
            m_map[1002168] = "The veterinary skill will allow you to heal animals in much the same way that the healing skill works on people. To use the skill, simply double-click on a bandage, you will receive a targeting cursor, and then target the animal you wish to heal. The amount of healing that you provide will be based on your skill level.";
            m_map[1002169] = "Wrestling";
            m_map[1002170] = "This skill is used while in hand-to-hand combat (no weapon equipped). It is checked automatically when you fight, and may determine the frequency, and damage level with which you will strike your opponent. ";
            m_map[1002171] = "The wrestling skill has several uses in combat and may even be used to stun opponents.  If you do not have a weapon equipped and you attack a creature, your wrestling skill will come into play.";
