            m_map[1011016] = "Using a bedroll in the safety of a camp will log you out of the game safely. If this is what you wish to do choose CONTINUE and you will be logged out. Otherwise, select the CANCEL button to avoid logging out at this time. The camp will remain secure for 10 seconds at which time this window will close and you not be logged out.";
            m_map[1011017] = "<center>FAREWELL!</center>";
            m_map[1011018] = "You have elected to leave the township of Haven. If you do not wish to leave select cancel. Please select a town from the list below.";
            m_map[1011019] = "You must now leave the township of Haven. If you do not select a town to go to one will be picked at random. Please select a town from the list below.";
            m_map[1011020] = "Many people in town can improve your skills. To find out if I can improve skills you are interested in simply walk up to me and say 'TRAIN'. I will give you a list of the skills that I'm proficient in. To choose the skill you want to train in, say 'TRAIN' and the name of the skill you'd like to be trained in, and I will tell you the cost. Drag the gold from your backpack and drop it onto me, and your skill will be increased. If you don't have enough for the full payment, you can pay less but your training won't be as complete and you won't gain as much skill as you could if you paid the full amount. The amount of skill that can be raised is dependant on the ability of the teacher, so it is best to seek out Grand Masters when trying to learn the most about a particular skill. Remember that there is an overall limit to the amount of skills that you can learn, so you may not want to try to learn all of the skills in this manner.";
            m_map[1011021] = "<center>TRAINING SKILLS</center>";
            m_map[1011022] = "<center>Resurrection</center>";
            m_map[1011023] = "It is possible for you to be resurrected here at the Chaos Shrine. Do you wish to try?<br>CONTINUE - You chose to try to come back to life now.<br>CANCEL - You prefer to remain a ghost for now.";
            m_map[1011024] = "It is possible for you to be resurrected here at this shrine of the Virtues. Do you wish to try?<br>CONTINUE - You chose to try to come back to life now.<br>CANCEL - You prefer to remain a ghost for now.";
            m_map[1011025] = "It is possible for you to be resurrected here by this healer. Do you wish to try?<br>CONTINUE - You chose to try to come back to life now.<br>CANCEL - You prefer to remain a ghost for now.";
