            m_map[1011037] = "<center>BUYING AND SELLING</center>";
            m_map[1011038] = "Hello. I am a shopkeeper. If you would like to buy or sell any items, then simply find a shopkeeper and say to them 'VENDOR BUY' in order to see the list of items they sell, or 'VENDOR SELL' in order to see if they're interested in buying anything you own. If you do have any items in your pack that a vendor is interested in purchasing, saying 'VENDOR SELL' will cause him to look through your pack and show you a list of the items he's interested in, as well as what he'll pay for each item. If he's not interested in anything you possess, he will let you know that as well. To purchase an item, simply look through the list that appears when you say 'VENDOR BUY' and select any item you can afford. It will appear at the bottom of your list, along with a running total of your current purchases.";
