            m_map[1013000] = "You have been detected using an unauthorized third party program. Use of this type of program is specifically prohibited by the Ultima Online Rules of Conduct found at: http://www.uo.com/conduct.html<br>Specifically:<br>14) You will not attempt to interfere with, hack into, or decipher any transmition to or from the servers running the Ultima Online Service.<br>This action has been logged and noted on your account records. Any repeated use of this unauthorized third party program will result in action being taken against your account including suspension or termination. Please don't use unauthorized programs with Ultima Online.";
            m_map[1013001] = "<center>Welcome to Test Center!</center><br>This is a non-production shard existing for the sole purpose of testing new code before release to the production shard. It is open to the public with all of the same rules as a regular shard: http://www.uo.com/conduct.html and http:/www.uo.com/service.html.<br><br>GM Support is not available on this shard, as it is a development tool and not a production shard: http://support.uo.com/gm_20.html<br><br>Additionally, it is required that you refrain from interfering with or harassing OSI testing staff. They will be recognizable by the letters 'OSI' in their name. Please familiarize yourself with the Test Center Policy as well: http://update.uo.com/general.html<br><br>If you would like to participate, a list of current features on Test Center can be found at: http://update.uo.com/next.html<br><BR>Please send any bugs to TCbugs@uo.com<br><BR>NOTICE: The files for new houses can be found at: ftp://ftp.owo.com/pub/uo/houses";
            m_map[1013002] = "<center>Siege Perilous!</center><br>The Siege Perilous shard is an advanced shard with a slightly different set of rules, and is not for the faint of heart. Before creating a character on the Siege Perilous shard you should read the full details about Siege Perilous at: http://guide.owo.com/siege_0.html<br><br>*You will be limited to one character so choose wisely when you create your character.<br><br>*You should not venture into Siege Perilous if you are not currently envied, worshiped, deified at the very least hailed as Lord or Lady on a current shard.<br><br>*It is very likely you will meet an untimely demise at the hands of another player...often.<br><br>We welcome you to Siege Perilous!";
            m_map[1013003] = "MORE-OPEN WEBPAGE";
            m_map[1013004] = "<center> Renouncing 'Young Player' Status</center>";
            m_map[1013005] = "As a 'Young' player, you are currently under a system of protection that prevents you from being attacked by other players and certain monsters.<br><br>If you choose to renounce your status as a 'Young' player, you will lose this protection. You will become vulnerable to other players, and many monsters that had only glared at you menacingly before will now attack you on sight!<br><br>Select OKAY now if you wish to renounce your status as a 'Young' player, otherwise press CANCEL.";
