            m_map[1014000] = "A goodly carpenter lives not far from the market square before the castle gate.";
            m_map[1014001] = "A quite well-appointed provisioner's exists East of the river, just North of the Lighthouse.";
            m_map[1014002] = "Ah, 'tis a terrible thing, but the graveyard far to the south has become infested with the living bones of the dead.";
            m_map[1014003] = "An inn called Sweet Dreams lies next to the Main Gate, just East of the healer's shop.";
            m_map[1014004] = "Blackthorn stays out of sight mostly, sequestered in his castle up North of Britain.";
            m_map[1014005] = "Blackthorn's castle is on an island in the middle of a lake North of Britain.";
            m_map[1014006] = "Britain is bounded by two rivers. The Narrows is on the west and Brittany River on the east.";
            m_map[1014007] = "Despite its name, the Sweet Dreams inn is quite good. It is near the Main Gate.";
            m_map[1014008] = "He liveth here, in Britain, in his castle.";
            m_map[1014009] = "I know naught of thieves!";
            m_map[1014010] = "If there be one thing Britain is not lacking, it be inns!";
            m_map[1014011] = "If there's not a mapmaker to be found at the Oaken Oar, then I can't help thee much.";
            m_map[1014012] = "LB? Mayhap thou means Lord British ....";
            m_map[1014013] = "Long ago the Narrows were dug up to meet the moat, and now 'tis fed from the water of Brittany Bay.";
            m_map[1014014] = "Lord British supports the arts. There is a public theatre across from the Bardic Conservatory.";
            m_map[1014015] = "Narrows Neck is the name for the river mouth on the southwestern side of Britain.";
            m_map[1014016] = "That is the name of the old gate beside the castle moat, for once the poor came in through there to go to market. It is quite narrow.";
            m_map[1014017] = "That's the river that runs down the middle of the city.";
            m_map[1014018] = "The alchemist can be found with the mages in the the magic shop in front of the Main Gate.";
            m_map[1014019] = "The ankh in the temple is capable of restoring life to the dead. 'Tis in northern part of town, beside the river.";
            m_map[1014020] = "The blacksmith North of the Miner's Guild can probably sell thee anything thou might need.";
            m_map[1014021] = "The Blue Boar is just North of the library, on the river.";
            m_map[1014022] = "The butcher can be found between the docks, near the customs house.";
            m_map[1014023] = "The Cat's Lair is a bit disreputable, as it lies near the docks, but its beer is good.";
            m_map[1014024] = "The center of the musical arts in Britain is the Bardic Conservatory on the north side of town.";
            m_map[1014025] = "The city's sole veterinarian lives by the river, by the Mage's Bridge.";
            m_map[1014026] = "The Customs office checks imported goods. 'Tis on the waterfront.";
            m_map[1014027] = "The farms in this area are all in the countryside, to the west of Lord British's castle. Thou must cross the Narrows and follow the road there.";
            m_map[1014028] = "The First Bank of Britain lies next to the jeweler's, beside the moat.";
            m_map[1014029] = "The guildhall of the Mechanicians, or the Tinkers as some call them, is right beside Poor Gate.";
            m_map[1014030] = "The Mage Tower is the building with all the arches, made of grey stone, on the north side of the town.";
            m_map[1014031] = "The Main Gate divides the central city from the waterfront.";
            m_map[1014032] = "The Northside Inn is situated on the lake that surrounds Blackthorn's Castle.";
            m_map[1014033] = "The Oaken Oar houses excellent shipwrights. It is on the waterfront by the mouth of the Narrow Neck.";
            m_map[1014034] = "The ocean is to the south of Britain.";
            m_map[1014035] = "The Salty Dog is a tavern overlooking the park, right next to The Wayfarer's Inn.";
            m_map[1014036] = "The Warrior's Guild is housed in the Old Keep.";
            m_map[1014037] = "The waterfront is what many call everything south of the old city wall. Properly speaking, it runneth along the river from River's Gate Bridge, down along the water to the Oaken Oar and the Narrows.";
            m_map[1014038] = "The Wayfarer's Inn is beside the Mage's Gate, on the East side of the river.";
            m_map[1014039] = "The weapons trainer? Ah, that is on the north edge of town, on the eastern bank of the river. 'Tis called the Cavalry Guild.";
            m_map[1014040] = "There are many guilds in this city. 'Tis the benefit of living in Lord British's capital.";
            m_map[1014041] = "There are two gates in the old city walls. The Poor Gate, and the Main Gate are the names.";
            m_map[1014042] = "There are two guardhouses. One near the Gung-Farmer's Bridge, and the other next to Virtue's Pass.";
            m_map[1014043] = "There be a guildhall for the artisans of the town outside the old walls, south of the Armorer's.";
            m_map[1014044] = "There is a blacksmith beside the castle moat on the northern edge of town.";
            m_map[1014045] = "There is a healer on the market square, near the Main Gate.";
            m_map[1014046] = "There is a jeweler's just to the South of the Artist's guild.";
            m_map[1014047] = "There is a leatherworker's shop facing the market square.";
            m_map[1014048] = "There is a Mining Guild beside the city library.";
            m_map[1014049] = "There is a plague of orcs on the western side of the farms--if thou seekest their encampments, that is the place to look.";
            m_map[1014050] = "There is an armourer's shop beside the Mage Gate. Just South of the old city wall.";
            m_map[1014051] = "There's a baker on the market square before the castle gate.";
            m_map[1014052] = "Thou canst buy weapons at the blacksmith's shop.";
            m_map[1014053] = "Thou canst purchase clothes on the East side of the river, near the Cypress Bridge.";
            m_map[1014054] = "Thou canst see that the old city walls are of a different vintage stone than the castle proper. 'Twas built before the current castle buildings.";
            m_map[1014055] = "'Tis an expensive place, but the Unicorn Horn, overlooking the ocean on the east side, serves a decent ale.";
            m_map[1014056] = "'Tis being repaired, but it stands on the promontory o'erlooking Brittany Bay.";
            m_map[1014057] = "'Tis the bay on our southern coast.";
            m_map[1014058] = "Try the bowyer just East of the theatre.";
            m_map[1014059] = "Try the stables beside the Mage Tower.";
            m_map[1014060] = "Which sort of smith? Weaponsmith, blacksmith?";
            m_map[1014061] = "Blackthorn's castle is on an island in the middle of a lake North of Britain.";
            m_map[1014062] = "Incantations and Enchantments is in the middle of eastern Britain, on the south side of the park.";
            m_map[1014063] = "There are many bridges across the Brittany. There's the Great Northern Bridge at the north-most end, the Mage's Bridge, then the one we call Virtue's Pass. South of that there's Cypress Bridge, and the River's Gate Bridge. And, of course, the Gung-Farmer's Bridge connects Britain with the farmlands to the West.";
            m_map[1014064] = "The bridge next to the Mage's tower is thus called the Mage's Bridge.";
            m_map[1014065] = "The Cypress Bridge is surrounded on one side by a tailor's shop and on the other by a magic shop.";
            m_map[1014066] = "The Great Northern Bridge is so called because it's the Northern-most bridge in Britain.";
            m_map[1014067] = "The Gung-Farmer's Bridge connects all the farms with Britain proper.";
            m_map[1014068] = "The Southernmost bridge is called River's Gate.";
            m_map[1014069] = "There are three or four merchants of the arcane in Britain.";
            m_map[1014070] = "There's the Salty Dog, The Unicorn's Horn, The Cat's Lair, and The Blue Boar taverns, here in Britain.";
            m_map[1014071] = "Thou art in Britain.";
            m_map[1014072] = "Thou can find the Ethral Goods Magic Shop just south of the Main Gate. Next to the Premier Provisioner's shop.";
            m_map[1014073] = "Thou can get to the Sage Advice Magic Shop on the east side of the river.";
            m_map[1014074] = "Thou can purchase arcane goods at the Sorcerer's Delight - which some call the Mage Tower. It can be found in northern Britain, next to the Conservatory of CoreMusicPlayer.";
            m_map[1014075] = "Thou can work on thy swordplay at the old keep, south of Lord British's castle.";
            m_map[1014076] = "Ah, the weather... 'Tis an interesting thing, really. No matter what the season, no matter what enchantments are cast, our land is almost always blessed with clear and beautiful blue skies.";
            m_map[1014077] = "Bedrolls can be purchased from a provisioner.";
            m_map[1014078] = "Britanny Bay is the body of water on the edge of Britannia's capital.";
            m_map[1014079] = "Certainly, thou art welcome.";
            m_map[1014080] = "Cove? Thou shouldst find it North and East of Britain.";
            m_map[1014081] = "Dupre? Ah, yes, Lord British's friend and ally, I believe. If thou wert to search for him, I wouldst most recommend a tavern.";
            m_map[1014082] = "Excellent. 'Tis my lucky day.";
            m_map[1014083] = "Farewell.";
            m_map[1014084] = "Goodbye.";
            m_map[1014085] = "Greetings.";
            m_map[1014086] = "Hello.";
            m_map[1014087] = "Here.  In Town.";
            m_map[1014088] = "I accept.";
            m_map[1014089] = "I am well.";
            m_map[1014090] = "I cannot help thee.";
            m_map[1014091] = "I cannot speak but fondly on my homeland. Yet I would not forgo an opportunity to see other lands.";
            m_map[1014092] = "I can't take it. Sorry.";
            m_map[1014093] = "I don't want it. Sorry.";
            m_map[1014094] = "I have heard that the great dungeons sometimes have great treasures.";
            m_map[1014095] = "I know not of which thou doth speak.";
            m_map[1014096] = "I live here in _Town_.";
            m_map[1014097] = "I live in the town that thou art standing in.";
            m_map[1014098] = "I really don't need it.";
            m_map[1014099] = "I shall accept with pleasure.";
            m_map[1014100] = "I shall be happy to take it!  Thank thee!";
            m_map[1014101] = "I will take it, then.";
            m_map[1014102] = "I work here in town.";
            m_map[1014103] = "I work in the town that thou art in.";
            m_map[1014104] = "I would not live in Buccaneer's Den if I were thee, for it is home to the most vile men and women to sail the seas.";
            m_map[1014105] = "If thou art able to hunt the wild animals, sometimes thou can sell the meat that thou dost carve from them to a butcher.";
            m_map[1014106] = "If thou art wanting a respite from the rigors of Britannia, then thou can make a camp or check in to an Inn, whichever is the most convenient.";
            m_map[1014107] = "If thou can get an axe, perhaps thou could cut some trees into useful boards for woodworkers. They may be willing to pay thee for them.";
            m_map[1014108] = "If thou dost happen upon some ore, go to the blacksmith's shop and try to craft some armor or weapons. I have heard that it just takes practice.";
            m_map[1014109] = "If thou dost want to earn money, practice a skill. Make things and sell them to the public. Most shopkeepers will let thee use the tools and materials that they aren't using.";
            m_map[1014110] = "I'm doing relatively well.";
            m_map[1014111] = "Iolo? Ah, yes, Lord British's friend and ally, I believe.";
            m_map[1014112] = "It's essential to have good kindling and a bedroll if thou dost want to camp.";
            m_map[1014113] = "I've been needing one of these.";
            m_map[1014114] = "I've heard that Lord Blackthorn has written a couple of books describing his philosophies in-depth. If thou dost find these, I imagine thou wouldst be able to say better than I what Blackthorn is about.";
            m_map[1014115] = "Just fine.";
            m_map[1014116] = "Let's see... I remember the names of Shame, Wrong, Despise, and Hythloth. I've never owned a map of Britannia myself.";
            m_map[1014117] = "Lord Blackthorn wishes the freedom of choice in ALL things extended to everyone. Some say that he'd even sees the Orcs and Lizardmen as equals to the humans in Britannia.";
            m_map[1014118] = "Lord Shamino? Ah, yes, Lord British's friend and ally, I believe.";
            m_map[1014119] = "Not a problem.";
            m_map[1014120] = "Only the bravest knights belong to the Order of the Silver Serpent. 'Twas they who defeated the forces of Lord Robere.";
            m_map[1014121] = "Our moons are called Trammel and Felucca. They control the moongates.";
            m_map[1014122] = "Please back away a bit.";
            m_map[1014123] = "Please, keep it. I don't want it.";
            m_map[1014124] = "Right here.";
            m_map[1014125] = "Shrines to the virtues are spread around our land. I've heard that they can even resurrect the dead.";
            m_map[1014126] = "Tanners will buy hides and pelts that thou dost take from the animals thou dost hunt.";
            m_map[1014127] = "Thank thee!";
            m_map[1014128] = "Thank thee, but I don't want it.";
            m_map[1014129] = "Thank thee. Don't need any.";
            m_map[1014130] = "The moongates? They are... doors to different parts of Britannia. Except the destinations of the doors change with the phases of the two moons.";
            m_map[1014131] = "The name is familiar to me... ah, yes -- I believe he is the infrequent guest of Lord British. Mayhaps thou wilt find him sampling the local spirits.";
            m_map[1014132] = "There are many as yet unmapped places beneath Britannia. 'Tis rumored to be riches and magic in them. And creatures that will rend the flesh from thy bones.";
            m_map[1014133] = "This will come in handy indeed.";
            m_map[1014134] = "Thou art most kind!";
            m_map[1014135] = "Thou art most kind, but it isn't anything that I need.";
            m_map[1014136] = "Thou art nearer to me than I like.";
            m_map[1014137] = "Thou can find a good deal of treasure under Britannia. Look to the caves and what thou call dungeons.";
            m_map[1014138] = "Thou can sell feathers from birds to a bowyer. And a cook may purchase the bird itself from thee.";
            m_map[1014139] = "Thou shouldst be able to get kindling from any wood thou finds. If thou has an axe, of course.";
            m_map[1014140] = "Thou shouldst learn to use the moongates if thou dost plan to travel far. The key is in the phases of the moons.";
            m_map[1014141] = "Though a kind and generous man in his youth, Lord Robere thirsted for power in his later years, so legends say.  Had not the Order of the Silver Serpent been ready to fight for Lord British, this very land could have belonged to the ambitious conqueror.";
            m_map[1014142] = "Thou'rt welcome.";
            m_map[1014143] = "Tis the bay that touches the city of Britain.";
            m_map[1014144] = "Tis very generous of thee, but I don't need it.";
            m_map[1014145] = "Tis very generous of thee.";
            m_map[1014146] = "Various issues surface from time to time, such as taxation, invasion, protection form creatures of the wild.";
            m_map[1014147] = "Vesper? 'Tis a city in northeastern Britannia. Ore from the mines of Minoc are sent down river to be unloaded in Vesper.";
            m_map[1014148] = "Well, well, what have we here?";
            m_map[1014149] = "Why standest thou so near to me?";
            m_map[1014150] = "Wilt thou stand back a bit";
            m_map[1014151] = "Aye, we have a tanner. He's in the center o' town.";
            m_map[1014152] = "Britain thou'rt askin' about? I'm told 'tis the biggest city in the land. Don't see what all t'fuss is about. The size of hereabouts is plenty big for me.";
            m_map[1014153] = "Britain? 'Tis the capital of the whole wide world, o'course. Sits on the shore of Britanny Bay way off yonder.";
            m_map[1014154] = "Healing shrines are found all about Britannia.";
            m_map[1014155] = "I know nothing of any avatar.";
            m_map[1014156] = "I may have heard a legend of a city called Wind. It was in the mountains, if I recall.";
            m_map[1014157] = "If thou'rt looking for Trinsic, 'tis south, but along the eastern coast.";
            m_map[1014158] = "I've never seen Lord British myself.";
            m_map[1014159] = "Jhelom? 'Tis to be found at the very most northern tip of the largest Valarian Isles.";
            m_map[1014160] = "Nujel'm is an island city. Part of Britannia, but ... different.";
            m_map[1014161] = "Ocllo ... hmmm. 'Tis an island, I believe.";
            m_map[1014162] = "Our healer sets to the east side, between the two bridges. If thou seest the inn, thou hast gone too far north.";
            m_map[1014163] = "Our inn is up past the northern bridge.";
            m_map[1014164] = "Right beside the woodworker and blacksmith, thou'lt find our bathhouse.";
            m_map[1014165] = "Skara Brae? Thou canst not get more west than that!";
            m_map[1014166] = "The blacksmith is to the northwest, past the bath house.";
            m_map[1014167] = "The provisioner is southmost in town.";
            m_map[1014168] = "The tanner set up shop south of the healer.";
            m_map[1014169] = "The taverns are south, west of the provisioner.";
            m_map[1014170] = "The woodworker is next to the blacksmith.";
            m_map[1014171] = "Thou'rt in Buccaneer's Den.";
            m_map[1014172] = "Trinsic? 'Tis near the Cape of Heroes, I think.";
            m_map[1014173] = "Verity Isle is Moonglow's whereabouts. The island is named so for the city puts much store in lofty intellectual pursuits.";
            m_map[1014174] = "Vesper can be found on the eastern coast of Britannia, to the north.";
            m_map[1014175] = "Yew ... ahh, that is near to Empath Abbey. That's the land from whence the best wine comes.";
            m_map[1014176] = "I know many virtuous people.";
            m_map[1014177] = "If thou'rt in need of medical attention, there is none better to visit than our healer on the southern side of our village.";
            m_map[1014178] = "Our armourer is a fine hand with metal and leather. Feel free to view his wares in his shop two or three doors north of the healer.";
            m_map[1014179] = "Our lighthouse stands proud and straight to the north of the village ... not even a long walk's distance.";
            m_map[1014180] = "The orcs are bolder here than they dare elsewhere. They come from the fort to the south.";
            m_map[1014181] = "The orcs live safe in their fortress to the south, and when they set out, we have no warning.";
            m_map[1014182] = "This is Cove, friend. Not as fancy as a big city town, but a good place, with good people.";
            m_map[1014183] = "We have a small dock. 'Tis on the north side of town, right on the water, o'course.";
            m_map[1014184] = "A bit of action, eh? The Dueling Pit is in the center of town, of course.";
            m_map[1014185] = "Cemetery? We've got one, sadly a necessity, and it's to the far west of town.";
            m_map[1014186] = "Docks? Why, there are no less than four docks in Jhelom. One to the east of the main town, and one to the south, another on our northernmost island, and one on our southernmost isle.";
            m_map[1014187] = "Food can be most easily purveyed from the small shop a bit north and east of the town's southern docks.";
            m_map[1014188] = "If thou art looking for Jhelom's inn, it is north of the main southern docks.";
            m_map[1014189] = "I'll not ask thy business at the Thieves' Guild. 'Tis just south of the Dueling Pit, beneath the Library.";
            m_map[1014190] = "I'm told our weapons shop is one of the best. It is west and south from the Dueling Pit.";
            m_map[1014191] = "In my opinion, we have a fine woodworker. I'd call his shop south-central, though 'tis a bit to the east.";
            m_map[1014192] = "Indeed, the Fighters' Guild is in Jhelom. In fact, there are two. One is at the northern edge of the town, just west of the blacksmith. One is the farthest building south.";
            m_map[1014193] = "Jhelom is any mercenary's second home. 'Tis no finer place for selling thy sword arm. While it's still attached, at least.";
            m_map[1014194] = "Last I saw, there was a mage's shop just north of the theater. That's on the southern isle, thou knowest.";
            m_map[1014195] = "Library? We've got one, friend, and it's just south of the Dueling Pit.";
            m_map[1014196] = "Lord British? Why, he's our ruler, of course!";
            m_map[1014197] = "Our tinker is north and east of the main isle's southern gate.";
            m_map[1014198] = "Ranches are on the north-most island.";
            m_map[1014199] = "Sure, every fighter is interested in armor. My favorite is the nearest building to the eastern gate. There's another, too, at the south end of town.";
            m_map[1014200] = "The baker is north of the Weapons shop, west of the Dueling Pit.";
            m_map[1014201] = "The best place to buy fish is found just east of the Dueling Pit.";
            m_map[1014202] = "The clothes shop is to the southwest of town, betwixt the jeweler and the Thieves' Guild.";
            m_map[1014203] = "The Fisher's Guild is the most southern thing in the town, friend.";
            m_map[1014204] = "The guard tower is south of the Dueling Pit, on the far side of the library.";
            m_map[1014205] = "The Healer? Why close on to the Dueling Pit, of course!";
            m_map[1014206] = "The shipwright is nearest the town's eastern docks, but south of the armourer.";
            m_map[1014207] = "The tailor? That shop is on the southern island. It's a small island, but still Jhelom, right enough.";
            m_map[1014208] = "The Theater is on the southern isle.";
            m_map[1014209] = "Thou canst find him to the west of town, past the clothier and the Thieves' Guild.";
            m_map[1014210] = "Thou wilt find a provisioner on the eastern side of the main town, midway between northmost and southmost.";
            m_map[1014211] = "Town Hall? Find the Dueling Pits, near the center of town, then head a few paces north and east.";
            m_map[1014212] = "Town tavern? 'Tis a grand place for ale and perhaps a brawl or two. I recommend it. Head east from the Dueling Pit, and when thou smellest fish, turn right.";
            m_map[1014213] = "We do have blacksmith shops, one north of the city, just west of Town Hall, and another to the south, near the southern docks.";
            m_map[1014214] = "We have two. One south of town, and one on the southern isle.";
            m_map[1014215] = "A fine tavern is located in the southeast section of the city, near the bakery.";
            m_map[1014216] = "A small island southeast of the main city, is where the council meets in the House of Parliament.";
            m_map[1014217] = "Above the magic shop located in the southern part of the city, the mage's guild has a lovely meeting hall.";
            m_map[1014218] = "Artists are rare in Magincia. We import most of our artwork. 'Tis too much work and effort to create it ourselves.";
            m_map[1014219] = "Magic doth provide a variety of conveniences. But 'tis more a variant of technology than the manipulation of ether, that keeps our houses clean without having to work at it.";
            m_map[1014220] = "Many a great speech hath been heard in the town square in the north of the city, beside the temple.";
            m_map[1014221] = "New Magincia? 'Tis nothing wrong with this fine city ... we do not need a new one.";
            m_map[1014222] = "Parliament doth consist of a nine member council. The retiring council member hath the responsibility of appointing their replacement.";
            m_map[1014223] = "The bakery is located on the southeastern tip of the main island before you cross the bridge to Parliament.";
            m_map[1014224] = "The best tailor is located next to the shipwrights on the far southwest side of the city.";
            m_map[1014225] = "The docks are located on the far south side of the city.";
            m_map[1014226] = "The fish market is located on the city's docks, on the south side.";
            m_map[1014227] = "The healer's hall is on the westernmost street in the city, toward the southern end, near the tailor's and the fish market.";
            m_map[1014228] = "The jeweler's shop is located on the far west side of the city, between the Miner's Guild Hall and the tailor's shop.";
            m_map[1014229] = "The local inn is located nearly in the exact centre of the city. A small park lies to the north of it.";
            m_map[1014230] = "The merchants meet in the building behind the fish market. 'Tis near the docks on the south side of the city.";
            m_map[1014231] = "The miner's guild is located on the western edge of town, behind the inn.";
            m_map[1014232] = "The people of Magincia are direct descendants of those who forged the world, and one day we will inherit the world, and make our way to the stars and take our place as the rulers of all the lands below. We have good cause to be proud.";
            m_map[1014233] = "The pirates of Buccaneer's Den resent our wealth, but hath begun to raid less and less often thanks to magical items of protection purchased from Moonglow.";
            m_map[1014234] = "The provisioner shares space with the fish market. 'Tis located on the city docks on the far south end of the city.";
            m_map[1014235] = "The shipwrights, why 'tis located on the south side of the city on the docks.";
            m_map[1014236] = "The temple is located near the beach to the far north, just east of the town square.";
            m_map[1014237] = "The tinker's shop is located just south of the steps leading toward the town square on the north end of town.";
            m_map[1014238] = "There's a warehouse that stocks all kinds of goods on the east side of the city near the tinker's shop.";
            m_map[1014239] = "Thou canst purchase magical goods in the southern end of the city along the central street.";
            m_map[1014240] = "Both Miners' Guild halls are near the center of town.";
            m_map[1014241] = "Dancing is a sport in Minoc. Sometimes the music is louder than the blacksmith's anvil next door.";
            m_map[1014242] = "I do not know of a place called 'Buccaneer's Den'.";
            m_map[1014243] = "Miners' tents are east and south of town. They stay close to the mines, mostly.";
            m_map[1014244] = "Minoc is about thee. There is not much north of here, friend.";
            m_map[1014245] = "Minoc is not so large a city that we must separate the homes from the businesses. Houses are throughout the town.";
            m_map[1014246] = "Our healer's shop is in the southeastern corner of town.";
            m_map[1014247] = "Soldiers and professional fighters all gather in their hall, which is near center of town, one door south of the tavern.";
            m_map[1014248] = "Supplies are a steady business in Minoc. We have a provisioner on both the north and south sides of town.";
            m_map[1014249] = "The butcher's shop is at the very northwest corner of Minoc.";
            m_map[1014250] = "The horses are kept a bit apart from the town. The stable is north, just northeast of the tavern.";
            m_map[1014251] = "The mines are due east of town.";
            m_map[1014252] = "The tavern is in the north part of town, near to the butcher and warriors' guild.";
            m_map[1014253] = "The woodworker has a good selection of material in these parts. The shop is on the east side of town, just a bit of wander north of the tanner.";
            m_map[1014254] = "Thou'lt find our tinker in the center of Minoc.";
            m_map[1014255] = "Thou'rt lookin' for the blacksmith? The smithy is on the far side of town from the stables.";
            m_map[1014256] = "We have but one tanner, and thou'lt find the shop south, but not so far as the provisioner.";
            m_map[1014257] = "We have two guilds: the Warriors' and the Miners'.";
            m_map[1014258] = "We think pretty highly of our armourer. His shop in the southeast corner of town has brisk business.";
            m_map[1014259] = "All manner of baked goods can be found just south of the docks.";
            m_map[1014260] = "Fine armour can be had from the armoury in the center of town. Look to the west of Moonglow, to one side of the street that leads west out of town.";
            m_map[1014261] = "Fresh fruit can be had at a humble store near the center of town. It is just south of the inn, if thou'rt interested.";
            m_map[1014262] = "If it were not for the zoo in southern Moonglow, the mages would have to trek into the wilds to view these humble creatures ... and grass stains make for angry apprentices.";
            m_map[1014263] = "If thou'rt looking for the town hall, look to the southwest corner of the heart of Moonglow.";
            m_map[1014264] = "Indeed, Moonglow has several Mages' Guilds. Three in fact. One to the south, one to the east and one to the north.";
            m_map[1014265] = "Master mages are usually professors at the Lycaeum. They can be found there, or in their homes, or sometimes about the streets of Moonglow. They are usually willing to answer questions.";
            m_map[1014266] = "Moonglow was founded by Lord British to be a research colony. The Lycaeum is where the research takes place. Nearly all new magic in Britain comes from that building on the northwest peninsula.";
            m_map[1014267] = "North of the Gadgeteers' Guild is a mage scholar who will teach travelers his lore, regardless of whether they attend the Lycaeum.";
            m_map[1014268] = "Our healer is in the central part of Moonglow, on the far western side. It is but two doors away from the teleporters, and that's a good thing, I promise.";
            m_map[1014269] = "Our tailor has a central location, just across the street from the provisioner.";
            m_map[1014270] = "Reagents are quite in demand in Moonglow. There is a store devoted to their sale, close by the teleporters.";
            m_map[1014271] = "Teleporters? Well, there's one near the Lycaeum, of course, one by the zoo, one near the eastern residence section, and one near the northern houses.";
            m_map[1014272] = "The artists live near their guildhall. If thou'rt interested in visiting Moonglow's bastion of the finer arts, look to the east of the main town area. The artists are close by where the road turns northward.";
            m_map[1014273] = "The best place in Moonglow to buy supplies would be at the provisioner's shop, just south of the docks.";
            m_map[1014274] = "The butcher is across the street from the herbalist. If thou'rt lost, both meat and herbs are to the west of the central teleporters.";
            m_map[1014275] = "The cemetery is found to the south of the city. It is a small one, but strikingly serene.";
            m_map[1014276] = "The docks are easy enough to get to ... they are north of the city proper, and in betwixt the two 'prongs' that extend north into the sea.";
            m_map[1014277] = "The Gadgeteers' Guild is in the heart of the city, to the southeast of the teleporters.";
            m_map[1014278] = "The herbalist is found but one door south of the shop of reagents. Theirs customers are similar, but their businesses do not conflict as often as thou might suspect.";
            m_map[1014279] = "The inn is east a ways from the docks, a bit south. If thou sees the Artists' Guild, thou art too far east. If thou finds the scholar mage's place, thou art too far south.";
            m_map[1014280] = "There is one apprentice for each Mages' Guild. Therefore, one is to be found near the northern Guild, one near the southern Guild, and one to the east.";
            m_map[1014281] = "Thou canst guess from our city's name that our scholars are intrigued by celestial objects. In the eastern part of the city, near the shore, we have the realms' largest eyeglass pointed at the sky.";
            m_map[1014282] = "Thou should stop and take a look at the woodcarver's wares. Thou'lt find the store just north and a bit west from the main teleporter location. The skill and detail work are, I think, second to none.";
            m_map[1014283] = "We are on Verity Isle. The island is named so for the city puts much store in lofty intellectual pursuits.";
            m_map[1014284] = "We have a mage who deals in potions and other such things. Look a bit south of the tailor, just to the northeast of the teleporters.";
            m_map[1014285] = "And why wouldst thou be needing a cemetery? Sure, thou'rt neither so old, nor so ill? Well, thou'lt find it to the far northwest, outside the city walls.";
            m_map[1014286] = "Aye, The Silver Bow. 'Tis a bit quieter than Mystical Spirits, I'll tell that that. 'Tis further from the casino than Mystical Spirits, just south of the concert hall. Draws a milder crowd.";
            m_map[1014287] = "Dost thou mean the gazebo? The little open-air wooden structure on the southeast side of town? 'Tis between The Silver Bow tavern and Restful Slumber inn.";
            m_map[1014288] = "If the idea of a human chessboard appeals to thee, thou'lt find ours at the southern end of the road through the center of town, past the town manor and the inn.";
            m_map[1014289] = "If thou seekst to buy or sell goods, most tradespeople keep shops in the mall at the far west end of town. If thou'rt merely hungry, thou canst get a good meal at The Silver Bow or Mystical Spirits.";
            m_map[1014290] = "If thou'rt in search of sustenance, thou'lt find two taverns in the east of town - Mystical Spirits and the Silver Bow.";
            m_map[1014291] = "If thou'rt looking to buy or sell something, there's a mall to the west of the city, where thou'lt find almost everything - blacksmith, boyer, weaponsmith, tanner, food and supplies.";
            m_map[1014292] = "Needst thou a tailor? Thou canst not find one better than ours ... Thou'lt find the shop along the eastern edge of town, next door to the Mystical Spirits tavern.";
            m_map[1014293] = "Our inn is called Restful Slumber, and 'tis fairly true to name. Thou'lt find it in the southeastern quarter of town, neighboring The Silver Bow tavern. I wish a pleasant stay.";
            m_map[1014294] = "Seek'st thou a gaming house? The try the casino in the northeast quarter, next door to the Mystical Spirits. I think thou'lt find Nujel'm lives up to her reputation.";
            m_map[1014295] = "So, 'tis the merchant's guild thou'lt be seeking? Art interested in trade in human flesh, then? For that's what thou'lt find there. 'Tis at the southern tip of town, next the jail.";
            m_map[1014296] = "The jeweler's shop is in the northeast corner of town, east of the conservatory and north of the casino.";
            m_map[1014297] = "There's but one bank in Nujel'm, and it lies in the southeastern quarter of town, not too far from the human chessboard.";
            m_map[1014298] = "Thou'lt find the customs house overlooking the northeast bay. 'Tis inside the city walls, next door to the concert hall.";
            m_map[1014299] = "Thou'lt find the jail near the merchant's guild, south of the human chessboard. I'd be wary if I wert thee - 'tis one thing to be on this side of the bars down there, but 'tis a nightmare on the other.";
            m_map[1014300] = "Thou'lt find the Mystical Spirits on the eastern edge of town, next door to the casino. But if thou permit me to say, I prefer The Silver Bow, which is just a few paces south of it. Better atmosphere.";
            m_map[1014301] = "Travelers from less civilized towns often mistake the large building in the center of town for a palace. But, 'tis merely a manor house, and the man who lords over it made his fortune here in Nujel'm.";
            m_map[1014302] = "We have both a renowned conservatory and concert hall. Thou'lt find both to the north of town, between the customs house and the casino.";
            m_map[1014303] = "Wilt thou hear sweet music? We have a beautiful concert hall in the north of the city, next door to the customs house. There's a conservatory for bards across the street, should you wish to study further.";
            m_map[1014304] = "All manner of clothing can be found on the mainland side. The tailor's shop is just west from the stables.";
            m_map[1014305] = "I've been pleased with our armourer's work. Look for the shop called 'Serpent's Arms', just east of the healer.";
            m_map[1014306] = "Our provisioner can set thee up with supplies. Look just to the north of the blacksmith.";
            m_map[1014307] = "'Serpent's Hold Meats' is on the shore of the mainland, east of the bridge.";
            m_map[1014308] = "Serpent's Hold, thou hast found, is on the largest island just east and south of the Cape of Heroes.";
            m_map[1014309] = "The blacksmith works in one of the large buildings central in the Hold. The smithy is the northernmost of the two.";
            m_map[1014310] = "The heart of Serpent's Hold is the Keep. It is the largest building on the island, in the northwest corner.";
            m_map[1014311] = "The inn is on the west side of the island, close to the main gate.";
            m_map[1014312] = "The stables are on the mainland side of Serpent's Hold, betwixt the tailor and the tinker.";
            m_map[1014313] = "The tavern faces the healer's shop, immediately on thy left as thou comes in over the bridge.";
            m_map[1014314] = "The tinker's place is on the mainland. Thou'lt find it closest to the bridge.";
            m_map[1014315] = "Thou'lt find the healer's place between the armoury and the tavern. 'Tis sometimes crowded, especially right after training.";
            m_map[1014316] = "Cartographer's are usually found sharing space with shipwrights.";
            m_map[1014317] = "Farmers come into town, but their crops are all a bit over on the mainland.";
            m_map[1014318] = "Just north of the healer is where our blacksmith keeps shop.";
            m_map[1014319] = "Not settling down, I take it. Thou'lt find the provisioner to the northwest of the inn.";
            m_map[1014320] = "Our fair city of Skara Brae is the central hub for all the westward sea expeditions.";
            m_map[1014321] = "Our healer is close to the east dock.";
            m_map[1014322] = "Our inn is at the south end of the isle, near the docks, o'course.";
            m_map[1014323] = "Our theatre is on the northern edge of town, just a bit north and east of the beekeeper.";
            m_map[1014324] = "The alchemist's shop is the very most northeast place in town.";
            m_map[1014325] = "The animal trainer sets up shop just north of the beekeeper. They are much the same thing, to my mind.";
            m_map[1014326] = "The armourer is toward the center of town, but off a bit to the north-west.";
            m_map[1014327] = "The beekeeper has a shop toward the north of town, just south of the theatre.";
            m_map[1014328] = "The bowyer is north and a little west of the inn. In my opinion, the work is excellent.";
            m_map[1014329] = "The butcher shop is in the midst of town, betwixt the tavern and the magic shop.";
            m_map[1014330] = "The clothier keeps his shop on the east shore, three doors north of the dock.";
            m_map[1014331] = "The rangers' guildhall is on the west side of the isle. 'Tis north of the tavern and Town Hall, y'know.";
            m_map[1014332] = "The tavern sits on the western shore. It is just north of Town Hall";
            m_map[1014333] = "There is a shop of gentle magics, and that's a fact. 'Tis very near the exact center of town.";
            m_map[1014334] = "This is fine country for growing food. Our farmers sell at a shop near the northern edge of town, toward the middle and just south of the theatre.";
            m_map[1014335] = "Thou hast a choice. There is one guild on the northwest side of town, and another just across the water to the east.";
            m_map[1014336] = "Town Hall, eh? Well, and I hope thou bring no trouble to our fair isle. Walk west and south to get there.";
            m_map[1014337] = "Weapons can be had from the shop in the north-east corner of town.";
            m_map[1014338] = "We've a fine shipwright, close on to the southernmost dock.";
            m_map[1014339] = "Woodcrafter? That shop is toward the north of town, center between the weaponsmith and the farmers' shop.";
            m_map[1014340] = "Any thieves or other such riffraff are incarcerated in the Constabulary, just north of the Traveler's Gate.";
            m_map[1014341] = "Fine gems are the trade of our master jeweler, who has set up shop on the south side of our commercial district, neighboring the baker and the healer.";
            m_map[1014342] = "If thou hast a mind to see a tinker, the shop is in the southern part of the city ... just follow the river up to where it enters the city, and thou'lt find the place.";
            m_map[1014343] = "If thou'rt looking for the Fishers' Guild, go to the farthest part of the city to the southeast. The guildhall is next to the fish market.";
            m_map[1014344] = "Our baker is in the southern part of the city, just to the south and east of the Traveler's Gate.";
            m_map[1014345] = "Our Engineers' Guild is in the northwest corner of town.";
            m_map[1014346] = "Our provisioner's shop is the first thing one sees coming into the city. 'Tis the large building to the south of the entrance gate.";
            m_map[1014347] = "The armour shop is north of the monastery and mayor's house. I think you'll be pleased with the selection.";
            m_map[1014348] = "The butcher's shop is in the southeast corner of Trinsic.";
            m_map[1014349] = "The Guild of Engineers meets in their hall in the northwest section of town.";
            m_map[1014350] = "The mayor lives in the north side of town, betwixt the armourer and the monastery.";
            m_map[1014351] = "The monastery is renowned for its serene gardens. 'Tis on thy left as thou comes into the city.";
            m_map[1014352] = "The paladins meet in their guildhall, found on the eastern side of their island.";
            m_map[1014353] = "The paladins who live in Trinsic call the barracks home. They are in the northern part of the eastern half of town.";
            m_map[1014354] = "The stables are just a pace to the west of the inn.";
            m_map[1014355] = "The tailor's shop is a bit apart from the others. It is a bit south and east of the river's fork.";
            m_map[1014356] = "The tavern is just west of the fork in the river.";
            m_map[1014357] = "There's a good weaponsmith in the center of town, just a few paces south of the Soldier's Gate.";
            m_map[1014358] = "There's a guild or two in Trinsic. The Fisher Guild is to the southeast, and the Engineer's Guild is to the northwest. The Paladins' Guild is on their island, of course.";
            m_map[1014359] = "Thou'rt in Trinsic, of course, near the Cape of Heroes we are.";
            m_map[1014360] = "Thou'rt looking to train? The training salle is just inside the Soldier's Gate.";
            m_map[1014361] = "To find the shrine, simply walk to the point most north and east of town. 'Tis close to the water.";
            m_map[1014362] = "We have a very fine mage indeed. Thou canst find him just north of the inn, above the Traveler's Gate.";
            m_map[1014363] = "We have but one healer, and too far a walk from the training grounds, to my mind. If thou hast wounds, look to the south of the commercial district.";
            m_map[1014364] = "We have guardhouses at most strategic locations: especially wall corners with good visibility.";
            m_map[1014365] = "We have two inns, one at the easternmost part of town, and one in the west, a bit to the north.";
            m_map[1014366] = "You can't get fish fresher than at our fish market. It is outside the city gates, on the sea side.";
            m_map[1014367] = "Customs is in the very southeast part of Vesper.";
            m_map[1014368] = "I can tell thee that our mage buys reagents from the reagent shop near the docks. The stuff comes from all over, and Vesper gets first pick-through.";
            m_map[1014369] = "I hope thou hast had no trouble in Vesper, friend. The town hall is a southern island, one door south of the warriors' guild.";
            m_map[1014370] = "If I knew there was a thieves guild, I'd tell the guards first!";
            m_map[1014371] = "If thou'rt in need of armour, look on the central westernmost island of Vesper.";
            m_map[1014372] = "If thou'rt looking for potions, the shop thou needest is to the far north of Vesper, on the same island as the Jeweler.";
            m_map[1014373] = "Lookin' for the Bards' Guild? 'Tis the southernmost building on the northernmost island of Vesper.";
            m_map[1014374] = "On a lazy afternoon I like to wander around in Vesper's museum. It is the large building east of the tanner.";
            m_map[1014375] = "On the centermost island, farthest to the east, thou canst find the Seaman's guild.";
            m_map[1014376] = "On the western shore, at the southern end of Vesper, is an inn. It is much the same as the inn on the south-central island.";
            m_map[1014377] = "Our bank is on the northmost island. Look for the jeweler and the painter's studio.";
            m_map[1014378] = "Our healer has trained with the best, friend, as will be more than able to ease thy suffering. Look on a small island, just one bridge east of the blacksmith, or one bridge south of the woodworker.";
            m_map[1014379] = "Our mortuary and crypts are on the western bank, north of the inn.";
            m_map[1014380] = "Our tinker's shop can be found on a central island, somewhat north.";
            m_map[1014381] = "The baker's place is on the island just north of the docks.";
            m_map[1014382] = "The bee hives are kept on a small islet at the northeast. 'Tis north of the butcher and baker, and east of the painter's studio.";
            m_map[1014383] = "The best artist's studio, and by coincidence the only one, is on the northern isle, near the guild houses.";
            m_map[1014384] = "The farmer brings his produce in from the fields and sells it from his shop on the island just north of the docks.";
            m_map[1014385] = "The jeweler keeps shop on the northern island, betwixt the miners' and bards' guild halls.";
            m_map[1014386] = "The shipwright is the nearest building to the docks, o'course!";
            m_map[1014387] = "The soldiers and fighters gather in their hall on the large southern island.";
            m_map[1014388] = "The tailor is on the eastern shore of the river. Take the bridge from the northern isle and then go south.";
            m_map[1014389] = "The tanner is one bridge away from shore, at the point farthest south of the city.";
            m_map[1014390] = "The tavern is on one of the southern islands, I believe toward the center. I see it when I run errands to the customs house.";
            m_map[1014391] = "The woodworker's shop can be found but one bridge north of the healer's island.";
            m_map[1014392] = "There are a fair number of sorcerers here, and that's a fact. They meet in the upper floors of their hall on the north island.";
            m_map[1014393] = "There are mages who will sell their talents, true enough. Merely look on the ground floor of their guildhall on the north island.";
            m_map[1014394] = "There is naught but fresh fish in Vesper, and 'tis easiest had from the fisherman's shop. Look near the baker and butcher's places.";
            m_map[1014395] = "There's a fine tailor's shop in Vesper. Look to the largest southern island, in the building just north of the warriors' guildhouse.";
            m_map[1014396] = "Thou might try one of the center islands, away to the west. Methinks I've seen a bowyer's sign hanging there.";
            m_map[1014397] = "Thou'lt be wanting supplies, I take it? The provisioner keeps a shop to the north of town, on the shore.";
            m_map[1014398] = "Thou'lt find the blacksmith on the largest of the southern isles.";
            m_map[1014399] = "Thou'lt find the Miners' Guildhouse on the northernmost island, just where the river breaks around Vesper.";
            m_map[1014400] = "Thou'rt looking for the butcher, I take it. Get thee to the docks, then take the bridge north from that island. The butcher is the first building thou'lt see.";
            m_map[1014401] = "Vesper, thou canst see, is on the eastern coast of Britannia, to the north.";
            m_map[1014402] = "Food is a necessity, but certainly nothing to waste time over. Our communal eating area is to the far east of Wind.";
            m_map[1014403] = "If thou needest a healer, look to the eastern central part of wind. 'Tis close by the food place, if thou knowest where that is, but farther south and west.";
            m_map[1014404] = "Inns are scattered throughout Wind. One is northwest, one is northeast, and one is south.";
            m_map[1014405] = "Labs are places of study and discovery. We've one to the northwest of Wind, and one to the east.";
            m_map[1014406] = "Lord British became ruler of the united realm of Britannia when he wrested control from the 'evil' Lord Robert. The stories that are mostly known are, of course, mostly apocryphal.";
            m_map[1014407] = "Lord British is the ruler of Britannia. He seems a kind and just king, trying to do the right thing for his people.";
            m_map[1014408] = "Magincia is an island city east of Britain. It is all pride and foolishness, for it has never known deprivation.";
            m_map[1014409] = "Minoc is in the northmost part of the realm, a bit to the east. It is in the mountains, and is economically dependent on the nearby ore mines.";
            m_map[1014410] = "Moonglow is on the southern tip of Verity isle, and is a very logical place. They buy other cities' technology and examine it to see how it works. Laudable.";
            m_map[1014411] = "Our libraries are filled with scholars grazing on information. Look to the center of Wind for our collected tomes of knowledge.";
            m_map[1014412] = "Our only supply of reagents are sold in the central part of Wind. Look close by the libraries, in the same general location of the healer.";
            m_map[1014413] = "Serpent's Hold is on the largest island just east and south of the Cape of Heroes. It is where all the fighters of Britannia are trained.";
            m_map[1014414] = "Skara Brae is on an island due west of Britain. They study a mental form of magic that is unusual for that part of the world.";
            m_map[1014415] = "Tailor made clothes and repairs thou canst find at the tailor's shop, east of the provisioner.";
            m_map[1014416] = "This is Wind, of course. We study all manner of things: magic, the world, the inexplicable self.";
            m_map[1014417] = "Thou canst purchase thy supplies from the provisioner, found south and west from the northwestern inn.";
            m_map[1014418] = "Yew is in the northwest region of Britannia. It is home to the Empath Abbey where the famous wine is made.";
            m_map[1014419] = "Fresh meat can be had from the butcher, in the clearing at the center of Yew.";
            m_map[1014420] = "Fresh vegetables and other nourishing foods are sold at the market in the center of town. Look for a shop close by the butcher and baker.";
            m_map[1014421] = "If thou hast grain to be milled, take it to the flour mill just a bit west of the Abbey.";
            m_map[1014422] = "If thou'rt handy with a bow and arrows, then surely thou'lt be interested in our bowyer's excellent work. Look in his shop at the center of town ... there a selection that'll make thy head spin.";
            m_map[1014423] = "It was decided a long time ago that local judges would sit on the High Court. If thou wishes to see the court, head west and north of town. I cannot say if there is a trial in progress, however.";
            m_map[1014424] = "The cemetery is to the south and east of town.";
            m_map[1014425] = "The healers in Yew are specialized in natural cures. There are at least two in town: one is southeast and one is central.";
            m_map[1014426] = "The monks in the abbey that lies to the northeast spend their time studying painting, sculpting, prose, poetry, music ... and wine.";
            m_map[1014427] = "The prison is past the High Court to the northwest ... although it is not a common tourist site. Usually people come here for the wine.";
            m_map[1014428] = "The vineyards and winery are just south of the abbey, to the east of the flour mill and across the little inlet.";
            m_map[1014429] = "There is a prison storehouse between the High Court and the prison.";
            m_map[1014430] = "We do have a baker, and a fine one at that. To find the bakery, find the market near the center of Yew. The baker hangs his sign between that of the butcher and the woodworker.";
            m_map[1014431] = "Yew is famous for its wood crafts. There is a woodwork shop near the bakery, just a bit south of the bowyer.";
            m_map[1014432] = "Yew, thou hast found, is in the northwest region of Britannia.";
            m_map[1014433] = "Dost thou need to improve thy alchemy? Sure, I might be able to teach thee.";
            m_map[1014434] = "I am an alchemist.";
            m_map[1014435] = "I train animals.";
            m_map[1014436] = "I am an architect.";
            m_map[1014437] = "I'm an armourer.";
            m_map[1014438] = "I've been known to teach some how to improve their skills, for a few coins.";
            m_map[1014439] = "I am an artist.";
            m_map[1014440] = "Yes, I'm the baker. How can I help thee?";
            m_map[1014441] = "I am a Banker.";
            m_map[1014442] = "I am a bard. A minstrel. A thoughtful troubadour.";
            m_map[1014443] = "Accept my apologies, for my lack of comprehension.";
            m_map[1014444] = "If 'twere in my capabilities to help thee, I surely would.";
            m_map[1014445] = "I cannot fathom what 'tis that thou wishest.";
            m_map[1014446] = "I'm a beekeeper.";
            m_map[1014447] = "I'm between jobs at the moment. But if thou couldst find it in thine heart to help out a soul in need, I'm sure that my luck will change!";
            m_map[1014448] = "I've been a smith for a good number of years.";
            m_map[1014449] = "I'm a bowyer by trade.";
            m_map[1014450] = "I am sort of like a porter. I lighten the burdens of rich travelers.";
            m_map[1014451] = "I am a butcher.";
            m_map[1014452] = "I'm the carpenter here.";
            m_map[1014453] = "I can give thee some practice in carpentry, all thou dost need do is to ask.  And leave me a few coins.";
            m_map[1014454] = "A Cashual is one who has a deep understanding of the practical applications of natural philosophy.";
            m_map[1014455] = "I can give thee some practice in our art, all thou dost need do is to ask.  And leave me a few coins.";
            m_map[1014456] = "I'm a cobbler.";
            m_map[1014457] = "Fare thee well.";
            m_map[1014458] = "Goodbye, stranger.";
            m_map[1014459] = "May the rest of thy day be pleasant.";
            m_map[1014460] = "Thou wishest to speak with me?";
            m_map[1014461] = "Thou hast mine attention.";
            m_map[1014462] = "What is it thou wishest?";
            m_map[1014463] = "I am listening to thee.";
            m_map[1014464] = "I am a cook and baker.";
            m_map[1014465] = "I've been known to teach some how to improve their cookin', for a few coins.";
            m_map[1014466] = "Pardon me?,";
            m_map[1014467] = "Excuse me?,";
            m_map[1014468] = "I do not understand.";
            m_map[1014469] = "I beg thee, do not harm me. I cannot help thee.";
            m_map[1014470] = "I do not understand thee--I am sure it must be my fault, however.";
            m_map[1014471] = "Begging thy pardon, but I fail to understand what it is that thou wantest.";
            m_map[1014472] = "I wish I could answer thee, so that thou wouldst leave me alone.";
            m_map[1014473] = "Excuse my incomprehension, oh mighty terrorizer of small children, but I did not understand thee, and would find life more pleasant without thy ilk nearby.";
            m_map[1014474] = "I am sorry, but I do not always understand the utterances of petty criminals.";
            m_map[1014475] = "Forgive me, but I do not understand.";
            m_map[1014476] = "Excuse me? Forgive my lack of comprehension.";
            m_map[1014477] = "If I look perplexed, 'tis because I am.";
            m_map[1014478] = "Accept my apologies, for my lack of comprehension.";
            m_map[1014479] = "If 'twere in my capabilities to help thee, I surely would.";
            m_map[1014480] = "I cannot fathom what 'tis that thou wishest.";
            m_map[1014481] = "Begging thy pardon, but in my awe at seeing thee actually here before me, I neglected to listen closely to what thou spoke.";
            m_map[1014482] = "Sadly, I must report that I know nothing of what thou speakest.";
            m_map[1014483] = "Help me to understand thee, for I know not what thou seekest.";
            m_map[1014484] = "I am a simple farmer. I raise crops.";
            m_map[1014485] = "I am paid to fight!,";
            m_map[1014486] = "I've been known to teach a select few how to improve their fighting, for a few coins.";
            m_map[1014487] = "I am a fisherman.";
            m_map[1014488] = "I can give thee some fishing tips, all thou dost need do is to ask.  And I do expect to be paid for my time.";
            m_map[1014489] = "My trade is selling pelts of all sorts.";
            m_map[1014490] = "I can teach thee about the animals in the forest and how to know more about them, if thou art willing.";
            m_map[1014491] = "I'm a gamer by trade.  The cards and dice are my partners.";
            m_map[1014492] = "I could show thee a few things that the local guard wouldn't much take to, I'm sure.";
            m_map[1014493] = "I'm a glassblower.";
            m_map[1014494] = "Greetings.  What might I do for thee?,";
            m_map[1014495] = "Greetings.  What might I help thee with?,";
            m_map[1014496] = "Yes?,";
            m_map[1014497] = "Hello, my friend!  How may I assist thee?,";
            m_map[1014498] = "Hello!";
            m_map[1014499] = "I am a guard.";
            m_map[1014500] = "I'm a wanderer, and take whatever fortune offers me.";
            m_map[1014501] = "If thou dost want to learn, I might be persuaded to teach thee about such things as camping in the wild. Or not being seen when thou dost not WANT to be seen. Thou wouldst need to pay me, thou knowest.";
            m_map[1014502] = "I am one of the many healers of Britannia. I also sell potions and healing scrolls.";
            m_map[1014503] = "If thou dost want to learn, I might be persuaded to teach thee about first aid. I could teach thee, also, about the human anatomy. Thou wouldst need to pay me, of course.";
            m_map[1014504] = "I sell many fragrant dried herbs and flowers.";
            m_map[1014505] = "If thou dost want to learn, I might be persuaded to teach thee some alchemy skills. Thou wouldst need to pay me, of course.";
            m_map[1014506] = "I have some horses here that I could sell to thee.";
            m_map[1014507] = "I am an innkeeper.";
            m_map[1014508] = "I am an innkeeper.";
            m_map[1014509] = "Thy nearness offends me.";
            m_map[1014510] = "Stand back, I do not wish to be seen so near to thee.";
            m_map[1014511] = "I'm the jailkeeper.";
            m_map[1014512] = "I'm a maker of fine jewelry.";
            m_map[1014513] = "I'm a judge of the High Court of Britannia.";
            m_map[1014514] = "I am a laborer, and working is how I spend my days.";
            m_map[1014515] = "I am a wizard, a weaver of spells.";
            m_map[1014516] = "If thou dost need help with thy magic, just ask me to teach thee and I will. For a small price.";
            m_map[1014517] = "I am a mapmaker. Wouldst thou like to learn to make maps? In theory, 'tis simple - find a blank map, go to the spot thou wouldst map, and map it. In practice, of course, this requires a bit of skill ...";
            m_map[1014518] = "If thou dost need help with thy mapmaking, just ask me to teach thee and if I can, I will.";
            m_map[1014519] = "If thou hast guild business, thou may bring it to me. I am the guildmaster.";
            m_map[1014520] = "I'm the mayor, friend. Welcome to our fair city!,";
            m_map[1014521] = "I am a miller.";
            m_map[1014522] = "I work in the mines.";
            m_map[1014523] = "I am a minter.";
            m_map[1014524] = "I'm a brother at Empath Abbey.";
            m_map[1014525] = "I'm doing well enough, now.";
            m_map[1014526] = "Things seem to be going well.";
            m_map[1014527] = "No no no, a job is for those who lack money!  Nobility doesn't take jobs.";
            m_map[1014528] = "I'm the pit overseer.";
            m_map[1014529] = "I am a Paladin of Britannia!,";
            m_map[1014530] = "I am a member of Parliament.";
            m_map[1014531] = "I live on the sea.  'Tis no job, but a life!,";
            m_map[1014532] = "I am a humble servant of the Gods.";
            m_map[1014533] = "I'm a prisoner!  Can't thou see that?,";
            m_map[1014534] = "I sell general provisions.";
            m_map[1014535] = "I'm a cattle rancher.";
            m_map[1014536] = "I am a ranger. I spend most of my days in the woods, observing and tracking animals. I hunt that I may eat, and try to live in harmony with the land.";
            m_map[1014537] = "Tracking is more of an art than a science, but it begins with a thorough knowledge of the traits and habits of the creature being tracked. I can help thee with that, I think.";
            m_map[1014538] = "I am the realtor for this town. If thou desires a domicile of thy own, I can help thee.";
            m_map[1014539] = "And hello again. How may I help thee, _Name_?";
            m_map[1014540] = "And hello to thee, again.";
            m_map[1014541] = "I am a message carrier.  Pardon me, I need to be running.";
            m_map[1014542] = "I'm a sailor, my friend!,";
            m_map[1014543] = "Ah, this will be useful.";
            m_map[1014544] = "Excellent. 'Tis my lucky day.";
            m_map[1014545] = "I've been needing one of these.";
            m_map[1014546] = "This will come in handy indeed.";
            m_map[1014547] = "Well, look what I found!";
            m_map[1014548] = "I study ancient times and ancient tomes.";
            m_map[1014549] = "I'm a humble scrivener.";
            m_map[1014550] = "I'm a sculptor.";
            m_map[1014551] = "I serve the needs of Magincian nobles.";
            m_map[1014552] = "I tend to the sheep and keep them safe.";
            m_map[1014553] = "I'm a shipwright.";
            m_map[1014554] = "I am a _Job_.  What wouldst thou expect me to sell?,";
            m_map[1014555] = "If thou art interested in selling an item to me, then thou must give it to me and I'll decide if I need it in my stock. Otherwise, thou can buy anything that I sell here.";
            m_map[1014556] = "I'm a tailor.";
            m_map[1014557] = "I am sure I can break my busy schedule to lend thee some instruction, assuming thou hast some coin.";
            m_map[1014558] = "I am a tanner in this fine town.";
            m_map[1014559] = "I'm the tavernkeeper here.";
            m_map[1014560] = "I'm the tavernkeeper here.";
            m_map[1014561] = "Aye. I have been called thief, rogue and rapscallion and some things far worse, as I am sure thou hast been. Let us not say that again for others might hear and recognize us.";
            m_map[1014562] = "I'm a tinker.";
            m_map[1014563] = "It will take a steady hand and a sure eye to be a tinker. If thou art willing to learn, then I can help thee.";
            m_map[1014564] = "Why I am a veterinarian.";
            m_map[1014565] = "I serve food.";
            m_map[1014566] = "I am one of the many wandering healers of Britannia.";
            m_map[1014567] = "If thou dost need help with first aid, just ask me to teach thee and if I can, I will. For a small price.";
            m_map[1014568] = "I'm a smith.";
            m_map[1014569] = "I am a weapons trainer.";
            m_map[1014570] = "I'm a weaver.";
