            m_map[1041125] = "One: 'Pon this eve the aether flows and dances madly in the air";
            m_map[1041126] = "Two: The spirits rise and walk again and slaughter in the moon's red glare";
            m_map[1041127] = "Three: Beware, ye men of mortal flesh, lest ghosts seize all thy lifespan's time";
            m_map[1041128] = "Four: For soon the night shall come and soon shall set the sun";
            m_map[1041129] = "Five: And soon shall rise the bones to walk and seek the magic sign...";
            m_map[1041130] = "One: Soon the world shall split, and lives will lose their luster.";
            m_map[1041131] = "Two: The cadavers shall rise from their restless aching sleep!";
            m_map[1041132] = "Three: Soon shall monsters walk with bones broke all asunder,";
            m_map[1041133] = "Four: For a magic sign doth dwell in caverns dark and deep!";
            m_map[1041134] = "One: Where bones of land rise broken from the earth";
            m_map[1041135] = "Two: And where the wind whistles 'til the rock itself speaks,";
            m_map[1041136] = "Three: By the sea, north of sandstone, south of swamp,";
            m_map[1041137] = "Four: A magic sign doth rest 'pon the smallest of peaks.";
            m_map[1041138] = "One: Some say a message floated in a corked and sunburnt bottle";
            m_map[1041139] = "Two: And washed ashore where fisherfolk found it with a smile--";
            m_map[1041140] = "Three: 'Til wounds did grow upon their flesh and disease did rot:";
            m_map[1041141] = "Four: A magic sign must live lonely lost upon a deserted isle.";
            m_map[1041142] = "One: Where swords were shattered and brothers fell";
            m_map[1041143] = "Two: In battles well divided";
            m_map[1041144] = "Three: Where naught can live save pride and sting";
            m_map[1041145] = "Four: And dry is air in hiding";
            m_map[1041146] = "Five: A magic sign is caught in sand and sun";
            m_map[1041147] = "Six: Where blood lays idle";
            m_map[1041148] = "One: Seek ye signs of shattered stones! Seek ye gatherings of glimmers!";
            m_map[1041149] = "Two: For alas and alack and lo! they fall from heavens to tempt all the sinners...";
            m_map[1041150] = "Three: Complete the prophecy to find the secret of the days to come";
            m_map[1041151] = "Four: For runes and crystals whisper rhymes to frighten everyone...";
            m_map[1041152] = "One: Hast thou heard the dead shall walk?";
            m_map[1041153] = "Two: 'Tis prophesied here that castles fall.";
            m_map[1041154] = "Three: When crystals shatter and magic gathers";
            m_map[1041155] = "Four: And spirits make their ghastly call.";
            m_map[1041156] = "One: Upon a day when snow doth fall";
            m_map[1041157] = "Two: A gathering will form of noblemen";
            m_map[1041158] = "Three: Among them some who quarrel still";
            m_map[1041159] = "Four: Between free will and civil men";
            m_map[1041160] = "Five: Whilst watched by mice and monsters both";
            m_map[1041161] = "Six: A challenge shall be made";
            m_map[1041162] = "Seven: That breaketh lances and severs growth";
            m_map[1041163] = "Eight: And stains fair grass with hate";
            m_map[1041164] = "Nine: Someday perhaps shall reconcile";
            m_map[1041165] = "Ten: Two men whose hearts were once the same";
            m_map[1041166] = "Eleven: 'Til then the world shall tremble dire";
            m_map[1041167] = "Twelve: And none shall fix the blame...";
