            m_map[1042767] = "I am missing several components for my new potions, and I need to find the local alchemist.";
            m_map[1042768] = "My daughter is sick , and I need medicine. Do you know the way to the local alchemist?";
            m_map[1042769] = "I need some potions before I set out for a long journey. Can you take me to the alchemist?";
            m_map[1042770] = "I need new string for my lute, yet I do not know the way to the local music shop, could you take me?";
            m_map[1042771] = "I was hoping to hire a bard for my birthday party. Can you take me to one?";
            m_map[1042772] = "I fear my talent for music is less than my desire to learn, yet still I would like to try. Can you take me to the local music shop?";
            m_map[1042773] = "A family heirloom, our armoire, is falling apart. I need to see the local carpenter. Would you guide me to her?";
            m_map[1042774] = "My goat has broken through our fence, and I need new boards. Can you direct me to the local wood worker?";
            m_map[1042775] = "I need a hammer and nails. Never mind for what. Take me to the local carpenter or leave me be.";
            m_map[1042776] = "I have a job for the local woodsman. I have lost my dog. Can you take me to see him?";
            m_map[1042777] = "The tracker here is a good man. I know he will help me find my pet scorpion.  Do you know the way to his house?";
            m_map[1042778] = "I am hoping to learn something about camping. Can you take me to the local woodsman?";
            m_map[1042779] = "Me spouse's cookin' is too good. I fear me belly is outgrowin' me clothes. I need to find the local seamstress. Can you take me to her?";
            m_map[1042780] = "I want to learn how to sew. Can you take me to see the tailor?";
            m_map[1042781] = "I need new clothes for a party, and I was wondering if you could take me to the tailor?";
            m_map[1042782] = "I need to deposit some gold. You look like a trustworthy soul, so could you direct me to the local bank?";
            m_map[1042783] = "A rich relative of mine said they deposited some gold in to my account. Would you be able to lead me to the bank?";
            m_map[1042784] = "I have a debt I need to pay off at the bank. Do you know the way there?";
            m_map[1042785] = "I wish to travel and see the world, but I fear I need martial skills. Would you direct me to the local weapons trainer?";
            m_map[1042786] = "I need a sword to accompany me on a journey. Would escort me to the local fighter's union?";
            m_map[1042787] = "I need someone to help me rid my home of mongbats. Please take me to the local swordfighter.";
            m_map[1042788] = "My new house requires blessing, but I am not a mage and I have not the scroll. Would you take me to the local mages guild?";
            m_map[1042789] = "I need a wizard. I can't say why. You'll take me to one, or won't you?";
            m_map[1042790] = "You there. Take me to see a sorcerer so I can turn a friend back in to a human. He is currently a cat and keeps demanding milk.";
            m_map[1042791] = "Psst - I hate to admit it, but I am lost. Can you take me to a place where they sell maps?";
            m_map[1042792] = "I am trying to confirm the location of dungeons around here. Would you take me to a map maker so I might buy supplies?";
            m_map[1042793] = "Where am I? Who am I? Do you know me? Hmmm - on second thought, I think I best stick with where I am first. Do you know where I can get a map?";
            m_map[1042794] = "I am in search of a loaf of fresh bread. Do you know where I might find some?";
