            m_map[1046000] = "Help! These savages wish to end my life!";
            m_map[1046001] = "Ahhhhh!  'Tis terrible! I do not wish to die!";
            m_map[1046002] = "One of these vile skeletons has the key to this cage!";
            m_map[1046003] = "Quickly! Kill them for me! HELP!!!";
            m_map[1046004] = "HELP!!!";
            m_map[1046005] = "What have I gotten myself in to this time...";
            m_map[1046006] = "I don't know the blasted formula you foul smelling brutes!";
            m_map[1046007] = "You're lucky I'm in this cage you wretch!";
            m_map[1046008] = "YES! Kill them all!";
            m_map[1046009] = "Well done! Teach them a lesson!";
            m_map[1046010] = "I would help thee... but alas, I am stuck in here...";
            m_map[1046011] = "I have no quarrel with thee ~1_NAME~.  Make haste and leave this place lest I change my mind.";
            m_map[1046012] = "Greetings, ~1_NAME~! Thank the heavens you have arrived!";
            m_map[1046013] = "Quest Offer";
            m_map[1046014] = "The island has been plagued with vile creatures for some time now and the villagers need your help destroying them. Will you accept?";
            m_map[1046015] = "Welcome, stranger! I am known as Uzeraan the Conjurer and I am the lord of this house.  I was beginning to worry that you wouldn't come..";
            m_map[1046016] = "Alas, you came and not a minute too soon.  I am unable to leave this house and have some urgent tasks that I need completed...please - come.";
            m_map[1046017] = "Thank you kind stranger! You have freed me.  I knew you could do it.";
            m_map[1046018] = "Now I must return to my home, surely my family is worried sick over my disappearance.";
            m_map[1046019] = "It seems by unlocking the door, you lifted the anti-magic aura of the cage.";
            m_map[1046020] = "YES! Kill them all!";
            m_map[1046021] = "Well done! Teach them a lesson!";
            m_map[1046022] = "I would help thee... but alas, I am stuck in here...";
            m_map[1046023] = "That will teach the evil swine to reconsider his evil ways!";
            m_map[1046024] = "HA! Excellent move on thy part!";
            m_map[1046025] = "They are not match for thee. Show no mercy!";
            m_map[1046026] = "Quest Log";
            m_map[1046027] = "Uzeraan says:";
            m_map[1046028] = "Aegis says:";
            m_map[1046029] = "Apprentice says:";
            m_map[1046030] = "Page Back";
            m_map[1046031] = "Page Forward";
            m_map[1046032] = "Step number:";
            m_map[1046033] = "Completed";
            m_map[1046034] = "Incomplete";
            m_map[1046035] = "View Quest Log";
            m_map[1046036] = "View Directions";
            m_map[1046037] = "Quest Directions";
            m_map[1046038] = "Cancel Quest";
            m_map[1046039] = "Find Uzeraan.  Uzeraan will explain what you need to do next.";
            m_map[1046040] = "Uzeraan says:  Hello! I am the grand Conjurer, Uzeraan. I have a few tasks for you to perform.";
            m_map[1046041] = "You have arrived not a moment too soon, stranger.  Terrible things have happened and we need your help!";
            m_map[1046042] = "This island has been plagued with foul creatures ever since the mysterious dark force began its invasion.";
            m_map[1046043] = "I know we have just met, but our need is dire and I must ask of you a favor.";
            m_map[1046044] = "For some time now, our hunters have been disappearing in the forests of this island.";
            m_map[1046045] = "We believe vile 'Shadow Wisps' are responsible for these disappearances.";
            m_map[1046046] = "Go forth and kill at least 6 of these 'Shadow Wisps'. See if you can find any evidence of our missing men.";
            m_map[1046047] = "Well done! You have completed your task of slaying the 'Shadow Wisps'.";
            m_map[1046048] = "Return to Uzeraan and tell him of your findings.  He is no doubt eagerly awaiting your return.";
            m_map[1046049] = "Return to Uzeraan and tell him of your findings.";
            m_map[1046050] = "Uzeraan gives you a somber look and begins to speak slowly:";
            m_map[1046051] = "You bring sad news stranger and I fear our men may be lost forever. They will be mourned.";
            m_map[1046052] = "You, however, have shown great Valor in your battle against the wretched 'Shadow Wisps'. I am pleased.";
            m_map[1046053] = "For your efforts I have placed a small token of my appreciation in your backpack.";
            m_map[1046054] = "Unfortunately, I have more disturbing news. We once had an underground cavern that we used for mining ore.";
            m_map[1046055] = "It seems horrible creatures have been emerging from the caves at night, terrorizing the villagers.";
            m_map[1046056] = "In their folly, a mob of frightened villagers collapsed the entrance to the mining cave.";
            m_map[1046057] = "The villagers did not know that I had recently installed a teleporter in the cave.  It was designed to give the workers a quick way to return home from the cave.";
            m_map[1046058] = "What's worse is that this teleporter only goes one way: Out of the cave, into our village.";
            m_map[1046059] = "The horrid phantasms still haunt us on a nightly basis using MY teleporter to get here. We have no way to get into the cave!";
            m_map[1046060] = "Well - there is one way. Let me tell you something of magic travel...";
            m_map[1046061] = "MAGIC TRAVEL:";
            m_map[1046062] = "To begin with, you need what is called a recall rune.  Blank recall runes can be purchased at most any magic supply shop.";
            m_map[1046063] = "Then, you need either in your spellbook, or inscribed on a scroll a 'Mark' spell. 'Tis a spell of the 6th circle.";
            m_map[1046064] = "You then cast the Mark spell and target the recall rune. This inscribes the rune with the location at which you are standing.";
            m_map[1046065] = "To instantly return to the location where the rune was marked, you employ the 'Recall' spell.";
            m_map[1046066] = "This spell is of the 4th circle and you should have little trouble with it.";
            m_map[1046067] = "Simply cast the Recall spell and target the marked recall rune of the location you wish to travel to.";
            m_map[1046068] = "There is also another, called 'Gate Travel' which operates on the same principles as the Recall spell.";
            m_map[1046069] = "Gate Travel allows you to open a magical gate to the location of your marked recall rune. This way, others can travel with you.";
            m_map[1046070] = "Gate Travel is of the 7th circle however, and you will not be able to weave such intricate magic for a while.";
            m_map[1046071] = "Now - to get back to the subject at hand.  Whilst I was working in the caves, installing the teleporter, I marked a rune.";
            m_map[1046072] = "This would, in theory, allow us to travel into the cave to investigate the condition of our mining resources.";
            m_map[1046073] = "Unfortunately, to cast any spell, one must have the necessary reagents. Reagents that I do not have.";
            m_map[1046074] = "My supply of Mandrake Root has run dry and so I cannot cast any of the magic travel spells needed to enter the cave.";
            m_map[1046075] = "I must ask of you to go and gather Mandrake Root for me.  Try the reagent shops if you have money, or find another way if you do not.";
            m_map[1046076] = "I have no money for reagents to give you at this time, but be assured that I will repay you.";
            m_map[1046077] = "Please hurry - time is short and so is our supply of fighters to fend off the wicked creatures.";
            m_map[1046078] = "Uzeraan nods at you with approval and begins to speak:";
            m_map[1046079] = "Thank you stranger. You are not a moment too soon. For your help I have placed a few scrolls in your pack to aid you.";
            m_map[1046080] = "Just a few Mark and Recall scrolls for you to try out. I've also given you some blank recall runes.";
            m_map[1046081] = "Now I can send the few remaining soldiers in to the cave to investigate the state of affairs.";
            m_map[1046082] = "On second thought, *YOU* would do much better against the wretched wraiths than any of our soldiers.";
            m_map[1046083] = "Go and gather any other supplies you think you will need and then return here. I will transport you below upon your return.";
            m_map[1046084] = "I was beginning to think you would not return. I am glad to see that I was mistaken.";
            m_map[1046085] = "Go now into the caves below and find out what you can about the creatures coming from there.";
            m_map[1046086] = "Slay 6 of the creatures and gather any information on their weaknesses that you can.";
            m_map[1046087] = "Remember that there is a teleporter somewhere in the cave that will lead back to the surface.";
            m_map[1046088] = "Mission Complete.  You have slain the restless souls as instructed. Return to Uzeraan to report.";
            m_map[1046089] = "Uzeraan looks very disturbed at your report.  After a long silence he speaks to you:";
            m_map[1046090] = "It seems the caves are lost to us as the restless souls you describe have made it their new home.";
            m_map[1046091] = "The villagers wanted me to thank you for your help and have given me some items to reward you with.";
            m_map[1046092] = "I have placed some reagents, a few scrolls and some gold in your pack.";
            m_map[1046093] = "The issue of the restless souls requires more investigation, but alas, a more pressing matter has surfaced.";
            m_map[1046094] = "My friend and associate, Aegis The Archmage of Moonglow, has been secretly working on a new spell formula.";
            m_map[1046095] = "The new spell would easily swing the tides in our favor in the battle against this unknown evil that has befallen us.";
            m_map[1046096] = "Apparently, many of Aegis' apprentices have been getting abducted in an attempt to force information from them.";
            m_map[1046097] = "I have just received word from Aegis that one of his most trusted students was taken!";
            m_map[1046098] = "We must send someone to find the apprentice and free him before he is slain! Time is limited!";
            m_map[1046099] = "You, dear friend, have proven yourself worthy of such a quest.  I have sent word to Aegis that I will send you to aid him.";
            m_map[1046100] = "Go and gather any supplies you may need for your journey. Return here when you are ready to depart for Moonglow.";
            m_map[1046101] = "Excellent. You have returned.  I will transport you to Moonglow now.";
            m_map[1046102] = "Upon your arrival, follow the path North and you will find Moonglow.";
            m_map[1046103] = "Aegis runs a reagent shop west of the teleporter park within the Moonglow city walls.";
            m_map[1046104] = "If you have any trouble finding it, ask other adventurers around you and I am sure someone will aid you.";
            m_map[1046105] = "Good luck, young mage. I hope you succeed. May the aethers have mercy upon us if you do not.";
            m_map[1046106] = "You have found Aegis!";
            m_map[1046107] = "The Archmage's face lights up as he spots you in the doorway.";
            m_map[1046108] = "Thank the heavens! Uzeraan said he would send someone, but I did not expect you so soon.";
            m_map[1046109] = "As I am sure Uzeraan has told you, one of my apprentices was abducted.";
            m_map[1046110] = "�Tis a bad omen, as this was one of the few apprentices who knew of my new spell formulas.";
            m_map[1046111] = "No doubt the mysterious dark force is behind the abduction of my most valuable student.";
            m_map[1046112] = "I must ask you to go after the evil undead that abducted my apprentice and return him to safety.";
            m_map[1046113] = "In their haste to escape, one of the abductors dropped a marked recall rune.";
            m_map[1046114] = "No doubt it leads to the place where they are holding my young wizard captive.";
            m_map[1046115] = "I have the rune right here. No?  Maybe in this pocket? No. Well - this is most embarrassing.";
            m_map[1046116] = "Go and fetch yourself some supplies for the forthcoming battle and I will continue my search for the rune.";
            m_map[1046117] = "Unfortunately, I have not been able to recover the rune yet. Please return in a few minutes. I will keep looking.";
            m_map[1046118] = "My ancestors smile upon me. I have found the rune to the prison camp.  With this rune we can find the lost apprentice.";
            m_map[1046119] = "I will transport you now to the location that was inscribed on this rune. I pray it takes you to my student wizard.";
            m_map[1046120] = "Slay his captors and release him from his bondage. Take these scrolls with you - they will help.";
            m_map[1046121] = "They are scrolls with the 'Unlock' spell inscribed upon them.  This spell can be very useful.";
            m_map[1046122] = "Remember however, that the Unlock spell only unlocks things that were locked using the 'Magic Lock' spell.";
            m_map[1046123] = "Also keep in mind that not only doors can be locked with the lock spell, but also containers of all sorts.";
            m_map[1046124] = "Now go. Time is short!  Return here when you have saved my apprentice.";
            m_map[1046125] = "Quest Complete! You have saved the apprentice.  Return to Aegis and speak with him.";
            m_map[1046126] = "Aegis smiles at you with a look of great satisfaction.";
            m_map[1046127] = "Well done young Mage!!!  Stay on the path of virtue and continue your lessons in the arcane arts.";
            m_map[1046128] = "I foresee that you will become a mighty spell wielder who will gain many honors throughout Britannia.";
            m_map[1046129] = "I thank you for saving my apprentice and therein saving our cause. I feel a reward is in order.";
            m_map[1046130] = "Gold is also always welcome I think, so here is a check for 1000 gold. Don't squander it now, ye hear?";
            m_map[1046131] = "Take this magical wizard's hat. It tends to be rough on the body, but does wonders for the mind.";
            m_map[1046132] = "I hope we meet again in the future my friend. I am indebted to you always.";
            m_map[1046133] = "Find Uzeraan.  Uzeraan will explain what you need to do next.";
            m_map[1046134] = "Go forth and kill at least 6 of these 'Shadow Wisps'. See if you can find any evidence of our missing men.";
            m_map[1046135] = "Return to Uzeraan and tell him of your findings.";
            m_map[1046136] = "Find 75 Mandrake roots and return them to Uzeraan. Try checking the local reagent shops.";
            m_map[1046137] = "Gather supplies for battle and return to Uzeraan when you are ready.";
            m_map[1046138] = "Venture into the mining cave and slay 6 of the restless souls. Use the teleporter in the cave to return.";
            m_map[1046139] = "Find the teleporter in the cave and return to Uzeraan.";
            m_map[1046140] = "Gather any supplies you need and return to Uzeraan when you are ready to leave for Moonglow.";
            m_map[1046141] = "Find Aegis the Archmage in the city of Moonglow. His shop is west of the teleporter park.";
            m_map[1046142] = "Explore the town and gather supplies for battle. Return to Aegis when you are ready.";
            m_map[1046143] = "Check in with Aegis after a while to see if he has recovered the rune to the prison camp.";
            m_map[1046144] = "Find the prison camp where the abducted apprentice is being held. Slay his oppressors and free him.";
            m_map[1046145] = "Return to Aegis and tell him you have freed his apprentice.";
            m_map[1046146] = "Uzeraan lives in his mansion within the city of Haven.  Find him and he will give you instructions on tasks he would like you to do for him.";
            m_map[1046147] = "Uzeraan explains tasks for you to become a better blacksmith.  He has requested that you find an anvil and forge.";
            m_map[1046148] = "Uzeraan says: Hello!  I am the grand Conjurer, Uzeraan.  I have a few tasks I'd like you to perform.";
            m_map[1046149] = "These tasks will help you to become a better blacksmith and make tools to aid your smithing.  The tasks are not pointless, as an army needs the weapons and armor you make.";
            m_map[1046150] = "First, I would like you to find an anvil and forge.  The anvils and forges can be found on this floor of my mansion.";
            m_map[1046151] = "Forge a ringmail tunic with your smithy hammer or tongs.  Uzeraan has more information, once you make the ringmail tunic.";
            m_map[1046152] = "At the forge and anvil, you craft the items of your blacksmithy trade.  To protect yourself, you should craft a ringmail tunic.";
            m_map[1046153] = "To use an anvil and forge, you must be standing next to them.  An anvil and forge allows you to use tongs or a hammer.";
            m_map[1046154] = "The tongs or hammer you use are in your backpack or hand. Double-clicking the tongs or hammer should bring up a menu to allow you to blacksmith.";
            m_map[1046155] = "If you are too far from the anvil and forge, you will not get the menu.  If you do not have enough ingots in your backpack for the item you want to smith, then you will not be able to make it.";
            m_map[1046156] = "Visit Uzeraan once you have made your ringmail tunic.";
            m_map[1046157] = "Uzeraan explains why you need the ringmail tunic for protection.  The mountains south of the mansion have ore to mine, but may have a critter or two that are hostile.";
            m_map[1046158] = "Uzeraan says: Now that you have made a ringmail tunic, you will need more ingots to supply yourself for future armor and weapons you make.  Ingots are made from ore that you mine off of mountains.";
            m_map[1046159] = "There are mountains to the south of my mansion.  They may be dangerous, so make sure to wear your ringmail tunic before you leave.";
            m_map[1046160] = "Once you find the mountains, you can mine them with your trusty shovel or pickaxe.";
            m_map[1046161] = "Once you have completed mining five large iron ore piles from mountains or caves, visit Uzeraan.  There are four types of ore piles, the largest pile smelts for the most ingots.";
            m_map[1046162] = "To mine ore, you will need to use your shovel or pickaxe on the mountainside or on a cave floor.  Double-clicking the shovel or pickaxe allows you to use the item.  You can then target the mountain or cave floor.";
            m_map[1046163] = "If an area is out of ore, you will need to hunt further along a mountainside or in a cave for more spots to mine at.  Simply use your digging tool on different areas of the stone until you get some ore.";
            m_map[1046164] = "Ore comes in varying sizes.  The smaller the pile, the fewer ingots it will make when it is smelted.  You will need five large piles of iron ore to smelt into the ingots you need.";
            m_map[1046165] = "Uzeraan's forge can be used to smelt ore into iron ingots.  Those ingots can be used to make tools.  Visit Uzeraan once you have completed smelting the ore.";
            m_map[1046166] = "Smelt ore in town at the forge for iron ingots.  Visit Uzeraan once you have completed smelting the ingots.";
            m_map[1046167] = "Uzeraan says: Now that you have the five piles of ore, you will need to smelt them.  The forge allows you to smelt ore.";
            m_map[1046168] = "Once you find the forge, double-click the piles of ore and target the red coals of the forge.  The ore will be smelted into ingots, if you are close enough to the forge.";
            m_map[1046169] = "When you have made the iron ingots, visit Uzeraan and he will instruct you on how to make more pickaxes.";
            m_map[1046170] = "Make two pickaxes for mining with your tinker kit.  Show Uzeraan a pickaxe by giving it to him.";
            m_map[1046171] = "Shovels and pickaxes break fairly often while mining.  This means you will need to make pickaxes with the ingots you mine up";
            m_map[1046172] = "To make a couple of pickaxes, you can use your tinker tools on your ingots.  Select the pickaxe from the tinker menu and it will be made from the ingots you selected.";
            m_map[1046173] = "You can make these pickaxes anywhere, as long as you have the ingots.  This means if you ever run out of pickaxes while mining a mountainside, you can make more pickaxes right away!";
            m_map[1046174] = "Make fifty iron ingots for the mansion.  Visit Uzeraan once you have completed making the ingots.";
            m_map[1046175] = "Uzeraan says:  Now that you know how to keep your pickaxes in good supply and how to make iron ingots, I happen to be in need of a large pile of ingots.";
            m_map[1046176] = "Please make fifty ingots and bring them to me.  I will buy them from you for five-hundred gold.";
            m_map[1046177] = "Iron ore piles are heavy.  You will need to lug piles of ore you mine back to the mansion to smelt them into iron ingots.  This may take you a few trips back and forth between the mountains and the forge.";
            m_map[1046178] = "Once you have completed the ingots, visit me for your payment.";
            m_map[1046179] = "Uzeraan describes the order deeds the armourers need in Minoc.  Find the moongate at the south-east part of town.  This moongate will take you to a location just outside of Minoc.";
            m_map[1046180] = "Uzeraan says: You have done very well.  You know how to supply yourself with iron ingots and pickaxes.";
            m_map[1046181] = "Now, I have a more advanced task for you.  The city armourers of Minoc are in need of weapons and armor.  I have placed their order deeds in your backpack for you to fulfill.";
            m_map[1046182] = "To get to the city of Minoc, you will need to travel through the moongate.  The moongate is located to the south-east of town, towards the mountains.";
            m_map[1046183] = "The moongate allows you to travel to far destinations.  Select Trammel and then Minoc and accept the menu and it will whisk you away.  Once there, walk west towards the road.";
            m_map[1046184] = "Now that you have found the moongate, you should walk into it.  A menu will appear asking where you wish to travel to.";
            m_map[1046185] = "There are two types of moongates.  Moongates, such as the one you just found, are scattered through the world and offer menus of different locations.";
            m_map[1046186] = "The other type of moongate does not offer a menu.  It is a moongate that powerful mages may temporarily create to allow themselves and others to pass through them to marked locations.";
            m_map[1046187] = "If you cannot walk into the moongate, you may double-click it to use it.  If you are too far from the moongate, you cannot use the moongate.";
            m_map[1046188] = "Besides allowing you to travel between locations, you may use a moongate to go to another facet.  The two facets are Felucca and Trammel.";
            m_map[1046189] = "The city of Haven is in Trammel.  If you wish to travel back to Haven, you would need to select Trammel before selecting it as the city you wish to visit.";
            m_map[1046190] = "To visit Minoc, you may visit it in either Trammel or Felucca.  Although, the armourers that need the weapons and armor are in Trammel.";
            m_map[1046191] = "Select Trammel as the facet you wish to visit and then select Minoc as the city.  ";
            m_map[1046192] = "The city of Minoc is a city of miners, tinkerers, and jewelers.  Minoc is to the north-northwest.  The mountains are north-east of Minoc.  You need to complete the order deeds in Minoc.";
            m_map[1046193] = "Minoc is to the north-west of the gate you have just exited from.  There is a road to the west that leads north into town.";
            m_map[1046194] = "The armourers have two shops in town.  They both have forges and anvils in them that you can use to make the weapons and armor in your order deeds.";
            m_map[1046195] = "If you pass through town, the mountains are to the north-east of Minoc.  You can use those mountains to mine the ore you need for ingots and blacksmithing.";
            m_map[1046196] = "The grey order deeds can be double-clicked to open them up and read what the amount and type of items are needed by the armourers.  Forge the items as you did for the ringmail tunic earlier with your blacksmithy hammer.";
            m_map[1046197] = "Use the combine button in the opened deed window to combine your finished products with the deed.  When you have finished the amount the orders are for, drag the deed onto an armourer or blacksmith in Minoc.";
            m_map[1046198] = "After the deeds have all been completed, travel through the moongate to Haven and find Uzeraan.";
            m_map[1046199] = "Once you have completed the deeds, Uzeraan will grant you a reward.";
            m_map[1046200] = "Uzeraan says: Congratulations!  I got word through magical means that you had completed your task.  The armourers were extremely happy to have received their orders fulfilled.";
            m_map[1046201] = "You have requested to cancel your quest.  Once you have cancelled your quest, you cannot start the young player quest again.  Do you wish to cancel your quest?";
            m_map[1046202] = "Now I can finally return to my family.  Will you go and tell Aegis that I am free and that I did not give away the secret of the new spell.";
            m_map[1046203] = "I have some unfinished business before I can return home.  Fare thee well kind adventurer.";
            m_map[1046204] = "Be sure to take your spellbook and I would also suggest that you have at least 35 of each reagent.";
            m_map[1046205] = "Be sure to take your spellbook and I would also suggest that you have at least 50 of each reagent.";
            m_map[1046206] = "We believe the vile 'Headless' are responsible for these disappearances.";
            m_map[1046207] = "Go forth and kill at least 6 of these 'Headless' creatures. See if you can find any evidence of our missing men.";
            m_map[1046208] = "Well done! You have completed your task of slaying the 'Headless'.";
            m_map[1046209] = "You however, have shown great valor in your battle against the 'Headless'!";
            m_map[1046210] = "Well there is *ONE* way - Yes! That is it. Whilst I was installing the teleporter I marked a recall rune in the cave!";
            m_map[1046211] = "I can use this recall rune to transport you directly into the caverns. Alas, you must find your own way out.";
            m_map[1046212] = "Go and gather supplies for battle. I suggest you take your weapon, some armor and at least 25 bandages to be safe.";
            m_map[1046213] = "Return here when you are ready to depart and I will transport you into the caverns below the island.";
            m_map[1046214] = "It's a treasure map I received from a dragon tamer a long time ago. I have neither the time nor the patience to find the treasure.";
            m_map[1046215] = "Take the treasure map and this shovel.  Double click the treasure map, located in your pack, to see where the treasure is. X marks the spot.";
            m_map[1046216] = "I can teleport you close to where the treasure should be buried";
            m_map[1046217] = "It's North from here";
            m_map[1046218] = "It's North-East from here";
            m_map[1046219] = "It's East from here";
            m_map[1046220] = "It's South-East from there";
            m_map[1046221] = "It's South from here";
            m_map[1046222] = "It's South-West from here";
            m_map[1046223] = "It's West from here";
            m_map[1046224] = "It's North-West from here";
            m_map[1046225] = "* the magic fails *";
            m_map[1046226] = "an enchanted sextant";
            m_map[1046227] = "I'm sorry but it seems your backpack is too full to accept your reward. Come back when you have room for it.";
            m_map[1046228] = "To show me a pickaxe you have made, drag the pickaxe onto me and I will review your crafted pickaxe.";
            m_map[1046229] = "Through my magic, I was able to raise your blacksmithy skill a couple of points.";
            m_map[1046230] = "You need to clear some space in your backpack to continue with the quest.  Visit Uzeraan when you have more space in your backpack.";
            m_map[1046231] = "The treasure should be here on this island somewhere. I've also given you an enchanted sextant that will help you find your way.";
            m_map[1046232] = "You're standing right on top of the spot!";
            m_map[1046233] = "Press ALT-R to bring up your overhead map.  Then you can double click the enchanted sextant to tell you the way.";
            m_map[1046234] = "Take heed though, the magic of the sextant will only work for you. Don't give it away!";
            m_map[1046235] = "Once you have found the spot, you will need to follow these steps to bring up the treasure:";
            m_map[1046236] = "1. Double click your shovel";
            m_map[1046237] = "2. Target the Treasure map";
            m_map[1046238] = "3. Target the spot on the ground where the treasure is buried";
            m_map[1046239] = "If you are digging in the right spot, the chest will emerge, and the treasure's guardians will emerge.";
            m_map[1046240] = "You must slay all of the guardians before you can open the treasure chest.  Return here after you have completed the treasure hunt.";
            m_map[1046241] = "You have done well against the guardians of the treasure!  I feel I can entrust you with yet another quest.";
            m_map[1046242] = "We once used one of the caves below the island for mining purposes.";
            m_map[1046243] = "Return here when you are ready to depart for Moonglow.";
            m_map[1046244] = "Good luck, young fighter! I hope you succeed!  May the aethers have mercy on us if you do not.";
            m_map[1046245] = "Gather your weapon, armor and I suggest at least 30 bandages before you return.";
            m_map[1046246] = "Come back here after you have made the necessary arrangements and I will teleport you - providing I find the blasted rune.";
            m_map[1046247] = "Slay his captors and free him!  May your road to glory be paved with the blood of our oppressors.  Go now.";
            m_map[1046248] = "Well done young fighter! Stay on the path of virtue and glory and honor will be yours.";
            m_map[1046249] = "I foresee that you will become a mighty warrior.  I see fortune and glory on your path!";
            m_map[1046250] = "Take this magical sword.  It is a mighty fine weapon.  It will serve you well in your conquest against evil.";
            m_map[1046251] = "Go forth and kill at least 6 of the 'Headless' creatures. See if you can find evidence of our missing men.";
            m_map[1046252] = "Find and dig up the treasure.  Slay the guardians and take the booty that is rightfully yours.";
            m_map[1046253] = "Quest Complete!  You have found the treasure and have slain the guardians. Return to Uzeraan.";
            m_map[1046254] = "You have excavated the treasure. Return to Uzeraan.";
            m_map[1046255] = "I've given you a bag with some black, night sight potions. Drink them to see in the dark.  I've also included a few heal potions.";
            m_map[1046256] = "I have placed some bandages and heal potions in your pack, compliments of the villagers.";
            m_map[1046257] = "Are you sure you want to release your pet?";
            m_map[1046258] = "Your quest is complete.";
            m_map[1046259] = "Haven";
            m_map[1046260] = "You need to clear some space in your inventory to continue with the quest.  Come back here when you have more space in your inventory.";
            m_map[1046261] = "That's not enough my friend.  I need 75.  No less.";
            m_map[1046262] = "I can unfortunately not travel with you, but I have something that will help you find your way.";
            m_map[1046263] = "Take this enchanted sextant to help guide you on your journey back. Double click the sextant to show you the way to the nearest Moongate.";
            m_map[1046264] = "Once you find a Moongate, step into it and choose Moonglow as your destination.";
            m_map[1046265] = "The sextant refuses to be picked up by you";
            m_map[1046266] = "What misfortunes have befallen you that you would return without completing your task?";
            m_map[1046267] = "I have adjusted the magical teleporter to take you back.  Step onto the teleporter when you are ready.";
            m_map[1046268] = "Unfortunately, evil mages have relocated the prisoner to another camp.  Aegis has information on their whereabouts.";
            m_map[1046269] = "Seek out Aegis in Moonglow and see if he can transport you to the new location of his captured apprentice.";
            m_map[1046270] = "I have made the necessary adjustments to the Teleporter here. Step on to it when you are ready to depart.";
            m_map[1046271] = "On your way out, be sure to take a look at the 'Shadow Wisp' in the cage near the water fountain.";
            m_map[1046272] = "However, be sure to not attack the monsters in the cage as they are currently under the protection of the town guards.";
            m_map[1046273] = "You can find out if a creature is attackable or not by the color of their name when you look at them (single click).";
            m_map[1046274] = "If the name is in blue, then you may not attack them without becoming a criminal.";
            m_map[1046275] = "Needless to say, becoming a criminal in town will most certainly be detrimental to your health.";
            m_map[1046276] = "The monsters that you will encounter outside of this mansion, however will highlight grey, which means you can freely attack them.";
            m_map[1046277] = "Now please go. Time is short, dear friend.";
            m_map[1046278] = "On your way out, be sure to take a look at the 'Headless' in the cage near the water fountain";
            m_map[1046279] = "Please also note the blacksmith standing next to the magic teleporter. He sells armor and weapons.";
            m_map[1046280] = "It may be wise to purchase some equipment from him.  I would suggest armor made of ringmail and perhaps a shield.";
            m_map[1046281] = "Don't spend all your money on armor though, as you will no doubt at some time wish to purchase bolts of cloth for bandages.";
            m_map[1046282] = "Cloth can be purchased from tailors and can be cut up with scissors to create bandages.";
            m_map[1046283] = "Use bandages on yourself (double click bandages and target yourself) any time your hit points get too low.";
            m_map[1046284] = "Bandages are very cost-effective. Of course, you could also drink a healing potion (yellow) to heal your damage.";
            m_map[1046285] = "Potions, however, can be costly and require a free hand to drink.  Purchasing any of these items is easy.";
            m_map[1046286] = "Simply walk up to the appropriate vendor and say the words 'Vendor Buy', or use the vendor's context menu.";
            m_map[1046287] = "You have died.";
            m_map[1046288] = "As a ghost you cannot interact with the world. You cannot touch items nor can you use them.";
            m_map[1046289] = "You can pass through doors as though they do not exist.  However, you cannot pass through walls.";
            m_map[1046290] = "No one can understand what you say whilst you are dead, unless they are using the 'Spirit Speak' skill to understand your words.";
            m_map[1046291] = "Since you are a new player, any items you had on your person at the time of your death will be in your backpack upon resurrection.";
            m_map[1046292] = "To be resurrected you must find a healer in town or wandering in the wilderness.  Some powerful players may also be able to resurrect you.";
            m_map[1046293] = "While you are still in young status, you will be transported to the nearest healer (along with your items) at the time of your death.";
            m_map[1046294] = "To rejoin the world of the living simply walk near one of the NPC healers, and they will resurrect you as long as you are not marked as a criminal.";
            m_map[1046295] = "Target the book you wish to copy.";
            m_map[1046296] = "That is not a book";
            m_map[1046297] = "You may not loot this mongbat. Find the one that took your gold.";
            m_map[1046298] = "This mongbat does not have your gold. You need to find the mongbat that highlights grey.";
            m_map[1046299] = "No one is allowed to enter this cave from here.";
            m_map[1046300] = "This yellow potion needs to be in your backpack before you may use it.";
            m_map[1046301] = "<BODY><BASEFONT COLOR=#DFDFC0>Um... er... greetings. I... um... had some gold that I was supposed to give you... gold courtesy of Uzeraan, who's a mage you'll meet later.</BASEFONT></BODY>";
            m_map[1046302] = "<BODY><BASEFONT COLOR=#DFDFC0>But, ya see, one of those mongbats over there took the gold from me just before you arrived. I think you'll be able to get the gold back from the creature. Don't worry, I can teach you some things you'll need to know.</BASEFONT></BODY>";
            m_map[1046303] = "<BODY><BASEFONT COLOR=#DFDFC0>Accept this Quest</BASEFONT></BODY>";
            m_map[1046304] = "<BODY><BASEFONT COLOR=#DFDFC0>Skip this Quest and go to Haven</BASEFONT></BODY>";
            m_map[1046305] = "<BODY><BASEFONT COLOR=#DFDFC0>Great, let's begin. You'll have to attack and defeat the mongbat in order to get your gold back. One of the first things you need to do is equip a weapon... which just means you need to put it into your hand.</BASEFONT></BODY>";
            m_map[1046306] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to equip your weapon; to do this, you click and hold your left mouse button on the weapon, drag the weapon onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
            m_map[1046307] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I open my paperdoll?</BASEFONT></BODY>";
            m_map[1046308] = "<BODY><BASEFONT COLOR=#FF0000>How do I open my paperdoll?</BASEFONT></BODY>";
            m_map[1046309] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I open my inventory?</BASEFONT></BODY>";
            m_map[1046310] = "<BODY><BASEFONT COLOR=#FF0000>How do I open my inventory?</BASEFONT></BODY>";
            m_map[1046311] = "<BODY><BASEFONT COLOR=#DFDFC0>To open your paperdoll, single left click your character and select <BASEFONT COLOR=#FFFFFF>Open Paperdoll<BASEFONT COLOR=#DFDFC0>.</BASEFONT></BODY>";
            m_map[1046312] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I equip a weapon?</BASEFONT></BODY>";
            m_map[1046313] = "<BODY><BASEFONT COLOR=#FF0000>How do I equip a weapon?</BASEFONT></BODY>";
            m_map[1046314] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I take things from the corpse?</BASEFONT></BODY>";
            m_map[1046315] = "<BODY><BASEFONT COLOR=#FF0000>How do I take things from the corpse?</BASEFONT></BODY>";
            m_map[1046316] = "<BODY><BASEFONT COLOR=#DFDFC0>To open your inventory, single left click your character and select <BASEFONT COLOR=#FFFFFF>Open Backpack<BASEFONT COLOR=#DFDFC0>.</BASEFONT></BODY>";
            m_map[1046317] = "<BODY><BASEFONT COLOR=#DFDFC0>Next, you'll need to know how to move around.</BASEFONT></BODY>";
            m_map[1046318] = "<BODY><BASEFONT COLOR=#DFDFC0>To walk or run, click and hold your right mouse button on the screen in the direction you wish to move, and you will move toward the cursor. When the cursor is close to you, you will walk. When the cursor is further away, towards the edge of the screen, you will run.</BASEFONT></BODY>";
            m_map[1046319] = "<BODY><BASEFONT COLOR=#DFDFC0>Continue</BASEFONT></BODY>";
            m_map[1046320] = "<BODY><BASEFONT COLOR=#DFDFC0>Alright, now it's time to attack the mongbat that took your gold.</BASEFONT></BODY>";
            m_map[1046321] = "<BODY><BASEFONT COLOR=#DFDFC0>To attack someone or something, you double left click them while in War Mode. You only need to double left click them one time, though for most weapons you'll need to be standing directly next to your target in order to swing at them.</BASEFONT></BODY>";
            m_map[1046322] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I switch to War Mode?</BASEFONT></BODY>";
            m_map[1046323] = "<BODY><BASEFONT COLOR=#FF0000>How do I switch to War Mode?</BASEFONT></BODY>";
            m_map[1046324] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I know which mongbat to attack?</BASEFONT></BODY>";
            m_map[1046325] = "<BODY><BASEFONT COLOR=#FF0000>How do I know which mongbat to attack?</BASEFONT></BODY>";
            m_map[1046326] = "<BODY><BASEFONT COLOR=#DFDFC0>Right... good question: How do you switch to War Mode?</BASEFONT></BODY>";
            m_map[1046327] = "<BODY><BASEFONT COLOR=#DFDFC0>No problem. You switch between War and Peace modes by left clicking the Peace or War button on your paperdoll. You may also use the keyboard shortcut, ALT-C.</BASEFONT></BODY>";
            m_map[1046328] = "<BODY><BASEFONT COLOR=#DFDFC0>When in War Mode, you will take a combat stance and the button on your paperdoll will say, 'War' and will turn red.</BASEFONT></BODY>";
            m_map[1046329] = "<BODY><BASEFONT COLOR=#DFDFC0>Important: Don't double left click anyone or anything while in War mode unless you want to attack them!</BASEFONT></BODY>";
            m_map[1046330] = "<BODY><BASEFONT COLOR=#DFDFC0>How do I attack the mongbat?</BASEFONT></BODY>";
            m_map[1046331] = "<BODY><BASEFONT COLOR=#FF0000>How do I attack the mongbat?</BASEFONT></BODY>";
            m_map[1046332] = "<BODY><BASEFONT COLOR=#DFDFC0>Another good question: How do I know which mongbat to attack?</BASEFONT></BODY>";
            m_map[1046333] = "<BODY><BASEFONT COLOR=#DFDFC0>The mongbat that highlights grey is the one you should attack. Any mongbats that highlight blue should be left alone.</BASEFONT></BODY>";
            m_map[1046334] = "<BODY><BASEFONT COLOR=#DFDFC0>Highlighting means that while in War mode, when the cursor is over a target creature, that creature is given a highlight color over its entire body.</BASEFONT></BODY>";
            m_map[1046335] = "<BODY><BASEFONT COLOR=#DFDFC0>When you're ready, find the mongbat that highlights grey and attack it.</BASEFONT></BODY>";
            m_map[1046336] = "<BODY><BASEFONT COLOR=#DFDFC0>Now that the mongbat is dead, its corpse has fallen to the ground at your feet. Double left click the corpse to reveal what the mongbat had been carrying.</BASEFONT></BODY>";
            m_map[1046337] = "<BODY><BASEFONT COLOR=#DFDFC0>The pile of gold is your gold that was stolen. And wow! A Greater Heal potion... cool! If you use a Greater Heal potion, it will heal damage taken during combat.</BASEFONT></BODY>";
            m_map[1046338] = "<BODY><BASEFONT COLOR=#DFDFC0>To take these items, click and hold your left mouse button on one of them, drag it into your open backpack, and then release your left mouse button. Take both items this way.</BASEFONT></BODY>";
            m_map[1046339] = "<BODY><BASEFONT COLOR=#DFDFC0>Great job getting your gold!</BASEFONT></BODY>";
            m_map[1046340] = "<BODY><BASEFONT COLOR=#DFDFC0>To leave this area. take the stairs in the corner to the central chamber. Then ascend up the stairs in the middle of that chamber. This will take you to the city of Haven where you'll meet Uzeraan. He'll be waiting to speak with you.</BASEFONT></BODY>";
            m_map[1046341] = "<BODY><BASEFONT COLOR=#DFDFC0>Oh, and... I beg of you... please don't tell Uzeraan I lost your gold. Please!!</BASEFONT></BODY>";
            m_map[1046342] = "<BODY><BASEFONT COLOR=#DFDFC0>Farewell and have fun!</BASEFONT></BODY>";
            m_map[1046343] = "<BODY><BASEFONT COLOR=#DFDFC0>Equip your weapon whenever you're ready.</BASEFONT></BODY>";
            m_map[1046344] = "Number of 'Horde Minions' left to kill: ";
            m_map[1046345] = "Number of 'Horde Minions' left to kill: ";
            m_map[1046346] = "Number of Restless Souls left to kill: ";
            m_map[1046347] = "'Headless' killed: ";
            m_map[1046348] = "Restless killed:";
            m_map[1046349] = "'Shadow Wisps' killed:";
            m_map[1046350] = "Ingots made:";
            m_map[1046351] = "Pickaxes made:";
            m_map[1046352] = "Ringmail made:";
            m_map[1046353] = "Mandrake found:";
            m_map[1046354] = "Deeds completed:";
            m_map[1046355] = "Large ore:";
            m_map[1046356] = "If you are leaving the mansion, you should learn about the Radar Map.";
            m_map[1046357] = "The Radar Map (or Overhead View) can be opened by pressing 'ALT-R' on your keyboard. It shows your immediate surroundings from a bird's eye view.";
            m_map[1046358] = "Pressing ALT-R twice, will enlarge the Radar Map a little.  The map shows you your immediate surroundings from a bird's eye view.";
            m_map[1046359] = "You can close the map by right clicking on it.  Use the Radar Map often as you travel throughout the world to familiarize yourself with your surroundings.";
            m_map[1046360] = "Why are you giving me this?  You need to make pickaxes!";
            m_map[1046361] = "You have not made two pickaxes.  Come back and show me your work when you have both completed.";
            m_map[1046362] = "Yes";
            m_map[1046363] = "No";
            m_map[1046364] = "Remember that context menus can be called up by single left clicking something (or shift-left click if you have changed the option).";
            m_map[1046365] = "After you have indicated to the vendor that you wish to purchase something, you will be shown a list of the goods they have to offer.";
            m_map[1046366] = "Speaking of context menus, you can bring up the status of your quest by bringing up your avatar's own context menu (single left, or shift-left click yourself).";
            m_map[1046367] = "Choose the 'Quest Log' option, and any information pertinent to your current quest status will be shown to you.";
            m_map[1046368] = "To help you find the location of the treasure, you should become familiar with the Radar Map.";
            m_map[1046369] = "The teleporter to the caves is against the north wall of this room.";
            m_map[1046370] = "May good luck and fortune guide your way.";
            m_map[1046371] = "Once you emerge from the Moongate, the city will be roughly to the north.  It should not be difficult to find.  Find Aegis and speak with him once you are in the city..";
            m_map[1046372] = "Actually, before you can spend this money, you will have to take the check to a bank and cash it.";
            m_map[1046373] = "NPC shop keepers do not accept checks as payment.  Checks are a handy way to transport large sums of money without having to lug all that gold around.";
            m_map[1046374] = "Cashing a check is very easy.  All you have to do is locate a NPC Banker or Minter, walk near them and say the word 'Bank'.";
            m_map[1046375] = "Place the check into your bank box and double click it to cash it.  Bankers and Minters can be found inside of banks across the world.";
            m_map[1046376] = "There is a bank not too far from here, Southeast of this shop, actually.  Banks are often crowded with people conducting business.";
            m_map[1046377] = "Go now to cash your check.  The person cashing your check will explain the details of Britannia's banking system to you.";
            m_map[1046378] = "Ah! Thank you noble adventurer!  I have accepted your check and cashed it for you.  The cash can be found in your bank box.";
            m_map[1046379] = "To open your bank box, you must be near a Banker or Minter and say the word 'Bank'.";
            m_map[1046380] = "Of course you can also open your bank box by using a Minter's or Banker's context menu.";
            m_map[1046381] = "Bank boxes in Britannia are special in that the goods you place in to a bank box anywhere, can be accessed from your bank box anywhere else in the land.";
            m_map[1046382] = "That is to say, your bank box, along with any goods you placed into it,  is accessible from any bank in the land.";
            m_map[1046383] = "The safest place for any of your goods, is your bank box.  No one can access it except for you.";
            m_map[1046384] = "That's pretty much all there is to banking.  I bet you are eager to explore the world, so I won't hold you up any longer.";
            m_map[1046385] = "I've no tasks for you to complete, and you are free to adventure in the world on your own.";
            m_map[1046386] = "May your bank box overflow with the spoils of your adventures.  We shall no doubt see each other again.";
            m_map[1046387] = "Farewell.";
            m_map[1046388] = "Locate the bank and find the NPC Banker (or Minter) inside.  Then, say the word 'Bank' and place your check into your bank box and double click it.";
            m_map[1046389] = "To make it easier to find the Treasure, be sure to use your radar map.";
            m_map[1046390] = "To make your attack, you will most likely wish to use your magical powers, so allow me to give you a brief explanation of magic.";
            m_map[1046391] = "Most often, spells start out as scrolls written by either NPC or Player scribes.  Once a spell has been successfully scribed, you have two choices:";
            m_map[1046392] = "One: You can cast the spell by using (double click) the scroll.  No spell reagents (ingredients) are required to cast spells from scrolls. Casting from a scroll consumes the scroll.";
            m_map[1046393] = "Two: You can drop the scroll on to your spellbook where it will be permanently written.  You can then cast the spell from your spellbook any time you wish.";
            m_map[1046394] = "To cast a spell from a spellbook, the necessary reagents are required (listed with the spell in your spellbook). ";
            m_map[1046395] = "Casting spells from a spellbook AND casting spells from scrolls requires a certain amount of mana. The actual amount of mana required differs from circle to circle.";
            m_map[1046396] = "The 1st circle of spells is the easiest of spells to cast (and also has the least mana requirement) whilst 8th circle spells are difficult even for a Grandmaster Mage.";
            m_map[1046397] = "To actually cast a spell from your spellbook, you must first open your spellbook (double click).  This opens the book to the 1st & 2nd circle spells.";
            m_map[1046398] = "You can turn pages by single clicking the corner in the top right hand side of the spellbook, or you can single click on the circled numbers on the bottom to jump to specific circle.";
            m_map[1046399] = "You can double click any of the spell names to make an attempt at casting that spell.  To see a spell's reagent requirements, single click on the spell name.";
            m_map[1046400] = "Single clicking on a spell name will give you all the details of the spell.  You can see the aforementioned reagent requirements as well as the spell's icon.";
            m_map[1046401] = "Another way of casting a spell is to click on that spell's spell icon.  You can drag any spell's icon off of the book and place it anywhere in the game window.";
            m_map[1046402] = "Once a spell icon is in the game window, it will stay there even if you close the spellbook.  This is an easy way to set up many spells for quick casting.";
            m_map[1046403] = "Before going into battle, you should always check your reagent supply and make sure you have your spell icons set up.";
            m_map[1046404] = "You now have enough Mandrake in your pack to complete your task for Uzeraan.  Find Uzeraan and give him 75 mandrake roots by dragging them onto him.";
            m_map[1046405] = "You have enough Mandrake in your pack to complete your task for Uzeraan.  Find Uzeraan and give him 75 mandrake roots by dragging them onto him.";
            m_map[1046406] = "I have drawn you a picture of what the Reagent Shop sign looks like (left).   Remember that you can also look at (single click) shop signs to read them.";
            m_map[1046407] = "Marking runes is easy.  I'll give you a quick explanation of how it works, then I would advise that you mark a rune somewhere around my mansion so you can return quickly.";
            m_map[1046408] = "To mark a rune, you must stand in the place where you wish to appear when casting the 'Recall' or 'Gate' spell.";
            m_map[1046409] = "Then you cast the mark spell (either from a scroll or your spellbook, as I have explained earlier).  Once the spell is cast you will get a targeting cursor.";
            m_map[1046410] = "Target the rune you wish to mark and single click it.  If your spell is successful, the rune will sparkle and will from then on be 'marked'.";
            m_map[1046411] = "Looking at the rune (single click) will give you the description of the rune.  If you wish to change the default description, simply double click the rune.";
            m_map[1046412] = "Once you have double clicked the rune, you will get a text prompt.  Enter the new description and press the [enter] key on your keyboard.";
            m_map[1046413] = "By naming all of your runes to something that is meaningful to you, you can keep your rune library organized and easy to use.";
            m_map[1046414] = "the remains of ~1_NAME~";
            m_map[1046415] = "~1_bulkname~ / ~2_amountreq~ ~3_intamount~ / ~4_excep~ / ~5_ingottype~ / ~6_itemname~";
            m_map[1046416] = "During combat it is important to keep an eye on your hit points.  Should they ever drop below 0, you will die.";
            m_map[1046417] = "To bring up your status bar, single click yourself and drag away from your avatar.  Double click the status bar to see details.";
            m_map[1046418] = "If your health drops too low, you should heal yourself with bandages or healing potions.  Heal yourself often, and you should have no trouble surviving.";
            m_map[1046419] = "One more thing before you depart for battle:";
            m_map[1046420] = "You have found a Moongate.  Remember to choose 'Moonglow' as your destination when you step into the gate.";
            m_map[1046421] = "Moonglow is where Aegis is waiting for you in his shop.";
            m_map[1046422] = "Congratulations! You've completed all of your quests!";
            m_map[1046423] = "I can open a Moongate for you from here to an area close to the Moongate that can take you to the city of Moonglow.";
            m_map[1046424] = "I only have runes marked for near the Moongate, but the sextant will help you find the rest of the way.";
            m_map[1046425] = "Aegis' Shop";
            m_map[1046426] = "I have drawn you a picture to the left of what the sign on Aegis' Shop looks like. It should help you find it a little easier.";
            m_map[1046427] = "You do not have enough reagents to safely go on.  You should acquire at least 35 of each reagent.";
            m_map[1046428] = "There are 8 types of reagent: Mandrake, Nightshade, Black Pearl, Sulfurous Ash, Spider's Silk, Garlic, Ginseng and Bloodmoss.";
            m_map[1046429] = "The caves tend to be dark, so be sure to cast the 'Night Sight' spell on yourself if you have trouble seeing.";
