            m_map[1048049] = "I don't feel comfortable sending you into this battle with the amount of reagents you currently have on your person.";
            m_map[1048050] = "Please go and gather at least 35 of each reagent before returning.";
            m_map[1048051] = "Remember that there are 8 different reagents: Spider's Silk, Bloodmoss, Mandrake, Ginseng, Nightshade, Garlic, Black Pearl and Sulfurous Ash.";
            m_map[1048052] = "Double click the grey order deeds to open them.  Once open, the deed lists which items and what quantity the armourer needs.  Once you forge an item, combine the item with the deed by choosing �Combine Item� and targeting the item.";
            m_map[1048053] = "You can't stable that!";
            m_map[1048054] = "Uzeraan explains the bank is on the north side of town.  Take your bank check to a banker and drop it on the banker to cash it in.";
            m_map[1048055] = "Uzeraan says: Congratulations!  I got word through magical means that you had completed your task.  The armourers were extremely happy to have received their orders fulfilled.";
            m_map[1048056] = "Through my magic, I was able to raise your blacksmithy skill a couple points.  Now, I would like to let you take some time to put your goods in the bank. The bank is right next to the mansion to the southeast.";
            m_map[1048057] = "As you approach the bank, the names of bankers and their titles of 'banker' or 'minter' will appear.  This means you have located the building where you can access your bank account.";
            m_map[1048058] = "How to open your bank account by saying the word 'bank' and depositing items.  Once finished, visit Uzeraan and he will give you a pack horse.";
            m_map[1048059] = "Ah! Thank you noble adventurer!  I have accepted your check and cashed it for you.  The cash can be found in your bank box.";
            m_map[1048060] = "Of course you can also open your bank box by using a Minter's or Banker's context menu.";
            m_map[1048061] = "Bank boxes in Britannia are special in that the goods you place into a bank box anywhere can be accessed from your bank box anywhere else in the land.";
            m_map[1048062] = "The safest place for any of your goods is your bank box.  No one can access your bank box except for you.";
            m_map[1048063] = "After you have finished depositing items in your bank, visit Uzeraan for a pack horse.";
            m_map[1048064] = "Uzeraan explains how to use a pack horse.  Take your pack horse to mountains south of Uzeraan's castle.";
            m_map[1048065] = "Pack horses are used to carry large quantities of items that you normally could not fit in your backpack.  Miners use them for carrying large quantities of ore, ingots, and some tools.";
            m_map[1048066] = "Pack horses are loyal to their masters unless they are not fed.  Apples or pears are foods that the pack horses appreciate and will keep them loyal.";
            m_map[1048067] = "Once you have renamed your pack horse, you can have your pet obey commands.  The most common commands are 'follow me' and 'stay'.  However, your pet must be in range to hear you.";
            m_map[1048068] = "All pets you own can be renamed.  Click and hold the left mouse button on the pack horse and drag its health bar.";
            m_map[1048069] = "Try walking away from your pack horse and tell it to follow you by left-clicking on the pack horse and select the command 'follow'.";
            m_map[1048070] = "To get your pet to stay, you would tell it to stay by left-clicking on the pack horse and select the command 'stay' from the command list.";
            m_map[1048071] = "Mine 40 piles of ore from the mountains and use your pack horse to haul the piles of ore.  Visit Uzeraan at his mansion once you have the 40 piles of ore.";
            m_map[1048072] = "Now that you know how to handle your pack horse, use your new pack horse to haul 40 large piles of ore from the mountains.  You will need to tinker a couple more shovels to be able to mine the ore.";
            m_map[1048073] = "You can double-click on your pack horse to open its backpack.  While open, you can load your pack horse by dropping items into its backpack.";
            m_map[1048074] = "Uzeraan encourages you to practice to 70 skill in blacksmithy.  You do not have to train immediately.  When you have reached 70 skill, visit Uzeraan.";
            m_map[1048075] = "Uzeraan says: Congratulations!  You have mastered the basics of mining and blacksmithy.  I am giving you 500 gold for your ore.  You may keep your pack horse.";
            m_map[1048076] = "Now that you have accomplished so much, you should train your blacksmithy skill so you may perform a more difficult task.  It may take some time to train to 70 skill.  I have a task to ask of you when you have finished training.";
            m_map[1048077] = "You do not need to hurry out and train.  The world is waiting to be explored and some adventurers may need your skills.  Come visit me when you have trained to 70 skill (or higher).";
            m_map[1048078] = "Now that you are an accomplished blacksmith, Uzeraan has another set of orders the armourers of Minoc would like you to fulfill.  Once completed, give them to an armourer or blacksmith in the city of Minoc.";
            m_map[1048079] = "Uzeraan says: Ah, I see that you are well on your way to mastering blacksmithy.  I have four order deeds that the armourers would like you to fulfill in Minoc.";
            m_map[1048080] = "One of the deeds is the large order, which must be combined to completed order deeds.  The three smaller deeds are for chainmail.";
            m_map[1048081] = "Combine the items requested in the order with the small deed.  Once the deed is completed, you can use the large order deed to combine with a smaller deed.";
            m_map[1048082] = "The large order deed, when it is filled with all of the small deeds, would then be dropped onto an armourer or blacksmith in Minoc.  They will make sure your goods go to those in need.";
            m_map[1048083] = "Visit Uzeraan once you have completed the orders for the armourers of Minoc.";
            m_map[1048084] = "Mastering blacksmithy";
            m_map[1048085] = "Now that you have helped the blacksmiths of Minoc, you have proved your worthiness of mastering blacksmithy.";
            m_map[1048086] = "When you have reached 100 skill in blacksmithy, you will have the ability to mark your crafted items with your name.";
            m_map[1048087] = "Folk from around the world of Britannia can wear your signed armor and wield your signature weapons when you are a grandmaster blacksmith.";
            m_map[1048088] = "You have just slain your first 'Headless'. Now is a good time to check your health and heal yourself, if need be.";
            m_map[1048089] = "To check your health, single left-click + drag away from your avatar. This brings up your status bar. ";
            m_map[1048090] = "Double click the status bar to see detailed information. Check your hitpoints and determine if you would like to heal yourself at this point or not. ";
            m_map[1048091] = "To heal yourself you may use bandages (double click bandages and target yourself) or drink a heal potion (free one of your hands and double click the potion).";
            m_map[1048092] = "Alternatively, if you know your way around spellbooks and such, you can cast the Heal or Greater Heal spells to recover lost hitpoints.";
            m_map[1048093] = "You have slain the leader of the pack.";
            m_map[1048094] = "Be sure to check his corpse (double click) for the red box which holds the key to the cage in which the apprentice is being held.";
            m_map[1048095] = "Cast the Unlock spell on the red box to open the lock.";
            m_map[1048096] = "Open (double click) the red box and find the key inside. Take the key (drag and drop into your pack).";
            m_map[1048097] = "Use the key (double click) and target the door on the prison cage. This will unlock the door.";
            m_map[1048098] = "Now you can open the door (double click) to free the apprentice.";
            m_map[1048099] = "You have just slain your first 'Shadow Wisp'. Now is a good time to check your health and heal yourself if need be.";
            m_map[1048100] = "A Time For Healing";
            m_map[1048101] = "The Leader Lies Dead";
            m_map[1048102] = "You should have a bank check in your backpack (a yellow check).  Speak the word 'bank' to open your bank box, drag your bank check into the box, and double-click it to cash it in.";
            m_map[1048103] = "Visit Uzeraan after you have loaded 40 large piles of ore onto your pack horse.";
            m_map[1048104] = "To feed your pack horse, you would drag one apple or pear onto your pack horse.  A good practice is to feed your pack horse once an hour.";
            m_map[1048105] = "Click on the name on the health bar, delete its current name and type in a new name like 'Ed' or 'Trigger' (without spaces in the name).";
            m_map[1048106] = "The pack horse should whinny and walk towards you (unless it is not well fed), after you target yourself with the target cursor.";
            m_map[1048107] = "If the list has not ever displayed, try holding the shift key and left-clicking on the pack horse.  Take your pack horse south to the mountains to receive further instructions.";
            m_map[1048108] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to put your sword - a katana - in your hand; to do this, you click and hold your left mouse button on the katana, drag the katana onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
            m_map[1048109] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to put your smith's hammer in your hand; to do this, you click and hold your left mouse button on the hammer, drag the hammer onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
            m_map[1048110] = "<BODY><BASEFONT COLOR=#DFDFC0>Even though you don't need to have your spellbook in your hand to cast a spell, it looks cool *grin*! To put your spellbook in your hand, you click and hold your left mouse button on the spellbook, drag the spellbook onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
            m_map[1048111] = "<BODY><BASEFONT COLOR=#DFDFC0>You're going to cast Magic Arrow on the mongbat. Open your spellbook by double left clicking it. On the first page, titled First Circle, you'll see the words <BASEFONT COLOR=#FFFFFF>Magic Arrow<BASEFONT COLOR=#DFDFC0>.</BASEFONT></BODY>";
            m_map[1048112] = "<BODY><BASEFONT COLOR=#DFDFC0>To cast this spell, you'll double click the words, <BASEFONT COLOR=#FFFFFF>Magic Arrow<BASEFONT COLOR=#DFDFC0>, in your spellbook, and then left click on the mongbat with the targeting cursor. Repeat this until you've defeated the mongbat.</BASEFONT></BODY>";
            m_map[1048113] = "<BODY><BASEFONT COLOR=#DFDFC0>Another good question: How do I know which mongbat to cast the spell on?</BASEFONT></BODY>";
            m_map[1048114] = "<BODY><BASEFONT COLOR=#DFDFC0>Highlighting means that when you are casting a spell and are passing the cursor over a creature to target it,  that creature is given a highlight color over its entire body.</BASEFONT></BODY>";
            m_map[1048115] = "<BODY><BASEFONT COLOR=#DFDFC0>Be sure to exit War mode when you are finished with your attack. This is done by left clicking the red War button on your paperdoll. You may also use the keyboard shortcut, ALT-C, to toggle between War and Peace modes.</BASEFONT></BODY>";
            m_map[1048116] = "<BODY><BASEFONT COLOR=#DFDFC0>Great, let's begin. You'll have to attack and defeat the mongbat in order to get your gold back. The first thing we'll do is equip your spellbook... which just means you'll put it in your hand.</BASEFONT></BODY>";
            m_map[1048117] = "You sense that there are Horde Minions lurking about this area...";
            m_map[1048118] = "A sense of tranquility overcomes you as you leave the Horde Minions' domain...";
            m_map[1048119] = "You sense that there are Horde Minions lurking about this area...";
            m_map[1048120] = "A sense of tranquility overcomes you as you leave the Horde Minions' domain...";
            m_map[1048121] = "<BODY><BASEFONT COLOR=#DFDFC0>Equip your spellbook whenever you're ready.</BASEFONT></BODY>";
