            m_map[1049087] = "[Tempered]";
            m_map[1049088] = "<I>Uzeraan greets you as you approach...</I><BR><BR>Greetings traveler!<BR><BR>I am Uzeraan, the lord of this house and overseer of this fine city, Haven.  I know we have just met, but time is short and we need to reinforce the troops in the mountain pass, so I will not waste your time with pleasantries.<BR><BR>We have been trying to fight back the wicked <I>Horde Minions</I> which have recently begun attacking our cities - but to no avail.  We desperately need help!<BR><BR>Your first task will be to assess the situation in the mountain pass, and help our troops defeat the Horde Minions there.<BR><BR>Take the road marked with glowing runes, that starts just outside of this mansion. Before you go into battle, it would be prudent to <a href=";
            m_map[1049089] = "Find the mountain pass beyond the house which lies at the end of the runic road.<BR><BR>Assist the city Militia by slaying <I>Horde Minions</I>";
            m_map[1049090] = "Horde Minions killed:";
            m_map[1049091] = "It's no use... The <I>Horde Minions</I> are too many.  They are appearing out of nowhere.<BR><BR>Return to Uzeraan and report your findings.";
            m_map[1049092] = "<I><U>Important Quest Information</U></I><BR><BR>During your quest, any important information that a <a href = ";
            m_map[1049093] = "<I>In case you change your mind later...</I><BR><BR>You may re-start this quest at any time while you are still considered (young).  Simply return to Uzeraan's mansion and speak with any of the guards there.<BR><BR>";
            m_map[1049094] = "Follow me...";
            m_map[1049095] = "Right this way, ~1_NAME~...";
            m_map[1049096] = "Argh!  Be gone evil one! My blade shall redeem thy spirit.";
            m_map[1049097] = "No worries ~1_NAME~, I shall come to thy aid.";
            m_map[1049098] = "I shall make short work of thee.";
            m_map[1049099] = "Please follow me ~1_NAME~, we haven't got much time.";
            m_map[1049100] = "I shall call down the powers of the light to guide us to our destination!";
            m_map[1049101] = "Vas Rel Por Ort Grav";
            m_map[1049102] = "Quickly ~1_NAME~! Onward through the gate!";
            m_map[1049103] = "Be on guard friend, these are treacherous woods. Unseen evil lurks everywhere...";
            m_map[1049104] = "I am having trouble finding the way, but worry not ~1_NAME~, all is not lost!";
            m_map[1049105] = "Ahh yes, here we are.";
            m_map[1049106] = "Greetings Paladin! How nice to see you.";
            m_map[1049107] = "And you as well!  Good luck to thee and ~1_NAME~!";
            m_map[1049108] = "And you as well!! May the light guide you on your journey. Fare thee well.";
            m_map[1049109] = "Fare thee well.";
