            m_map[1049119] = "<I>You give your report to Uzeraan and after a while, he begins to speak...</I><BR><BR>Your report is grim, but all hope is not lost!  It has become apparent that our swords and spells will not drive the evil from Haven.<BR><BR>The head of my order, the High Mage Schmendrick, arrived here shortly after you went into battle with the <I>Horde Minions</I>.  He has brought with him a scroll of great power, that should aid us greatly in our battle.<BR><BR>Unfortunately, the entrance to one of our mining caves collapsed recently, trapping our miners inside.<BR><BR>Schmendrick went to install magical teleporters inside the mines so that the miners would have a way out.  The miners have since returned, but Schmendrick has not. Those who have returned, all seem to have lost their minds to madness; mumbling strange things of ";
            m_map[1049120] = "Prepare for battle and step onto the teleporter, located against the wall in the main hall of Uzeraan's mansion.<BR><BR>Find Schmendrick within the mines.";
