            m_map[1049310] = "SELECT LEATHER TYPE";
            m_map[1049311] = "You cannot work this strange and unusual leather.";
            m_map[1049312] = "You have no idea how to work this leather.";
            m_map[1049313] = "You decide it would be best to keep this item.";
            m_map[1049314] = "Onward men!  We must vanquish the Horde Minions!";
            m_map[1049315] = "Die! Foul beast!";
            m_map[1049316] = "You will learn to regret your invasion, hell spawn!";
            m_map[1049317] = "We must not let the city fall, men!  Vanquish the evil!";
            m_map[1049318] = "the remains of ~1_NAME~ the militia fighter";
            m_map[1049319] = "the remains of a militia fighter";
            m_map[1049320] = "FIRE!";
            m_map[1049321] = "Find the High Mage <I>Schmendrick</I> in the mines and recover the scroll of power from him.";
            m_map[1049322] = "<I>Schmendrick barely pays you any attention as you approach him.  His mind seems to be occupied with something else.  You explain to him that you came for the scroll of power and after a long while he begins to speak, but apparently still not giving you his full attention...</I><BR><BR>Hmmm.. peculiar indeed.  Very strange activity here indeed... I wonder...<BR><BR>Hmmm.  Oh yes! Scroll, you say?  I don't have it, sorry. My apprentice was carrying it, and he ran off to somewhere in this cave.  Find him and you will find the scroll.<BR><BR>Be sure to bring the scroll to Uzeraan once you have it. He's the only person aside from myself who can read the ancient markings on the scroll.  I need to figure out what's going on down here before I can leave.  Strange activity indeed...<BR><BR><I>Schmendrick goes back to his work and you seem to completely fade from his awareness...";
            m_map[1049323] = "Find Schmendrick's apprentice who is somewhere in the mining cave.  The apprentice has the scroll of power needed by Uzeraan.";
            m_map[1049324] = "You have obtained the scroll of power!  Find your way out of the cave.<BR><BR>Hand the scroll to Uzeraan (drag and drop) once you arrive in his mansion.";
            m_map[1049325] = "<I>Uzeraan carefully unravels the scroll and begins to read...after a short while his face lights up with a smile and he speaks to you...</I><BR><BR>This is wonderful, friend!  For your troubles I've given you a treasure map I had laying about, along with a shovel to <a href = ";
            m_map[1049326] = "<I>The Dryad watches hungrily as you approach, giving you an uneasy feeling in the pit of your stomach.  You explain that Uzeraan has sent you for a quantity of fertile dirt.  With a wide grin and in a slightly hoarse voice she replies...</I><BR><BR><I>Fertile Dirt</I>, eh?  Well, I have a few patches here...but what have you brought me in return?  Came empty-handed did you?  That's unfortunate indeed... but since you were sent by my dear friend Uzeraan, I supposed I could oblige you.<BR><BR><I>The Dryad digs around in the ground and hands you a patch of Fertile Dirt.<BR><BR>With a smile she goes back to her work...</I>";
            m_map[1049327] = "You have acquired the <I>Fertile Dirt</I>!<BR><BR>Return to the mansion (<a href = ";
            m_map[1049328] = "NullString.";
            m_map[1049329] = "<I>Uzeraan takes the dirt from you and smiles...<BR><BR></I>Wonderful!  I knew I could count on you.  As a token of my appreciation I've given you a bag with some bandages as well as some healing potions.  They should help out a bit.<BR><BR>The next item I need is a <I>Vial of Blood</I>.  I know it seems strange, but that's what the formula asks for.  I have some locked away in a chest not far from here.  It's only a short distance from the mansion.  Let me give you directions...<BR><BR>Exit the front door to the East.  Then follow the path to the North.  You will pass by several pedestals with lanterns on them.  Continue on this path until you run into a small hut.  Walk up the stairs and through the door.  Inside you will find a chest.  Open it and bring me a <I>Vial of Blood</I> from inside the chest.  It's very easy to find.  Just follow the road and you can't miss it.<BR><BR>Good luck!";
            m_map[1049330] = "You have been ambushed! Fight for your honor!!!";
            m_map[1049331] = "You take a vial of blood from the chest and put it in your pack.";
            m_map[1049332] = "You have the vial of blood!<BR><BR>Return to Uzeraan's mansion and hand him the vial.";
            m_map[1049333] = "<I>You hand Uzeraan the Vial of Blood, which he hastily accepts...</I><BR><BR>Excellent work!  Only one reagent remains and the spell is complete!  The final requirement is a <I>Daemon Bone</I>, which will not be as easily acquired as the previous two components.<BR><BR>There is a haunted graveyard on this island, which is the home to many undead creatures.   Dispose of the undead as you see fit.  Be sure to search their remains after you have smitten them, to check for a <I>Daemon Bone</I>.  I'm quite sure that you will find what we seek, if you are thorough enough with your extermination.<BR><BR>Take this magical silver sword to aid you in your battle.  Silver weapons will damage the undead twice as much as your regular weapon.<BR><BR>Return here when you have found a <I>Daemon Bone</I>.";
            m_map[1049334] = "Head <a href = ";
            m_map[1049335] = "<I>As you hand Uzeraan the final reagent, he nods at you with approval and starts searching through the pockets of his robe...<BR><BR>After a short while he hands you a small pouch...</I><BR><BR>There you are.  Your contract of employment with me has expired and so here is your pay.  2000 gold in the form of a check and a magical sextant that will help you find <a href = ";
            m_map[1049336] = "Locate the Haven Bank (use the teleporter in Uzeraan's Mansion if necessary), which lies <a href = ";
            m_map[1049337] = "<I>The banker smiles at you and greets you in a loud and robust voice...</I><BR><BR>Well hello there adventurer!  I see you've learned how to cash checks.  Wonderful!  Let me tell you a bit about the banks in this world...<BR><BR>Anything that you place into any bank box, can be retrieved from any other bank box in the land.  For instance, if you place an item into a bank box in Haven, it can be retrieved from your bank box in Britain or any other city.<BR><BR> Bank boxes are very secure.  So secure, in fact, that no one can ever get into your bank box except for yourself.  Security is hard to come by these days, but you can trust in the banking system of Britannia!  We shall not let you down! <BR><BR>I hope to be seeing much more of you as your riches grow!  May your bank box overflow with the spoils of your adventures.<BR><BR>Farewell adventurer, you are now free to explore the world on your own.";
            m_map[1049338] = "You find a vial of blood, but can't pick it up because your pack is too full.  Come back when you have more room in your pack.";
            m_map[1049339] = "Your pack is too full to carry the sword that Uzeraan wishes to give you.  Talk to Uzeraan again when you have enough room in your pack and he will give you the sword at that time.";
            m_map[1049340] = "Uzeraan hands you a finely crafted sword which you immediately place into your backpack.";
            m_map[1049341] = "You rummage through the bones and find a Daemon Bone!  You quickly place the item in your pack.";
            m_map[1049342] = "Rummaging through the bones you find a Daemon Bone, but can't pick it up because your pack is too full.  Come back when you have more room in your pack.";
            m_map[1049343] = "You can only drop quest items into the top-most level of your backpack while you still need them for your quest.";
            m_map[1049344] = "You decide against trading the item.  You still need it for your quest.";
            m_map[1049345] = "You've lost the scroll?  Argh!  I will have to try and re-construct the scroll from memory.  Bring me a blank scroll, which you can <a href = ";
            m_map[1049346] = "Schmendrick scribbles on the scroll for a few moments and hands you the finished product.";
            m_map[1049347] = "You've <I>lost</i> the vial blood?  Oh my...  Please go back to the chest and fetch another one.  It's important that we have all of the ingredients.";
            m_map[1049348] = "All items must be made with spined leather.";
            m_map[1049349] = "All items must be made with horned leather.";
            m_map[1049350] = "All items must be made with barbed leather.";
            m_map[1049351] = "Both orders must use the same leather type.";
            m_map[1049352] = "The item is not made from the requested leather type.";
            m_map[1049353] = "normal leather";
            m_map[1049354] = "spined leather";
            m_map[1049355] = "horned leather";
            m_map[1049356] = "barbed leather";
            m_map[1049357] = "I have nothing more for you at this time.";
            m_map[1049358] = "Find the Dryad in the woods of Haven and get a patch of fertile dirt from her.<BR><BR>Use Uzeraan's teleporter to get there if necessary.";
            m_map[1049359] = "You've lost the dirt I gave you?<BR><BR>My, my, my... What ever shall we do now?<BR><BR>I can try to make you some more, but I will need something that I can transform.  Bring me an <I>apple</I>, and I shall see what I can do.<BR><BR>You can <a href = ";
            m_map[1049360] = "<I>The Dryad sticks the apple into the ground and you watch it rot before your eyes.<BR><BR>She pulls the now fertile dirt out of the ground and hands it to you.</I><BR><BR>There you go friend.  Try not to lose it again this time, eh?";
            m_map[1049361] = "Bring back a vial of blood.<BR><BR>Follow the road leading north from the mansion and walk into the hut to find the chest that contains the vial";
            m_map[1049362] = "Use Uzeraan's teleporter to get to the Haunted graveyard.<BR><BR>Slay the undead until you find a <I>Daemon Bone</I>.";
            m_map[1049363] = "You have gained in Justice.";
            m_map[1049364] = "You are no longer being protected.";
            m_map[1049365] = "Another player is offering you their <a href=";
            m_map[1049366] = "Choose the player you wish to protect.";
            m_map[1049367] = "You have gained a path in Justice!";
            m_map[1049368] = "You have been rewarded for your dedication to Justice!";
            m_map[1049369] = "You cannot protect that player right now.";
            m_map[1049370] = "You must wait a while before offering your protection again.";
            m_map[1049371] = "The protective relationship between ~1_PLAYER1~ and ~2_PLAYER2~ has been ended.";
            m_map[1049372] = "You cannot use this ability here.";
            m_map[1049373] = "You have lost some Justice.";
            m_map[1049374] = "You return without <I>Fertile Dirt</I>?  It is imperative that we get all of the ingredients friend.<BR><BR>Seek out the Dryad and ask her to help you again.";
            m_map[1049375] = "You return without <I>a Vial of Blood</I>?  It is imperative that we get all of the ingredients friend.<BR><BR>Go back to the chest and fetch another vial.  Please hurry.";
            m_map[1049376] = "You return without <I>a Daemon Bone</I>?  It is imperative that we get all of the ingredients friend.<BR><BR>Go back to the graveyard and continue hunting the undead until you find another one.  Please hurry.";
            m_map[1049377] = "You return without the scroll???<BR><BR>All hope is lost without it, friend.  Return to the mines and talk to Schmendrick to see if he can help us out of this predicament.";
            m_map[1049378] = "Hand me the scroll, if you have it.";
            m_map[1049379] = "Hand me the Vial of Blood, if you have it.";
            m_map[1049380] = "Hand me the Daemon Bone, if you have it.";
            m_map[1049381] = "Hand me the Fertile Dirt, if you have it.";
            m_map[1049382] = "a magical teleporter";
            m_map[1049383] = "The teleporter doesn't seem to work for you.";
            m_map[1049384] = "I have recharged the item for you.";
            m_map[1049385] = "That doesn't need recharging yet.";
            m_map[1049386] = "<I>Uzeraan greets you as you approach...</I><BR><BR>Greetings traveler!<BR><BR>I am Uzeraan, the lord of this house and overseer of this fine city, Haven.  I know we have just met, but time is short and we need to reinforce the troops in the mountain pass, so I will not waste your time with pleasantries.<BR><BR>We have been trying to fight back the wicked <I>Horde Minions</I> which have recently begun attacking our cities - but to no avail.  We desperately need help!<BR><BR>Your first task will be to assess the situation in the mountain pass, and help our troops defeat the Horde Minions there.<BR><BR>Take the road marked with glowing runes, that starts just outside of this mansion. Before you go into battle, it would be prudent to <a href=";
            m_map[1049387] = "<I>You give your report to Uzeraan and after a while, he begins to speak...</I><BR><BR>Your report is grim,  but all hope is not lost!  It has become apparent that our swords and spells will not drive the evil from Haven.<BR><BR>The head of my order, the High Mage Schmendrick, arrived here shortly after you went into battle with the <I>Horde Minions</I>.  He has brought with him a scroll of great power, that should aid us greatly in our battle.<BR><BR>Unfortunately, the entrance to one of our mining caves collapsed recently, trapping our miners inside.<BR><BR>Schmendrick went to install magical teleporters inside the mines so that the miners would have a way out.  The miners have since returned, but Schmendrick has not. Those who have returned, all seem to have lost their minds to madness; mumbling strange things of ";
            m_map[1049388] = "<I>Uzeraan takes the dirt from you and smiles...<BR><BR></I>Wonderful!  I knew I could count on you.  As a token of my appreciation I've given you a bag with some <a href = ";
            m_map[1049389] = "I>You hand Uzeraan the Vial of Blood, which he hastily accepts...</I><BR><BR>Excellent work!  Only one reagent remains and the spell is complete!  The final requirement is a <I>Daemon Bone</I>, which will not be as easily acquired as the previous two components.<BR><BR>There is a haunted graveyard on this island, which is the home to many undead creatures.   Dispose of the undead as you see fit.  Be sure to search their remains after you have smitten them, to check for a <I>Daemon Bone</I>.  I'm quite sure that you will find what we seek, if you are thorough enough with your extermination.<BR><BR>Take these explosion spell scrolls and  magical wizard's hat to aid you in your battle.  The scrolls should help you make short work of the undead.<BR><BR>Return here when you have found a <I>Daemon Bone</I>.";
            m_map[1049390] = "I don't feel comfortable sending you into a potentially dangerous situation with as few <a href = ";
