            m_map[1049406] = "The City of Haven";
            m_map[1049407] = "The City of Haven is a city that was created especially with <a href = ";
            m_map[1049408] = "The Codex of Wisdom";
            m_map[1049409] = "You are currently reading the <I>Codex of Wisdom</I>, or ";
            m_map[1049410] = "Potions";
            m_map[1049411] = "Potions can be purchased from Alchemist <a href = ";
            m_map[1049412] = "Night Sight Potion";
            m_map[1049413] = "<U>Summary:</U><BR><BR>Drinking this potion allows you to see in the dark.  Especially useful in dungeons!<BR><BR><U>Strengths Available:</U><BR><BR>This potion is only available in one strength.<BR><BR><U>Availability:</U><BR><BR>This potion is available from <a href = ";
            m_map[1049414] = "Healing Potion";
            m_map[1049415] = "<U>Summary:</U><BR><BR>Drinking this potion allows you to recover some of your lost hitpoints.  You can only drink one healing potion approximately every 10 seconds<BR><BR><U>Strengths Available:</U><BR><BR>This potion is available in <I>Lesser Healing, Healing and Greater Healing</I> formulas.<BR><BR><U>Availability:</U><BR><BR>This potion is available from <a href = ";
            m_map[1049416] = "Poison Potion";
            m_map[1049417] = "<U>Summary:</U><BR><BR>Drinking this potion immediately poisons you and begins to drain your health.  Depending on the strenght of the poison, you may or may not survive, unless an appropriate cure is administered in a timely fashion.  The cure can come in the form of a <a href = ";
            m_map[1049418] = "Strength Potion";
            m_map[1049419] = "<U>Summary:</U><BR><BR>Drinking this potion increases your strength (and hence your maximum hitpoints) by various amounts, depending on strength, for a short time.<BR><BR><U>Strengths Available:</U><BR><BR>This potion is available in <I>Strength and Greater Strength</I> formulas.<BR><BR><U>Availability:</U><BR><BR>This potion is available from <a href = ";
            m_map[1049420] = "Refresh Potion";
            m_map[1049421] = "<U>Summary:</U><BR><BR>Drinking this potion allows you to immediately recover lost stamina (hence increasing your swing rates during combat, among other things).<BR><BR><U>Strengths Available:</U><BR><BR>This potion is available in <I>Refresh and Total Refresh</I> formulas.<BR><BR><U>Availability:</U><BR><BR>This potion is available from <a href = ";
            m_map[1049422] = "Explosion Potion";
            m_map[1049423] = "<U>Summary:</U><BR><BR>You can not drink this potion.  Instead, using the potion (double click) starts a three (3) second timer and gives you a targeting cursor.  Targeting a location of creature in range, will cause you to throw the explosion towards your target.  Once the 3 second timer expires, the potion will explode and damage creatures in the area.<BR><BR><U>Strengths Available:</U><BR><BR>This potion is available in <I>Lesser Explosion, Explosion and Greater Explosion</I> formulas.<BR><BR><U>Availability:</U><BR><BR>This potion is available from <a href = ";
            m_map[1049424] = "Cure Potion";
            m_map[1049425] = "<U>Summary:</U><BR><BR>Drinking this potion will attempt to cure you, if you are poisoned.  Depending on the strenght of the poison, a stronger Cure formula may be necessary.<BR><BR><U>Strengths Available:</U><BR><BR>This potion is available in <I>Lesser Cure, Cure and Greater Cure</I> formulas.<BR><BR><U>Availability:</U><BR><BR>This potion is available from <a href = ";
            m_map[1049426] = "Agility Potion";
            m_map[1049427] = "<U>Summary:</U><BR><BR>Drinking this potion will, for a short time, increase your maximum dexterity (and hence will increase your swing rate potential during combat).  To make the most use out of an Agility potion, be sure to follow it up with a <a href =";
            m_map[1049428] = "Magically Charged Items";
            m_map[1049429] = "Some magical items use <I>charges</I> to exercise their magical properties.  In most cases, a single use of the item will consume one (1) charge.<BR><BR>Once a magical item is out of charges, it will usually cease to operate unless you can find a way of recharging it.";
            m_map[1049430] = "Bank Checks";
            m_map[1049431] = "Checks are an easy and safe way to transport large sums of cash about without having to carry all that heavy gold on your person.  As an additional bonus, bank checks are <a href = ";
            m_map[1049432] = "Blessed Items";
            m_map[1049433] = "Most blessed items can normally be identified by the ";
            m_map[1049434] = "Cursed Items";
            m_map[1049435] = "Cursed items are the opposite of <a href =";
            m_map[1049436] = "That player cannot be protected.";
            m_map[1049437] = "Scrolls of Power";
            m_map[1049438] = "These scrolls, when used,  will allow you to permanently raise the maximum skill value, in a given skill, beyond 100.0 (up to 120.0). They can be found for various skills and will give varied skill max bonuses (+5, +10, +15, +20).   The scrolls can only be found as loot on special <I>Champion</I> creatures, which can be found in dungeons, and the <I>2nd Age</I> adventuring areas.<BR><BR><U>Important Information:</U><BR><BR>Scrolls of Power are <a href=";
            m_map[1049439] = "Player Protection";
            m_map[1049440] = "A player who has attained at least Level One (1) in the Justice Virtue may chose to ";
            m_map[1049441] = "Context Menus";
            m_map[1049442] = "Context Menus are menus that are available by single left-clicking (or Shift + single left-click, see below) on most objects or NPCs in the world.  Nearly everything, including your own avatar will have context menus available.<BR><BR>If an object in the world has a context menu available, it will by default appear when you single-left click something.  You may change this in under ";
