            m_map[1049682] = "Followers";
            m_map[1049683] = "Followers are pets, hirelings, and constructs under your control.  They are gained in a variety of different ways, including Animal Taming, trading, crafting, or just handing a pile of gold to an out-of-work mercenary.  All players may have up to five followers.  On top of this, some individual followers may count as more than one follower.  For example, a dragon counts as three followers, a hireling counts as two, and a horse counts as one.  This means you could have a dragon and two horses, or two mercenaries and one horse, or any combination thereof.<br><br>Note: Some powerful creatures, such as dragons, also require Animal Taming and Animal Lore to control, regardless of the number of followers you have.";
