            m_map[1050010] = "The ferry man has already been summoned.  There is no need to ring for him again.";
            m_map[1050011] = "How dare you summon me?!?";
            m_map[1050012] = "Only the dead may cross!";
            m_map[1050013] = "You have summoned me in vain ~1_NAME~!  Only the dead may cross!";
            m_map[1050014] = "Why have you disturbed me, mortal?!?";
            m_map[1050015] = "Feel the wrath of my legions!!!";
            m_map[1050016] = "Very well mortal, I shall grant thee passage.";
            m_map[1050017] = "The ferryman has recently been summoned already.  You decide against ringing the bell again so soon.";
            m_map[1050018] = "bell of the dead";
            m_map[1050019] = "Number of bones collected:";
            m_map[1050020] = "<I>Victoria turns to you and smiles...</I><BR><BR>Chyloth, eh?  He is the ferry man of lake <I>Mortis</I>, beyond which lies the nest of the <I>The Dark Father</I> - the fountainhead of all the evil that you see around you here.<BR><BR>800 and some years ago, my sisters and I persuaded the ferry man Chyloth to take us across the lake to battle the <I>The Dark Father</I>.  My party was utterly destroyed, except for me.  For my insolence, I was cursed by the <I>The Dark Father</I> to wander these halls for eternity, unable to die - unable to leave.<BR><BR>Chyloth usually only crosses over the souls of the undead, but he can be persuaded otherwise...with a token of gold, in the form of a human skull.  Such a gem can be found only in the belly of the hellspawn known as <I>the devourer</I>.<BR><BR>I can help you summon the beast from the depths of the abyss, but I require 1000 Daemon bones to do so.  If you accept my help, I will store the Daemon bones for you until you have collected all 1000 of them.  Once the bones are collected in full, I will summon the beast for you, which you must slay to claim your prize.<BR><BR>Do you accept?";
            m_map[1050021] = "Well done brave soul.   I shall summon the beast to the circle of stones just South-East of here.  Take great care - the beast takes many forms.  Now hurry...";
            m_map[1050022] = "For your valor in combating the devourer, you have been awarded a golden skull.";
            m_map[1050023] = "You find a golden skull, but your backpack is too full to carry it.";
            m_map[1050024] = "You pick up the golden skull and quickly place it in your backpack.  Hand the skull to Chyloth the ferry man, and he will cross you over lake Mortis.";
            m_map[1050025] = "The Summoning";
            m_map[1050026] = "Find 1000 Daemon bones and hand them to Victoria as you find them.";
            m_map[1050027] = "You have accepted Victoria's help.  She requires 1000 Daemon bones to summon the devourer.<BR><BR>You may hand Victoria the bones as you collect them and she will keep count of how many you have brought her.<BR><BR>Daemon bones can be collected via various means throughout Dungeon Doom.<BR><BR>Once you have given Victoria 1000 Daemon bones, she will not return them to you if you log out or leave the dungeon.<BR>Good luck.<BR>";
            m_map[1050028] = "Victoria has accepted the Daemon bones, but the requirement is not yet met.";
            m_map[1050029] = "<I>Victoria smiles weakly at you, and begins to speak...</I><BR><BR>Well done adventurer.  You have collected all the Daemon bones necessary for me to summon <I>the devourer</I>.  I will summon him to the circle just South-East of here.  If you manage to fell the beast, you reward will be the golden skull token that you seek.<BR><BR>May luck be on your side - you shall need it.";
            m_map[1050030] = "The Daemon bones that you have thus far given to Victoria have been returned to you.";
            m_map[1050031] = "I summon forth the forces of evil from the depth of the abyss!";
            m_map[1050032] = "I COMMAND thee to appear!";
            m_map[1050033] = "The devourer lies dead, unfortunately so do you.  You cannot claim your reward while dead.  You will need to face him again.";
            m_map[1050034] = "The devourer lies dead.  Unfortunately you did not sufficiently prove your worth in combating the devourer.  Victoria shall summon another incarnation of the devourer to the circle of stones.  Try again noble adventurer.";
            m_map[1050035] = "The devourer lies dead.  Search his corpse to claim your prize!";
            m_map[1050036] = "The devourer has been summoned near the circle of stones just South-East of here.  Help slay him for your prize!";
            m_map[1050037] = "Go forth and vanquish the devourer that has been summoned!";
            m_map[1050038] = "You have already given me all the Daemon bones necessary to weave the spell.  Keep these for a later time.";
