            m_map[1054030] = "You have gained in Valor!";
            m_map[1054031] = "You have achieved the highest path in Valor and can no longer gain any further.";
            m_map[1054032] = "You have gained a path in Valor!";
            m_map[1054033] = "Valor is the courage to take actions in support of one's convictions. You gain in Valor by slaying creatures spawned in regions controlled by Champions of Evil.";
            m_map[1054034] = "Target the Champion Idol of the Champion you wish to challenge!.";
            m_map[1054035] = "You must target a Champion Idol to challenge the Champion's spawn!";
            m_map[1054036] = "You must be a Knight of Valor to summon the champion's spawn in this manner!";
            m_map[1054037] = "Your challenge is heard by the Champion of this region! Beware its wrath!";
            m_map[1054038] = "The Champion of this region has already been challenged!";
            m_map[1054039] = "The Champion of this region ignores your challenge. You must further prove your valor.";
            m_map[1054040] = "You have lost some Valor.";
            m_map[1054041] = "";
            m_map[1054042] = "<I>The Naturalist looks up from his notes, regarding you with a hopeful look in his eyes.</I><BR><BR>Um..yes..excuse me. I was wondering if you could offer me a bit of assistance. You see, I'm a naturalist of some repute - a gentleman and a scholar if you will - primarily interested in the study of insects and arachnids. While I've written a few interesting books on the marvelous Terathan race and their bizarre culture, now I've heard tales of a truly significant new discovery!<BR><BR>Apparently a race of ant-like creatures known as the Solen have appeared in our world, scuttling up from some previously hidden home. Can you believe it? Truly these are amazing times! To a scholar such as myself this is indeed an exciting opportunity.<BR><BR>That said, while I may be a genius of some reknown, sharp as a tack and quick with the quill, I'm afraid I'm not much of the adventuring type. Though I have gained assistance before, I still have many unanswered questions.<BR><BR>I am particularly interested in the Solen Egg Nests that are studiously protected by the Solen workers. If you would be so kind as to assist me, I would ask that you travel into the Solen Hive and inspect each of the Solen Egg Nests that reside within. You will have to spend some time examining each Nest before you have gathered enough information. Once you are done, report back to me and I will reward you as best as I can for your valiant efforts!<BR><BR>Will you accept my offer?";
            m_map[1054043] = "Ah! This is splendid news! Each time an assistant travels into the Solen Hive to gather information for me, I feel as if I am one step closer to some grand discovery. Though I felt the same way when I was certain that Terathans had the ability to change their shape to resemble various fruits and vegetables - a point on which I am certain further study of the beasts will prove correct.<BR><BR>In any case, I cannot thank you enough! Please return to me when you have studied all the Solen Egg Nests hidden within the Solen Hive.";
            m_map[1054044] = "Find an entrance to the Solen Hive, and search within for the Solen Egg Nests. Each Nest must be studied for some time without a break in concentration in order to gather useful information.<BR><BR>Once you have completed your study of the Nests, return to the Naturalist who gave you this task.";
            m_map[1054045] = "You begin studying the Solen Egg Nest to gather information.";
            m_map[1054046] = "You abandon your study of the Solen Egg Nest without gathering the needed information.";
            m_map[1054047] = "You glance at the Egg Nest, realizing you've already studied this one.";
            m_map[1054048] = "You have studied enough Solen Egg Nests to gather a fair amount of useful information. Return to the Naturalist who gave you this task.";
            m_map[1054049] = "<I>The Naturalist looks up from his notes with a frustrated look on his face.</I><BR><BR>Haven't you finished the task I appointed you yet? Gah! It's so difficult to find a good apprentice these days.<BR><BR>Remember, you must first find an entrance to the Solen Hive. Once inside, I need you to examine the Solen Egg Nests for me. When you have studied all four nests, you should have enough information to earn yourself a reward.<BR><BR>Now go on, away with you! I have piles of notes from other more helpful apprentices that I still need to study!";
            m_map[1054050] = "<I>The Naturalist looks up from his notes with a pleased expression on his face.</I><BR><BR>Ah! Thank you, my goodly apprentice! These notes you have gathered will no doubt assist me in my understanding of these fascinating Solen creatures.<BR><BR>Now, since you've done such a fine job, I feel that I should give you a little reward.<BR><BR>I have a botanist friend who has discovered a strange mutation in the plants she has grown. Through science and sorcery, she has managed to produce a mutant strain of colored seeds the like of which no gardener has laid eyes upon.<BR><BR>As a reward for your fine efforts, I present you with this strange rare seed. Which reminds me, I still need to compile my notes on Solen dietary habits. They are voracious seed eaters, those Solen Matriarchs!<BR><BR>In any case, I must get back to my notes now. I give you my thanks once more, and bid a good day to you my little apprentice! If you wish to help me out again, just say the word.";
            m_map[1054051] = "<I>The Naturalist looks up from his notes with an ecstatic look upon his face.</I><BR><BR>Oh my! These notes you've brought me - they say you have information on the Secret Solen Egg Nest? I've heard many tales of this secret store of special Solen Eggs, but there are many missing gaps in my notes concerning it.<BR><BR>The notes you've made here will most certainly advance my understanding of this mysterious breed of creatures!<BR><BR>Considering the amazing effort you put into your work, I feel as if I should give you something extra special as a bonus. Hrmm...<BR><BR>I have a botanist friend who has discovered a strange mutation in the plants she has grown. Through science and sorcery, she has managed to produce a rare mutant strain of colored seeds the like of which no gardener has laid eyes upon.<BR><BR>I've given a few of her seeds out to various apprentices - but I usually keep her very rare stock all for myself. They're quite amazing looking! However, since you've done such a fine job for me, I'll present you with one of these rare fire-red seeds.<BR><BR>Once again, my thanks to you! Now I really must get back to studying these notes! Take care, my fine apprentice, and come back if you wish to help me further!";
            m_map[1054052] = "<I>The Naturalist looks up from his scribbled notes.</I><BR><BR>Greetings!<BR><BR>If you're interested in helping out a scholar of some repute, I do have some work that I could use some assistance with.<BR><BR>You seem a little preoccupied with another task right now, however. Perhaps you should finish whatever it is that has your attention at the moment and return to me once you're done.";
            m_map[1054053] = "<I>The Naturalist looks at you with a friendly expression.</I><BR><BR>I see you've returned with information for me. While I'd like to finish conducting our business, it seems that you're a bit overloaded with equipment at the moment. Perhaps you'd better free up some room before we get to discussing your reward.";
            m_map[1054054] = "You have completed your study of this Solen Egg Nest. You put your notes away.";
            m_map[1054055] = "Solen Nests Studied :";
            m_map[1054056] = "You notice something very odd about this Solen Egg Nest. You begin taking notes.";
            m_map[1054057] = "You complete your examination of this bizarre Egg Nest. The Naturalist will undoubtedly be quite interested in these notes!";
            m_map[1054058] = "You begin recording your completed notes on a bit of parchment.";
            m_map[1054059] = "<I>The Solen queen considers you for a moment then says,</I><BR><BR>Hmmm... I could perhaps benefit from your assistance, but you seem to be busy with another task at the moment. Return to me when you complete whatever it is that you're working on and maybe I can still put you to good use.";
            m_map[1054060] = "<I>The Solen queen considers you eagerly for a moment then says,</I><BR><BR>Yes. Yes, I think you could be of use. Normally, of course, I would handle these things on my own, but these are busy times. Much to do, much to do. And besides, if I am to one day become the Matriarch, then it will be good to have experience trusting others to carry out various tasks for me. Yes.<BR><BR>That is my plan, you see - I will become the next Matriarch. Our current Matriarch is fine and all, but she won't be around forever. And when she steps down, I intend to be the next in line. Ruling others is my destiny, you see.<BR><BR>What I ask of you is quite simple. First, I need you to remove some of the - well - competition, I suppose. Though I dare say most are hardly competent to live up to such a title. I'm referring to the other queens of this colony, of course. My dear sisters, so to speak. If you could remove 5 of them, I would be most pleased. *sighs* By remove, I mean kill them. Don't make that face at me - this is how things work in a proper society, and ours has been more proper than most since the dawn of time. It's them or me, and whenever I give it any thought, I'm quite sure I'd prefer it to be them.<BR><BR>I also need you to gather some zoogi fungus for me - 50 should do the trick.<BR><BR>Will you accept my offer?";
            m_map[1054061] = "<I>The Solen queen smiles as you decide to help her.</I><BR><BR>Excellent. We'll worry about the zoogi fungus later - start by eliminating 5 queens from my colony.<BR><BR>That part's important, by the way; they must be queens from my colony. Killing queens from the other solen colony does little to help me become Matriarch of this colony and will not count toward your task.<BR><BR>Oh, and none of those nasty infiltrator queens either. They perform a necessary duty, I suppose, spying on the other colony. I fail to see why that couldn't be left totally to the warriors, though. Nevertheless, they do not count as well.<BR><BR>Very well. Carry on. I'll be waiting for your return.";
            m_map[1054062] = "Kill 5 red solen queens.";
            m_map[1054063] = "Kill 5 black solen queens.";
            m_map[1054064] = "Red Solen Queens killed:";
            m_map[1054065] = "Black Solen Queens killed:";
            m_map[1054066] = "<I>The Solen queen looks up as you approach.</I><BR><BR>You're back, but you have not yet eliminated 5 queens from my colony. Return when you have completed this task.<BR><BR>Remember, by the way, that queens from the other solen colony and infiltrator queens do not count toward your task.<BR><BR>Very well. Carry on. I'll be waiting for your return.";
            m_map[1054067] = "You've completed your task of slaying solen queens. Return to the ambitious queen who asked for your help.";
            m_map[1054068] = "<I>The Solen queen looks pleased to see you.</I><BR><BR>Splendid! You've done quite well in reducing my competition to become the next Matriarch. Now I must ask that you gather some zoogi fungus for me. I must practice processing it into powder of translocation.<BR><BR>I believe the amount we agreed upon earlier was 50. Please return when you have that amount and then give them to me.<BR><BR>Farewell for now.";
            m_map[1054069] = "Gather zoogi fungus until you have 50 of them, then give them to the ambitious queen you are helping.";
            m_map[1054070] = "<I>The Solen queen looks up as you approach.</I><BR><BR>Do you have the zoogi fungus?<BR><BR>If so, give them to me. Otherwise, go gather some and then return to me.";
            m_map[1054071] = "I have not asked you to bring me any zoogi fungus, therefore I cannot accept these.";
            m_map[1054072] = "Our arrangement was for 50 of the zoogi fungus. Please return to me when you have that amount.";
            m_map[1054073] = "<I>The Solen queen smiles as she takes the zoogi fungus from you.</I><BR><BR>Wonderful! I greatly appreciate your help with these tasks. My plans are beginning to take shape ensuring that I will be the next Matriarch. But there is still much to be done until then.<BR><BR>You've done what I've asked of you and for that I thank you. Please accept this bag of sending and some powder of translocation as a reward. Oh, and I suppose I should give you some gold as well. Yes, yes. Of course.";
            m_map[1054074] = "You have been given a bag of sending.";
            m_map[1054075] = "You have been given some powder of translocation.";
            m_map[1054076] = "You have been given some gold.";
            m_map[1054077] = "<I>The Solen queen looks at you with a smile.</I><BR><BR>While I'd like to finish conducting our business, it seems that you're a bit overloaded with equipment at the moment.<BR><BR>Perhaps you should free some room in your backpack before we proceed.";
            m_map[1054078] = "<I>The Solen queen looks up as you approach.</I><BR><BR>Ah good, you've returned. I will conclude our business by giving you any remaining rewards I owe you for aiding me.";
            m_map[1054079] = "<I>The Solen Matriarch smiles as she eats the seed you offered.</I><BR><BR>Thank you for that seed. It was quite delicious.  <BR><BR>I would offer to make you a friend of my colony, but you seem to be busy with another task at the moment. Perhaps you should finish whatever is occupying your attention at the moment and return to me once you're done.";
            m_map[1054080] = "Thank you for that plant seed. Those have such wonderful flavor.";
            m_map[1054081] = "<I>The Solen Matriarch smiles as you greet her.</I><BR><BR>It is good to see you again. I would offer to process some zoogi fungus for you, but you seem to be busy with another task at the moment. Perhaps you should finish whatever is occupying your attention at the moment and return to me once you're done.";
            m_map[1054082] = "<I>The Solen Matriarch smiles happily as she eats the seed you offered.</I><BR><BR>I think you for that seed. I was quite delicious. So full of flavor.<BR><BR>Hmm... if you would like, I could make you a friend of my colony. This would stop the warriors, workers, and queens of my colony from thinking you are an intruder, thus they would not attack you. In addition, as a friend of my colony I will process zoogi fungus into powder of translocation for you.<BR><BR>To become a friend of my colony, I ask that you complete a couple tasks for me. These are the same tasks I will ask of you when you wish me to process zoogi fungus, by the way.<BR><BR>First, I would like for you to eliminate some infiltrators from the other solen colony. They are spying on my colony, and I fear for the safety of my people. They must be slain.<BR><BR>After that, I must ask that you gather some water for me. Our water supplies are inadequate, so we must try to supplement our reserve using water vats here in our lair.<BR><BR>Will you accept my offer?";
            m_map[1054083] = "<I>The Solen Matriarch smiles happily as you greet her.</I><BR><BR>Hello again. It is always good to see a friend of our colony.<BR><BR>Would you like me to process some zoogi fungus into powder of translocation for you? I would be happy to do so if you will first undertake a couple tasks for me.<BR><BR>First, I would like for you to eliminate some infiltrators from the other solen colony. They are spying on my colony, and I fear for the safety of my people. They must be slain.<BR><BR>After that, I must ask that you gather some water for me. Our water supplies are inadequate, so we must try to supplement our reserve using water vats here in our lair.<BR><BR>Will you accept my offer?";
            m_map[1054084] = "<I>The Solen Matriarch looks pleased that you've accepted.</I><BR><BR>Very good. Please start by hunting some infiltrators from the other solen colony and eliminating them. Slay 7 of them and then return to me.<BR><BR>Farewell for now and good hunting.";
            m_map[1054085] = "Kill 7 red solen infiltrators.";
            m_map[1054086] = "Kill 7 black solen infiltrators.";
            m_map[1054087] = "Red Solen Infiltrators killed:";
            m_map[1054088] = "Black Solen Infiltrators killed:";
            m_map[1054089] = "<I>The Solen Matriarch looks up as you approach.</I><BR><BR>You're back, but you have not yet eliminated 7 infiltrators from the enemy colony. Return when you have completed this task.<BR><BR>Carry on. I'll be waiting for your return.";
            m_map[1054090] = "You've completed your task of slaying solen infiltrators. Return to the Matriarch who gave you this task.";
            m_map[1054091] = "<I>The Solen Matriarch nods favorably as you approach her.</I><BR><BR>Marvelous! I'm impressed at your ability to hunt and kill enemies for me. My colony is thankful.<BR><BR>Now I must ask that you gather some water for me. A standard pitcher of water holds approximately one gallon. Please decant 8 gallons of fresh water into our water vats.<BR><BR>Farewell for now.";
            m_map[1054092] = "Gather 8 gallons of water for the water vats of the solen ant lair.";
            m_map[1054093] = "Gallons of Water gathered:";
            m_map[1054094] = "<I>The Solen Matriarch looks up as you approach.</I><BR><BR>You're back, but you have not yet gathered 8 gallons of water. Return when you have completed this task.<BR><BR>Carry on. I'll be waiting for your return.";
            m_map[1054095] = "You've completed your task of gathering water. Return to the Matriarch who gave you this task.";
            m_map[1054096] = "<I>The Solen Matriarch listens as you report the completion of your tasks to her.</I><BR><BR>I give you my thanks for your help, and I will gladly make you a friend of my solen colony. My warriors, workers, and queens will not longer look at you as an intruder and attack you when you enter our lair.<BR><BR>I will also process some zoogi fungus into powder of translocation for you. Two of the zoogi fungi are required for each measure of the powder. I will process up to 200 zoogi fungi into 100 measures of powder of translocation.<BR><BR>I will also give you some gold for assisting me and my colony, but first let's take care of your zoogi fungus.";
            m_map[1054097] = "<I>The Solen Matriarch listens as you report the completion of your tasks to her.</I><BR><BR>I give you my thanks for your help, and I will gladly process some zoogi fungus into powder of translocation for you. Two of the zoogi fungi are required for each measure of the powder. I will process up to 200 zoogi fungi into 100 measures of powder of translocation.<BR><BR>I will also give you some gold for assisting me and my colony, but first let's take care of your zoogi fungus.";
            m_map[1054098] = "Give the Solen Matriarch a stack of zoogi fungus to process into powder of translocation.";
            m_map[1054099] = "<I>The Solen Matriarch smiles as you greet her.</I><BR><BR>I will gladly process some zoogi fungus into powder of translocation for you. Two of the zoogi fungi are required for each measure of the powder. I will process up to 200 zoogi fungi into 100 measures of powder of translocation.";
            m_map[1054100] = "You receive some powder of translocation.";
            m_map[1054101] = "<I>The Solen Matriarch smiles as you greet her.</I><BR><BR>Ah good, you've returned. I will conclude our business by giving you gold I owe you for aiding me.";
            m_map[1054102] = "<I>The Solen Matriarch looks at you with a smile.</I><BR><BR>While I'd like to finish conducting our business, it seems that you're a bit overloaded with equipment at the moment.<BR><BR>Perhaps you should free some room in your backpack before we proceed.";
            m_map[1054103] = "The solen revoke their friendship. You will now be considered an intruder.";
