            m_map[1054147] = "Solen Matriarch Quest";
            m_map[1054148] = "Return to the ambitious solen queen for your reward.";
            m_map[1054149] = "Return to the solen matriarch for your reward.";
            m_map[1054150] = "The item was placed in your bank box.";
            m_map[1054151] = " was placed in your bank box.";
            m_map[1054152] = "You may only send items from your backpack to your bank box.";
            m_map[1054160] = "You have gained in sacrifice.";
            m_map[1055000] = "<I>The ancient, wrinkled hag looks up from her vile-smelling cauldron.  Her single, unblinking eye attempts to focus in on you, but to little avail.</I><BR><BR>What's that?  Who's there?  What do you want with me?  I don't have time for the likes of you.  I have stews to spice and brews to boil.  Too many things to complete to be helping out a stranger.<BR><BR>Besides, it looks as if you've already got yourself a quest that needs doing.  Perhaps if you finish the task you're on, you can return to me and I'll help you out.  But until then, leave an old witch alone to her magics!  Shoo!  Away with ye!<BR><BR><I>The witch rushes you off with a wave of her decrepit hand and returns to tending the noxious brew boiling in her cauldron.</I>";
            m_map[1055001] = "<I>The ancient, wrinkled hag looks up from her vile-smelling cauldron.  Her single, unblinking eye attempts to focus in on you, but to little avail.</I><BR><BR>Eh? Who is it? Who's there?  Come to trouble an old woman have you?<BR><BR>I'll split ye open and swallow yer guts!  I'll turn ye into a pile o' goo, I will!  Bah!  As if I didn't have enough to worry about.  As if I've not enough trouble as it is!<BR><BR>Another of my blasted apprentices has gone missing!  Foolish children, think they know everything.  I should turn the lot of them into toads - if only they'd return with their task complete!  But that's the trouble, innit?  They never return!<BR><BR>But you don't care, do ye?  I suppose you're another one of those meddlesome kids, come to ask me for something?  Eh?  Is that it?  You want something from me, expect me to hand it over?  I've enough troubles with my apprentices, and that vile imp, Zeefzorpul!  Why, I bet it's him who's got the lot of them!  And who knows what he's done?  Vile little thing.<BR><BR>If you expect me to help you with your silly little desires, you'll be doing something for me first, eh?  I expect you to go seek out my apprentice.  I sent him along the road west of here up towards Yew's graveyard, but he never came back. Find him, and bring him back, and I'll give you a little reward that I'm sure you'll find pleasant.<BR><BR>But I tells ye to watch out for the imp name've Zeefzorpul!  He's a despicable little beast who likes to fool and fiddle with folk and generally make life miserable for everyone.  If ye get him on your bad side, you're sure to end up ruing the day ye were born. As if you didn't already, with an ugly mug like that!<BR><BR>Well, you little whelp?  Going to help an old hag or not?";
            m_map[1055002] = "<I>Somewhat out of character for the vile old witch, she actually seems delighted that you've accepted her offer.</I><BR><BR>Ah! That's the spirit! You're not a useless bag of bones after all, are ye?  Well then, best get your hind quarters in gear and head towards the road!  Remember, my young Apprentice could be anywhere along the road heading towards the Yew Graveyard, so be sure to run the whole course of it, and stay on track!<BR><BR>And for Gashnak's sake, come back here when you've found something! And remember, I don't have all day!  And watch out for the imp Zeefzorpul!  And don't return empty handed!  And pack a warm sweater!  And don't trample my lawn on the way out!<BR><BR>What are you still doing here?  Get to it!  Shoo!";
            m_map[1055003] = "<I>The wrinkled hag looks up at you with venom in her eyes.</I><BR><BR>What're you doing back here?  I thought I told you to go find my lost Apprentice!  I don't have time for your laziness, you wretched little worm!  Shoo! Away with ye! And don't come back until you've found out what's happened to my Apprentice!";
            m_map[1055004] = "You inspect the charred and bloodied corpse, recognizing it from the Hag's description as the lost Apprentice you were tasked to bring back.<BR><BR>It appears as if he has been scorched by fire and magic, and scratched at with vicious claws.<BR><BR>You wonder if this horrific act is the work of the vile imp Zeefzorpul of which the Hag spoke.  You decide you'd best return to the Hag and report your findings.";
            m_map[1055005] = "<I>The wrinkled old Hag looks up from her cauldron of boiling innards.</I><BR><BR>Bah!  Back already?  Can't you see I'm busy with my cooking?  You wouldn't like to have a little taste of my delicious dragon gizzard soup, would you?  Haw! I thought as much.<BR><BR>Enough of this jibber-jabber then - what news of my Apprentice?<BR><BR>What's that?  You say that horrible little imp Zeefzorpul was behind his disappearance!?  What would Zeefzorpul want with my Apprentice?  Probably just wants to make life more miserable for me than it already is.<BR><BR>Wait! Bah! That must be it! Zeefzorpul must have found out that I sent my Apprentices out with various Magic Brew Recipes - lists of tasks and ingredients that needed completing.<BR><BR>That despicable Zeefzorpul knows I need the list of ingredients I gave to that Apprentice.  I've recipes to mix, stews to boil, magics to cast, and fortunes to meddle!  I won't let that wretched felchscum spoil my day.  You then, I need you to go find Zeefzorpul and get that scrap of parchment back!<BR><BR>I'm not sure where he bides his time, but I'm sure if you go find his imp friends and rough them up, they'll squeal on him in no time!  They all know each others' secret hiding places.  Go on!  Shoo! Go slay a few imps until they cough up their secrets!  No mercy for those little nasties!";
            m_map[1055006] = "<I>The sickly old hag looks up from her boiling cauldron.</I><BR><BR>Have you found that vile little Zeefzorpul yet?  What!?  You've come back here without finding out where Zeefzorpul is, and what he's done with my Magic Brew Recipe?<BR><BR>I told you what needs to be done, you little whelp!  Now away with ye!  And don't you return until you've found my list of ingredients!";
            m_map[1055007] = "<I>The wretched imp cries out for mercy.</I><BR><BR>Forgive me! You master! You great warrior, great hooman, great greatest! Forgive! Forgive! I give up Zeef! He no good any way!  He always smack me head and hurt me good!  He say I ugly too, even with me pretty teef!<BR><BR>But I knows where he hide!  I follow him flapping to his hidey hole.  He think he so smart but he so wrong!  I make scribble drawing of where he like to hide!  But you need the whistle blower to make him come!  He no come without it!  Make with the whistle at his hidey place, and Zeef must come, he cannot resist!<BR><BR><I>The frightened imp hands you a crumpled map and a strange flute.</I><BR><BR>You go to where the picture shows and then you play that whistle!  Zeef come, me promise!  But you make promise that you smack Zeef head good!  Pweese?<BR><BR><I>With this last request, the miserable little imp falls and breathes no more.</I>";
            m_map[1055008] = "<I>In a puff of smoke that smells of brimstone, the imp Zeefzorpul appears.</I><BR><BR>Wuh-whut!? How did stupid hooman find mighty Zeefzorpul?  This crazy many times!  This crazy not possible! This big crazy with crazy on top!  But it happening!  How can it be true!?<BR><BR>GAH! Even mighty Zeefzorpul can no resist that crazy music!  Mighty Zeefzorpul do what you want!  Have you stupid paper back!  Mighty Zeefzorpul no want it any way.  It dumb.  It super dumb.  Big dumb like stupid dumb tree with dumb things on it!  So stupid!  So dumb that mighty Zeefzorpul not even care!  You see me not caring?  You better cause it certainly happening!  Me not caring one bit!<BR><BR><I>The strange little imp tosses the piece of parchment at you.  Much to your surprise, however, he swoops down in a flash of flapping wings and steals the Magic Flute from your grasp.</I><BR><BR>Hah! So stupid like a hooman!  Mighty Zeefzorpul has defeated stupid hooman and is greatest ever imp in world!  You serious stupid, mister hooman.  Big stupid with stupid on top.  Now you no can make trick on me again with crazy dance music!  Mighty Zeefzorpul fly away to his other secret home where you never find him again!<BR><BR>Me hope you get eated by a troll!<BR><BR><I>With that, the imp Zeefzorpul disappears in another puff of rancid smoke.</I>";
            m_map[1055009] = "<I>The wart-covered witch looks up from pouring fetid scraps of meat into her cauldron.</I><BR><BR>You've dealt with that troublesome imp Zeefzorpul?  Good for you, little one!  You're not as useless as you appear, even to a daft old wench such as myself!<BR><BR>Now then, I see you've recovered my precious Magic Brew Recipe.  I suppose you expect a reward?  Well, you can go on expecting, and I can go on being ugly.  What good is it to me that I have the list, if I don't have an apprentice to go gather the ingredients and perform the tasks themselves!<BR><BR>If you want your precious little reward, you'll have to complete the task I gave to my previous Apprentice.  Now away with you!  Shoo! Shimmy! Skedattle!  I've heads to boil and stews to spice!  Don't you return until you've completed every item on that list!";
            m_map[1055010] = "<I>The bawdy old pirate captain looks up from his bottle of Wild Harpy whiskey, as drunk as any man you've ever seen.<BR><BR>With an excruciatingly slow movement, he pushes back his tricorne hat and stares you down with red-rimmed eyes.</I><BR><BR>Whut tha blazes do ye want, landlubber?  Some've Captain Blackheart's fine Whiskey?  Well ye can drown in the seven seas, ya barnacle-covered bilge rat!<BR><BR>I've cut down pasty-faced runts like yerself for lesser insults!  I've sailed the seas've this world fer fifty years, and never seen a more milk-soaked pansy lass than ye come in here for a favor.  Give ye some of my special Whiskey?  I'd sooner wrestle a sea serpent naked - and I've done that some twenty times!<BR><BR>Ye see, ol' Captain Blackheart's Whiskey is only for pirate folk.  And ye don't look like no pirate I've ever seen.  Ye have te have the right cut of cloth and the right amount of liquor in yer belly te sail on my crew!  And without that, ye might as well go home and cry to yer mommy.  ?Cause ye ain't ever gonna share no drink with me!<BR><BR>Now off with ye!<BR><BR><I>With that, Captain Blackheart goes back to singing his bawdy songs and drinking his whiskey.  It seems as if you'll have to find some way to change his mind about your worthiness.</I>";
            m_map[1055011] = "<I>The drunken pirate, Captain Blackheart, looks up from his bottle of whiskey with a pleased expression.</I><BR><BR>Well looky here!  I didn't think a landlubber like yourself had the pirate blood in ye!  But look at that!  You certainly look the part now!  Sure you can still keep on your feet?  Har!<BR><BR>Avast ye, ye loveable pirate!  Ye deserve a belt of better brew than the slop ye've been drinking, and I've just the thing.<BR><BR>I call it Captain Blackheart's Whiskey, and it'll give ye hairs on yer chest, that's for sure.  Why, a keg of this stuff once spilled on my ship, and it ate a hole right through the deck!<BR><BR>Go on, drink up, or use it to clean the rust off your cutlass - it's the best brew, either way!<BR><BR><I>Captain Blackheart hands you a jug of his famous Whiskey. You think it best to return it to the Hag, rather than drink any of the noxious swill.</I>";
            m_map[1055012] = "<I>The ancient crone looks up from her bubbling brew, staring you down with her one good eye.</I><BR><BR>You've returned already have you?  And what of your task?  Have you gathered all the needed ingredients?<BR><BR>What's that!?  You still haven't finished the simple little task I've set before you?  Then why come back here and bother me?  I can't get a single brew concocted if you keep bugging me with your whimpering little diatribes!  Why, you're worse than my last apprentice - and he was the very king of fools!<BR><BR>Go on with ye!  Away and begone!  I don't want to see hide nor hair of your whining little face until you've gathered each and every last one of the ingredients on that list!<BR><BR><I>With a disgusting hacking noise, the vile witch spits upon the ground and brushes you off with a wave of her wrinkled old hand.</I>";
            m_map[1055013] = "<I>The horrible wretch of a witch looks up from her vile experiments and focuses her one good eye on you.</I><BR><BR>Eh?  What's that?  You say you've gathered the ingredients for my delicious Magic Brew?<BR><BR>Well, well, I don't know exactly what to say.  I thought for sure you'd end up dead!  Haw!  Can't blame a lady for wishing, can you?  Even if she is a bit old and wrinkled.<BR><BR>Well, I promised you a reward for your efforts, and I never lie - leastways not to someone like you, after the great sacrifices you've made.  You know, I could use a new Apprentice, in an official capacity as it were.  I couldn't convince you to stay around and help me out some more could I?  There's always cauldrons that need cleaning, dung that needs shoveling, newts eye that needs a proper chewing, and fires that need stoking.<BR><BR>What's that? Not interested?  Well, I suppose you have great things ahead of you and all that. Feh! Like a puckish little puke like you could ever make something of themselves in this cold old world!<BR><BR>Nevertheless, I'll give you your blasted reward, and you'd better be happy with it because it's all you're getting.  ?Caused me enough trouble as it is.  Here, take it, and be off with you!  It'll be a pleasure to my eye if I never have to squint to see you again!  And the stench!  Smells like you washed this very morning!  A great fancy folk you are, with your soaps and water!  Think you're so great...why, I remember when we didn't even have soap, and water was made by tiny little fairies and cost a gold piece for a thimbleful...I could tell you some stories, I could...<BR><BR><I>Your reward in hand, you decide to leave the old Hag to her mumblings before she realizes you're still around and puts you back to work.</I>";
            m_map[1055014] = "To the west of the Hag's house lies the road between Skara Brae and Yew.  Follow it carefully toward Yew's graveyard, and search for any sign of the Hag's apprentice along the road.";
            m_map[1055015] = "Return to the Hag to tell her of the vile imp Zeefzorpul's role in the murder of her Apprentice, and the subsequent theft of a mysterious scrap of parchment from the corpse.";
            m_map[1055016] = "Search the realm for any imps you can find, and slash, bash, mash, or fry them with magics until one of them gives up the secret hiding place of the imp Zeefzorpul.";
            m_map[1055017] = "Find the location shown in the map that the imp gave you. When you have arrived at the location, play the magic flute he provided, and the imp Zeefzorpul will be drawn to your presence.";
            m_map[1055018] = "Return to the old Hag and tell her you have recovered her Magic Brew Recipe from the bizarre imp named Zeefzorpul.";
            m_map[1055019] = "You must gather each ingredient on the Hag's list so that she can cook up her vile Magic Brew.  The first ingredient is :";
            m_map[1055020] = "sheep liver";
            m_map[1055021] = "rabbit's foot";
            m_map[1055022] = "mongbat wing";
            m_map[1055023] = "chicken gizzard";
            m_map[1055024] = "rat tail";
