            m_map[1055031] = "Freshly Cut Red Mushrooms";
            m_map[1055032] = "Bones Buried In Hallowed Ground";
            m_map[1055033] = "Star Chart";
            m_map[1055034] = "Captain Blackheart's Whiskey";
            m_map[1055035] = "You dip the container into the disgusting swamp water, collecting enough for the Hag's vile stew.";
            m_map[1055036] = "You slice a red cap mushroom from its stem.";
            m_map[1055037] = "You finish your grim work, finding some of the specific bones listed in the Hag's recipe.";
            m_map[1055038] = "You dig through the dirt, but turn up no bones that match the descriptions of those in the Hag's recipe.";
            m_map[1055039] = "You gaze up into the sky, but it is not dark enough to see any stars.";
            m_map[1055040] = "You gaze up into the glittering night sky.  With great care, you compose a chart of the most prominent star patterns.";
            m_map[1055041] = "The drunken pirate shakes his fist at you and goes back to drinking.";
            m_map[1055042] = "";
            m_map[1055043] = "You gather a ~1_INGREDIENT_NAME~ from the corpse.";
            m_map[1055044] = "You must gather each ingredient on the Hag's list so that she can cook up her vile Magic Brew.  The second ingredient is :";
            m_map[1055045] = "You must gather each ingredient on the Hag's list so that she can cook up her vile Magic Brew.  The final ingredient is :";
            m_map[1055046] = "You have completed your current task on the Hag's Magic Brew Recipe list.";
            m_map[1055047] = "You examine the corpse, but it doesn?t fit the description of the particular apprentice the Hag tasked you with finding.";
            m_map[1055048] = "You examine the corpse, but find nothing of interest.";
            m_map[1055049] = "* You see a strange imp stealing a scrap of paper from the bloodied corpse *";
            m_map[1055050] = "You have gathered all the ingredients listed in the Hag's Magic Brew Recipe.  Return to the Hag and tell her you have completed her task.";
            m_map[1055051] = "magic flute";
            m_map[1055052] = "The flute sparkles. Zeefzorpul must be in a good hiding place nearby.";
            m_map[1055053] = "Nothing happens. Zeefzorpul must not be hiding in this area.";
            m_map[1055054] = "<I>The bawdy old pirate captain looks up from his bottle of Wild Harpy whiskey, as drunk as any man you've ever seen.</I><BR><BR>Avast ye, ye loveable pirate!  Just in from sailin' the glorious sea?  Ye look right ready te fall down on the spot, ye do!<BR><BR>I tell ye what, from the look've ye, ye deserve a belt of better brew than the slop ye've been drinking, and I've just the thing.<BR><BR>I call it Captain Blackheart's Whiskey, and it'll give ye hairs on yer chest, that's for sure.  Why, a keg of this stuff once spilled on my ship, and it ate a hole right through the deck!<BR><BR>Go on, drink up, or use it to clean the rust off your cutlass - it's the best brew, either way!<BR><BR><I>Captain Blackheart hands you a jug of his famous Whiskey. You think it best to return it to the Hag, rather than drink any of the noxious swill.</I>";
            m_map[1055055] = "You are still attempting to obtain a jug of Captain Blackheart's Whiskey, but the drunkard Captain refuses to share his unique brew.  You must prove your worthiness as a pirate to Blackheart before he'll offer you a jug.";
            m_map[1055056] = "<I>The inebriated pirate looks up at you with a wry grin.</I><BR><BR>Well hello again, me little matey.  I see ye have a belly full of rotgut in ye.  I bet ye think you're a right hero, ready te face the world.  But as I told ye before, bein' a member of my pirate crew means more'n just being able to hold yer drink.  Ye have te look the part - and frankly, me little barnacle, ye don't have the cut of cloth te fit in with the crowd I like te hang around.<BR><BR>So scurry off, ye wee sewer rat, and don't come back round these parts all liquored up an' three sheets te tha wind, unless yer truly ready te join me pirate crew!<BR><BR><I>Captain Blackheart shoves you aside, banging his cutlass against the table as he calls to the waitress for another round.</I>";
            m_map[1055057] = "<I>Captain Blackheart looks up from polishing his cutlass, glaring at you with red-rimmed eyes.</I><BR><BR>Well, well.  Lookit the wee little deck swabby.  Aren't ye a cute lil' lassy?  Don't ye look just fancy?  Ye think yer ready te join me pirate crew?  Ye think I should offer ye some've me special Blackheart brew?<BR><BR>I'll make ye walk the plank, I will!  We'll see how sweet n' darlin' ye look when the sea serpents get at ye and rip ye te threads!  Won't that be a pretty picture, eh?<BR><BR>Ye don't have the stomach fer the pirate life, that's plain enough te me.  Ye prance around here like a wee lil' princess, ye do.  If ye want to join my crew ye can't just look tha part - ye have to have the stomach fer it, filled up with rotgut until ye can't see straight.  I don't drink with just any ol' landlubber!  Ye'd best prove yer mettle before ye talk te me again!<BR><BR><I>The drunken pirate captain leans back in his chair, taking another gulp of his drink before he starts in on another bawdy pirate song.</I>";
            m_map[1055058] = "<I>Captain Blackheart looks up from his drink, almost tipping over his chair as he looks you up and down.</I><BR><BR>You again?  I thought I told ye te get lost?  Go on with ye!  Ye ain't no pirate - yer not even fit te clean the barnacles off me rear end!  Don't ye come back babbling te me for any of me Blackheart Whiskey until ye look and act like a true pirate!<BR><BR>Now shove off, sewer rat - I've got drinkin' te do!<BR><BR><I>The inebriated pirate bolts back another mug of ale and brushes you off with a wave of his hand.</I>";
            m_map[1055059] = "<I>The filthy Captain flashes a pleased grin at you as he looks you up and down.</I><BR><BR>Well that's more like it, me little deck swabber!  Ye almost look like ye fit in around here, ready te sail the great seas of Britannia, sinking boats and slaying sea serpents!<BR><BR>But can ye truly handle yerself?  Ye might think ye can test me meddle with a sip or two of yer dandy wine, but a real pirate walks the decks with a belly full of it.  Lookit that, yer not even wobblin'!<BR><BR>Ye've impressed me a bit, ye wee tyke, but it'll take more'n that te join me crew!<BR><BR><I>Captain Blackheart tips his mug in your direction, offering up a jolly laugh, but it seems you still haven't impressed him enough.</I>";
            m_map[1055060] = "Grizelda's Extra Strength Hangover Cure";
            m_map[1055061] = "You have received a map and a magic flute.";
            m_map[1055062] = "You have received the Magic Brew Recipe.";
            m_map[1055063] = "<I>The wrinkled old hag stops stirring her noxious stew for a moment to look up at you as you approach.</I><BR><BR>Eh? What's that? You say you've gathered the ingredients for my delicious Magic Brew?<BR><BR>Well now, my little one, I'd like to discuss your reward with you, but it seems you won't have enough room to carry it even if I do provide you with your treat.  Perhaps you'd best remove some items from that overstuffed pack of yours and talk to me when you're ready.<BR><BR><I>The witch goes back to stirring the contents of her bubbling cauldron.  You'd best make room in your pack for the Hag's reward before speaking to her again.</I>";
            m_map[1055064] = "<I>The wrinkled old crone stops stirring her noxious stew, looking up at you with an annoyed expression on her face.</I><BR><BR>You again? Listen, you little wretch, I'm in no mood for any of your meddlesome requests. I've work to do, and no time for your whining.<BR><BR>Come back later, and maybe I'll have something for you to do. In the meantime, get out of my sight - and don't touch anything on your way out!<BR><BR><I>The vile hag hacks up a gob of phlegm, spitting it on the ground before returning to her work.</I>";
            m_map[1055065] = "a bottle of magical moonfire brew";
            m_map[1055080] = "<I>Elwood looks up from his ale as you greet him.</I><BR><BR>What's that? Who me? No, no. You must be looking for someone else.";
            m_map[1055081] = "<I>Elwood greets you warmly, like an old friend he's not quite sure he ever had.</I><BR><BR>Hello. Yes. Sit down. Please. Good. Okay, stand. Up to you.<BR><BR>So, what brings you to these parts... hey, wait. Just had a thought. Would you like to do me a favor? Yes, really. You know, for old times sake. The good ole days. You were always one of my best suppliers. Or maybe you weren't, who knows any more. Anyway, could use some help supplementing my stock. You know me. Always looking for something new to add to the collection. Or sometimes not so new - just more of the same. But don't have to tell you that. You know, don't you. Yes. Just like old times. That's what it'll be. You and me - together again. Ah, it's been too long.<BR><BR>So what do you think? The fee will be the same as always. I'm a fair man. You know that. So what do you say?";
            m_map[1055082] = "<I>Elwood looks a bit flustered and nearly knocks over his bottle of ale.</I><BR><BR>Well, I see. It's like that, is it? Yes. Well then. Okay. You've changed. Yes. Yes, you have. Something's changed. I know I haven't. Not me. Not good ole Elwood.<BR><BR><I>Elwood trails off, though you can still hear him muttering softly.</I>";
            m_map[1055083] = "<I>Elwood slaps his knee and grins at you.</I><BR><BR>Yes. Yes. That's the spirit. I knew it. Knew it when I first saw you. You remind me so much of your dear departed father. Or someone. Not sure. Maybe no one. But that's okay. Ah, good times.<BR><BR>Anyway, so as you know, I'm a collector. Got all kinds of interesting things laying around back at my warehouse. You know. You've seen it. Haven't you? Yes? No? Nevermind. Not important.<BR><BR>Right. So, always trying to add new things to my collection. Or sometimes just get more of something. Can't have too many. Right? Yeah? Sure.<BR><BR>Let's see. Where to start. Oh, I know. Pearls. Yes. But not just any pearls. Rainbow pearls. Yes. From the lake here in Haven. Seems all that magic Uzeraan was throwing around when he transformed the island had an interesting effect on some of the shellfish down there. Exactly, rainbow pearls. Useless for magic, but an item worth collecting. Trust me on this. Trust me.<BR><BR>Need you to go fish some up for me. Down at the lake. Lake Haven. Off ya go. Happy fishing!<BR><BR><I>Elwood turns back to his ale and now seems oblivious to you.</I>";
            m_map[1055084] = "Fish up shellfish from Lake Haven and collect rainbow pearls.";
            m_map[1055085] = "Rainbow pearls collected: ";
            m_map[1055086] = "You pull a shellfish out of the water, and find a rainbow pearl inside of it.";
            m_map[1055087] = "You pull a shellfish out of the water, but it doesn't have a rainbow pearl.";
            m_map[1055088] = "You've collected enough rainbow pearls. Speak to Elwood to give them to him and get your next task.";
            m_map[1055089] = "<I>Elwood looks up as you tap him on the shoulder.</I><BR><BR>Good. Good. You're back. Wait. You don't have the rainbow pearls I need. Taking a break? Yeah. Sure. There's no hurry. Let me know when you've got all those pearls, though. I'll be here.";
            m_map[1055090] = "<I>Elwood jumps slightly when you call his name.</I><BR><BR>What. I'm awake. Oh, It's you. Hey, look at those pearls. Beautiful. Wow. Where'd you get those... oh right. I sent you to get them. From the lake. Lake Haven. Great job. Gotta love rainbow pearls. Oooh, Colors.<BR><BR>Okay, let's see. Next. Need a painting. Go to the Colored Canvas and speak to Alberta. Alberta Giacco. Best painter I've ever met. Ask her to do a painting of you. Yes. Of you. A portrait. Never know if you might up and become famous one day. Need to have a painting of you in my collection. From now. Before all the fame. Go. Alberta awaits. She's in Vesper.<BR><BR><I>Elwood starts playing with the pearls you brought him and seems to have forgotten you're there.</I>";
            m_map[1055091] = "Go to Vesper and speak to Alberta Giacco at the Colored Canvas.";
            m_map[1055092] = "<I>Alberta looks up from the painting she is working on and faces you.</I><BR><BR>Excuse me. I don't mean to be rude, but I'm in the middle of something, and can't... oh wait, I see. You must be the one Elwood sent over.<BR><BR>Very well. If you'll have a seat on the stool over there, we'll get started. This will just take a few seconds. I paint quite quickly, you see. I'll start once you are seated.<BR><BR><I>Alberta exchanges the painting she was working on for a blank canvas.</I>";
            m_map[1055093] = "Sit on the stool in front of Alberta's easel so that she can paint your portrait. You'll need to sit there for about 30 seconds.";
            m_map[1055094] = "<I>Elwood yawns and stretches, then focuses his gaze on you.</I><BR><BR>Hello. Do I know you? Hold on a second. Yes. Yes, I do. You were going to bring me some rainbow pearls. Wait. No. You already did that. I remember now. Right. So go get that portrait painted. Alberta is in Vesper. Go to her. Alberta Giacco. Come back when she's done.";
            m_map[1055095] = "You must remain seated on the stool until the portrait is complete. Alberta will now have to start again with a fresh canvas.";
            m_map[1055096] = "<I>Alberta looks at you sympathetically.</I><BR><BR>Don't worry, this will only take a few seconds. I realize that stool can be uncomfortable, and I apologize for that. Perhaps I should replace it with a more comfortable chair. But then again, it's that very discomfort that helps produce such wonderful facial expressions for my paintings. Ah well.";
            m_map[1055097] = "<I>Elwood drums his fingers on the counter then looks up at you expectantly.</I><BR><BR>Ah, finally. I'm famished. This so-called tavern doesn't even serve pizza, so one must have it delivered. It's an outrage. Er... wait. Where's my pizza? Yes, my pizza. What kind of delivery is this? Didn't even bring my pizza. This will severely impact your tip, I'm afraid.<BR><BR>Hold on a moment. You were helping me with something else, weren't you? Ah. Yes. I've got it now. You were to have a portrait done. Well. Good. Yes. But let's not dawdle. Off you go. If you happen to see anyone with my pizza, please insist they hurry.<BR><BR>";
            m_map[1055098] = "<I>Alberta stands back from the canvas and surveys her work.</I><BR><BR>Not too bad. Quite good even, if I do say so myself. As always, of course.<BR><BR>Oh, you're still here. Please let Elwood know that the painting has been completed. I'll have it sent to him once it dries.<BR><BR><I>Alberta removes the portrait from her easel and sets it aside to dry.</I>";
            m_map[1055099] = "Return to Elwood and let him know that the painting is complete.";
            m_map[1055100] = "<I>Elwood notices you immediately and waves you over.</I><BR><BR>You're back. Good. That's good. Hmm. You don't seem to have that painting yet. Don't tell me Alberta refused. That's no good. I made her what she is! She was living in the gutter when I found her. The gutter. And she has the... what's that? Oh, she finished the portrait. Right. Good. Can always count on Alberta. Always. Best painter in the land.<BR><BR>Just have a couple... er... wait... make that... two more task for you. Then our business will be concluded. For now. Old chums like us will always work together again. Yes. We go so far back. Right. I think.<BR><BR>Anyway. There's a musician. A minstrel. His name's Gabriel Piete. Quite the good singer. One of my favorites. Absolute favorite. What I'd like is his autograph. SimplePath. Just his autograph. You're likely to find him at the Conservatory of CoreMusicPlayer in Britain. He's often there. Often. Between performances. Hurry now. There ya go.<BR><BR><I>Elwood falls silent though his lips are still  moving. It looks like he's quietly repeating the word, ";
            m_map[1055101] = "Go to Britain and obtain the autograph of renowned minstrel, Gabriel Piete. He is often found at the Conservatory of CoreMusicPlayer.";
            m_map[1055102] = "<I>Alberta stops cleaning her brushes and looks your way.</I><BR><BR>Don't worry, I'll send the painting to Elwood once it's dry. Please let him know that the painting has been finished.";
            m_map[1055103] = "<I>Gabriel sighs loudly as you address him and stops whatever it was that he was doing.</I><BR><BR>WHAT?!? Can you not see that I'm working here?  Ugh, sometimes I wish they'd just lock the outer doors to anyone who doesn't belong here. So go ahead and fawn. Get it over with, and then leave. Sooner you're out of here, the sooner I'm back to work.<BR><BR>I see. So you want an autograph. Fine. If it'll get rid of you, I'll give you my autograph. But I'll only sign some sheet music for one of my songs. Until then, please let me get back to work.<BR><BR>You can probably find some of my sheet music at one of the theaters in the land. When I perform there, they often sell it as a souvenir. Speak to the impresario... the theater manager. My last three performances were in Nujel'm, Jhelom, and here in Britian.";
            m_map[1055104] = "Find some sheet music for one of Gabriel's songs. Try speaking to an impresario from one of the theaters in the land.";
            m_map[1055105] = "<I>Elwood jumps and almost falls from his stool when you tap his shoulder.</I><BR><BR>Oh my. Don't do that. Scared me half to death. Sneaking up on people like that. I don't even know you. Yes, I do. I do know you. Ordered a pizza from you and never received it. I'm rather miffed about that.<BR><BR>No. No. Wait. Of course. Not the pizza. You're here with the moonfire brew I wanted. Magical moonfire brew. Not sure what it is. Just want some.<BR><BR>What's that? Oh. The autograph. Gabriel Piete. Yes. Of course. Do you have it? No. Well. Hmm. Don't sneak up on people like that. Not polite.";
            m_map[1055106] = "Sheet music for a Gabriel Piete song? No, I'm sorry, but we've run out. We might get some more after he performs here again, but right now we don't have any. My apologies.";
            m_map[1055107] = "Sure, I have some sheet music for a Gabriel Piete song. I'd be happy to sell you a copy for 10 gold.";
            m_map[1055108] = "You don't have enough gold to buy the sheet music.";
            m_map[1055109] = "The theater impresario hands you some sheet of music for one of Gabriel Piete's songs.";
            m_map[1055110] = "Speak to Gabriel to have him autograph the sheet music.";
            m_map[1055111] = "<I>Gabriel does not look happy to see you.</I><BR><BR>Do you have any sheet music? No. Please return when you do, but until then please leave me to my work.";
            m_map[1055112] = "<I>Elwood seems to be studying the bottom of his bottle of ale as you approach.</I><BR><BR>What's this? Strange. Quite strange. I could have sworn I was drinking wine.<BR><BR>Oh, hello. Yes. Good to see you. Any luck with that autograph?  Bet you thought I'd forgotten. No. Not me. Mind like a steel trap. Can't get it open no matter how hard you try. Or something. No luck yet? Ah well. keep trying. I have faith in you. Whoever you are.";
            m_map[1055113] = "<I>Gabriel looks up impatiently as you approach.</I><BR><BR>Good. We can finally be done with one another. Here, let me sign that and have this business completed.<BR><BR><I>Gabriel takes the sheet music, autographs it, and then hands it back to you.</I>";
            m_map[1055114] = "Speak to Elwood to give him the autographed sheet music.";
            m_map[1055115] = "<I>Elwood scratches his ear then notices you.</I><BR><BR>Good day. What brings you to the Albatross? Me? An autograph? You want my autograph? Well, I suppose. What's that? Oh. Yes. Gabriel Piete. Yes. Get his autograph and return to me. Good day.";
            m_map[1055116] = "<I>Elwood looks up eagerly as you tell him about the autographed sheet music.</I><BR><BR>Quite good work. Not an easy one to deal with, that one. Gabriel Piete. Yes. Well done. Nice autograph.<BR><BR>One last task. I would like a set of toy monster figurines made by the famous toymaker, Tomas O'Neerlan. You'll find him in Trinsic. He's often at the Tinker's Guild. Try looking there.<BR><BR>You're doing quite well. Quite well indeed. Knew you would. Just like old times. Yes. Quite good.";
            m_map[1055117] = "Go to Trinsic and speak to Tomas O'Neerlan, the famous toymaker.";
            m_map[1055118] = "<I>Gabriel ignores you.</I>";
            m_map[1055119] = "<I>Tomas smiles freely as you speak to him.</I><BR><BR>Ah, to be sure I can make you some toy monster figurines. That's my work, making toys. Worry not, we'll put together a good set of monsters for you and your figurines.<BR><BR>But I'll be needing something from you before I can begin. Here, take these enchanted paints. Using them, you can capture a set of images of the creatures you wish me to make into toys. It'll only work on the group of creatures I select for your set of figurines. Oh, and I'll be needing those enchanted paints back when all is said and done.<BR><BR>";
            m_map[1055120] = "Use the enchanted paints to capture the image of all of the creatures listed below.";
            m_map[1055121] = "Complete";
            m_map[1055122] = "Incomplete";
            m_map[1055123] = "<I>You watch as Elwood spins around blissfully on his stool.</I><BR><BR>Oh. Forgive me. Didn't see you there. Whoo. Dizzy. Can't see straight. Have you gotten those figurines yet? No. Ah. Not to worry. Keep at it. No doubt you'll come through with those.<BR><BR>Excuse me a moment. I think I need to sit down. Wait. I am sitting down. Good then. Yes. Sitting down.<BR><BR><I>Elwood reaches out and takes hold of the counter as if to steady himself.</I>";
            m_map[1055124] = "You have no interest in capturing the image of this creature.";
            m_map[1055125] = "The enchanted paints swirl for a moment then an image begins to take shape. *Click*";
            m_map[1055126] = "a painted image of: ";
            m_map[1055127] = "a painted image";
            m_map[1055128] = "You now have all of the creature images you need. Return to Tomas O'Neerlan so that he can make the toy figurines.";
            m_map[1055129] = "<I>Tomas greets you warmly as you approach.</I><BR><BR>'Tis good to see you. I see that you have not yet collected all of the images we need. 'Tis fine, but I'll be needing those before I can make the toy figurines. Return when you have the complete set of images.<BR><BR>";
            m_map[1055130] = "<I>Elwood suddenly stops and beckons you over to him.</I><BR><BR>Over here. Come here. Don't be alarmed, but I think one of the tavernkeepers used to be a wandering healer. Said something about the good ole days when people would just walk up and hand gold to them. Piles of gold. Out of the blue. Can you imagine? Got so much gold, this ex-healer decided to buy a tavern and settle down. Kind of sad really. Can't even cure my hangover now. Nice tavern though.<BR><BR>Right. Anyway. Let me know when those toy figurines are ready. I'll be here. As always.";
            m_map[1055131] = "<I>Tomas grins as you walk toward him.</I><BR><BR>I see that you have collected all of the images we need. 'Tis good. I'll begin straight away on the toy figurines. I'll have them delivered to you when ready. Where shall I send them? To Elwood in Haven? Yes, I know him. We've done business in the past. Odd fellow.<BR><BR>Tomas smiles as you return his enchanted paints back to him.<BR><BR>";
            m_map[1055132] = "Return to Elwood with news that the toy figurines will be delivered when ready.";
            m_map[1055133] = "<I>Elwood is singing as you greet him.</I><BR><BR>Come. Join in. It's a Gabriel Piete song. I have the sheet music for it. It's even autographed by Gabriel Piete himself. Yes. One of his songs. Brilliant.<BR><BR>So let me see the toys. Figurines. Let's see them. Oh. You don't have them yet. I see. Well. Okay. That's too bad.";
            m_map[1055134] = "<I>Elwood takes a sip of his ale as you address him.</I><BR><BR>Ah. That's the stuff. Ale. Nothing better. What's that? Toy figurines will be delivered. Right. Yes. Perhaps better than Ale. Tough one.<BR><BR>Very good work. Quite. Think we're all done now. You completed everything I asked. Would work with you again. Yes. We should.<BR><BR>Ah. Yes. your payment. The usual. I think you'll be pleased.<BR><BR><I>With that Elwood rummages around in his backpack. He eventually pulls out a small bag and hands it to you.</I>";
            m_map[1055135] = "<I>Elwood stares at you as you approach.</I><BR><BR>I know you. Oh yes. You've been running some errands for me. We are about done. Noticed that your backpack is a bit full. Might want to make some room. Won't be able to hold your payment. Come back when you have more room, and we'll conclude our business.";
            m_map[1055136] = "Return to Elwood for your reward when you have some room in your backpack.";
            m_map[1055137] = "a section of an obsidian statue";
            m_map[1055138] = "a partially reconstructed obsidian statue";
            m_map[1055139] = "an obsidian statue of ~1_STATUE_NAME~";
            m_map[1055140] = "an obsidian statue";
            m_map[1055141] = "This device is used to purify water. For it to work, three key ingredients are required: a plague beast core, some moonfire brew, and a fragment of obsidian.";
            m_map[1055142] = "You do not have the necessary ingredients. The contraptions rumbles angrily but does nothing.";
            m_map[1055143] = "You add the required ingredients and activate the contraption. It rumbles and smokes and then falls silent. The water shines for a brief moment, and you feel confident that it is now much less tainted than before.";
            m_map[1060001] = "You throw the switch, but the mechanism cannot be engaged again so soon.";
            m_map[1060002] = "I am the guardian of the Tomb of Sektu. Suffer my wrath!";
            m_map[1060003] = "You try to pry the box open, when you notice that there is no opening.  It's a fake box.";
            m_map[1060004] = "Securely Replace This House";
            m_map[1060005] = "You are attempting to replace your current house.  Your house will vanish and the land it occupies will be outlined in red.  For 10 minutes, only you will be allowed to place a house over the red-outlined land.  You can use any house placement tool to place any house type in a new location near to or directly on the reserved land.  If you successfully place a new house, the land reservation markings will disappear and others may attempt to place houses in that area.  If you fail to place a new house in 10 minutes, die, log out, or move more than 30 tiles from the center of the reserved land, your original house will reappear at its previous location.  All of your locked down and secure items will be preserved in a House Moving Crate while you do this.  Are you sure you wish to continue?";
            m_map[1060006] = "Make This House Customizable";
            m_map[1060007] = "More than ten minutes have passed since you initiated House Replacement.  Since you have not yet placed your original house in a new location or placed a new house, your original house has been restored to its original location.";
            m_map[1060008] = "You have moved more than 30 tiles away from the center of your original house, or you have crossed subserver boundaries.  Since you have not yet placed your original house in a new location or placed a new house, your original house has been restored to its original location.";
            m_map[1060009] = "You have died, lost connection, or logged out.  Since you have not yet placed your original house in a new location or placed a new house, your original house has been restored to its original location.";
            m_map[1060010] = "You have successfully relocated your original house.  All of its contents have been moved with the house.";
            m_map[1060011] = "<unused>";
            m_map[1060012] = "You have successfully replaced your original house with a new house.  The value of the replaced house has been deposited into your bank box.  All of the items in your original house have been relocated to a Moving Crate in the new house.  Any deed-based house add-ons have been converted back into deeds.  Vendors and barkeeps in the house, if any, have been stored in the Moving Crate as well.  Use the <B>Get Vendor</B> context-sensitive menu option on your character to retrieve them.  These containers can be used to re-create the vendor in a new location.  Any barkeepers have been converted into deeds.";
            m_map[1060013] = "You are about to turn your house into a customizable house.  You will be refunded the value of this house, and then be charged the cost of the equivalent customizable dirt lot.  All of your possessions in the house will be transported to a Moving Crate.  Deed-based house add-ons will be converted back into deeds.  Vendors and barkeeps will also be stored in the Moving Crate.  Your house will be leveled to its foundation, and you will be able to build new walls, windows, doors, and stairs.  Are you sure you wish to continue?";
            m_map[1060014] = "Only the dead may pass.";
            m_map[1060015] = "Grudgingly pay the money";
            m_map[1060016] = "I'd rather stay dead, you scoundrel!!!";
            m_map[1060017] = "Wishing to rejoin the living, are you?  I can restore your body... for a price of course...";
            m_map[1060018] = "Do you accept the fee, which will be withdrawn from your bank?";
