            m_map[1060092] = "You disarm their weapon!";
            m_map[1060093] = "Your weapon has been disarmed!";
            m_map[1060094] = "<I>An old man who looks to be 200 years old from the looks of his translucently pale and heavily wrinkled skin, turns to you and gives you a half-cocked grin that makes you feel somewhat uneasy.<BR><BR> After a short pause, he begins to speak to you...</I><BR><BR>Hmm. What's this?  Another budding Necromancer to join the ranks of Evil?  Here... let me take a look at you...  Ah yes...  Very Good! I sense the forces of evil are strong within you, child � but you need training so that you can learn to focus your skills against those aligned against our cause.  You are destined to become a legendary Necromancer - with the proper training, that only I can give you.<BR><BR><I>Mardoth pauses just long enough to give you a wide, skin-crawling grin.</I><BR><BR>Let me introduce myself.  I am Mardoth, the guildmaster of the Necromantic Brotherhood.  I have taken it upon myself to train anyone willing to learn the dark arts of Necromancy.  The path of destruction, decay and obliteration is not an easy one.  Only the most evil and the most dedicated can hope to master the sinister art of death.<BR><BR>I can lend you training and help supply you with equipment � in exchange for a few services rendered by you, of course.  Nothing major, just a little death and destruction here and there - the tasks should be easy as a tasty meat pie for one as treacherous and evil as yourself.<BR><BR>What do you say?  Do we have a deal?";
            m_map[1060095] = "Dark Tides";
            m_map[1060099] = "Excellent choice, young apprentice of evil!<BR><BR>I will not waste our time with pleasantries.  There is much work to be done � especially in light of the recent Paladin ambushes that we have suffered.  The necromantic brotherhood is working towards the summoning of the elder daemon Kronus, who will rise from the Well of Tears to help us finally crush the Paladin forces that have plagued our lands for so long now.<BR><BR>To summon Kronus, we must energize the Well of Tears with a series of dark rituals.  Unfortunately the rituals needed to sufficiently energize the Well of Tears have been lost to us.  Your task will be to recover one of the ritual scrolls needed for the summoning.<BR><BR>You will need to find the corpse of the Arch Necromancer Maabus, which has been laid to rest in the tomb of elders.  We believe his spirit may have memory of where we may find the scrolls needed for the summoning.  You will need to awaken him from the slumber of death, using your Animate Dead spell, of course.<BR><BR>To reach the tomb, step onto the magical teleporter just to the <a href = ";
            m_map[1060100] = "...";
            m_map[1060101] = "...";
            m_map[1060102] = "Re-animate the corpse of Maabus using your <a href=";
            m_map[1060103] = "<I>Maabus emits an ear-crawling screech as his body reanimates.  He turns and angrily screams at you</I>:<BR><BR>YOU INFIDEL!  HOW DARE YOU AWAKEN MAABUS!?!<BR><BR><I>Maabus continues to scream at you angrily for some time.  As he settles down, you explain to him the purpose of your visit.  Once you explain that you are on a quest to summon the elder daemon Kronus, Maabus begins to cooperate, and begins to speak in a more reasonable tone</I>:<BR><BR>Well, why didn�t you say so?  If you�re going to raise Kronus from the Well of Tears, you must first complete a long series of dark rituals.  I once owned one of the scrolls needed for the summoning, but alas it was lost to me when I lost my life to a cowardly Paladin ambush near the Paladin city of Light.  They would have probably hidden the scroll in their precious crystal cave near the city.<BR><BR>There is a teleporter in the corner of this tomb.  It will transport you near the crystal cave at which I believe one of the calling scrolls is hidden.  Good luck.<BR><BR><I>Maabus' body slumps back into the coffin as your magic expires</I>.";
            m_map[1060104] = "Take the teleporter in the corner of Maabus' tomb to the crystal cave where the calling scroll is kept.";
            m_map[1060105] = "<I>An old man, dressed in slightly tattered armor, whom you recognize to be a Paladin stands before the Crystal Cave staring blankly into the space in front of him.  As he begins to speak to you, you realize this man is blind.  You attempt to persuade the blind man that you are a Paladin seeking to inspect the scroll of calling...</I><BR><BR>Greetings traveler!<BR><BR>You seek entrance to the Crystal Cave, home of the Calling Scroll?  Hmm.  You reak of death and decay, brother.  You reak of death like a Necromancer, but yet you claim to be a Paladin in hopes that I will grant thee passage into the cave?<BR><BR>Please don�t think ill of me for this, but I�m just a blind, old man looking to keep the brotherhood of Paladins safe from the clutches of the elder daemon Kronus.  The Necromancers have been after this particular scroll for quite some time, so we must take all the security precautions we can.<BR><BR>Before I can let you pass into the Crystal Cave, you must speak to me the secret word that is kept in the Scroll of Abraxus in the Vault of Secrets at the Paladin city of Light.  It�s the only way that I can be sure you are who you claim to be, since Necromancers cannot enter the Vault due to powerful protective magic that the brotherhood has blessed the vault with.";
            m_map[1060106] = "Infiltrate the city of the Paladins and figure out a way into the Vault. See Mardoth for help with this objective.";
            m_map[1060107] = "<I>Mardoth looks at you expectantly until you tell him that you failed to retrieve the scroll...</I><BR><BR>You failed?  Very unfortunate...  So now you must find your way into the paladin�s Vault of Secrets, eh?  Well, you won't be able to get in � there is a powerful magic aura that protects the Vault from all Necromancers.  We simply cannot enter.  However, that's not to say your familiar spirit can't.<BR><BR><I>Mardoth grins with obvious satisfaction as he explains the details of the <a href=";
            m_map[1060108] = "Use the teleporter near Mardoth to be transported to the Paladin City of Light.";
            m_map[1060109] = "Follow the road paved with glowing runes to find the Vault of Secrets.  Be careful not to give yourself away as a Necromancer while in the city.";
            m_map[1060110] = "You have arrived in the Vault of Secrets.  You can feel the protective magic in this place restricting you, making you feel nearly claustrophobic.<BR><BR>Just ahead of you and out of your reach, you see a collection of scrolls and books, one of them being entitled 'Scroll of Abraxus' .  You can only assume that this scroll holds the current password required to enter the Crystal Cave.<BR><BR>This would be a good opportunity to <a href=";
            m_map[1060111] = "You instinctively will your familiar to fetch the book for you.";
            m_map[1060112] = "This would be a good opportunity to summon your familiar.  Since your familiar is not a Necromancer, it will not be affected by the anti-magic aura that surrounds this Vault.<BR><BR><a href=";
            m_map[1060113] = "You instinctively will your familiar to fetch the scroll for you.";
            m_map[1060114] = "You have obtained the Scroll of Abraxus, which contains the secret password needed to gain passage into the Crystal Cave where the Scroll of Calling is kept.  Read the scroll (double click) and figure out the password.<BR><BR>Once you have the password, return to the Crystal Cave and speak the password to the guard.<BR><BR>If you do not know the way to the Crystal Cave from the Paladin City, you can use the magic teleporter located just outside of the vault.";
            m_map[1060115] = "Now that you have the password, return to the Crystal Cave to speak with the guard there.  Use the teleporter outside of the vault to get there if necessary.";
            m_map[1060116] = "Security at the Crystal Cave<BR><BR>We have taken great measures to ensure the safety of the Scroll of Calling, which we have so valiantly taken from the Necromancer Maabus during the battle of the wood nearly 200 years ago.<BR><BR>The scroll must never fall into the hands of the Necromancers again, lest they use it to summon the ancient daemon Kronus.  The scroll of calling is a necessity in the series of dark rites the Necromancers must perform to once again re-awaken Kronus.<BR><BR>Should Kronus ever rise again, the days of the Paladins, and indeed humanity as we know it will be numbered.<BR><BR>For this reason, we have posted the honorable Horus, former General of the Northern Legions to guard the entrance of the Crystal Cave where we keep the Scroll of Calling.  Horus was infused with magical life from the tree Urywen during his last battle.  The power gave him eternal life, but it also, unfortunately, took his eye sight.<BR><BR>Since Horus cannot see those he admits to the Crystal Cave, he will only allow those that know the secret password to enter.  Speak the following word to Horus and he shall grant you passage to the Crystal Cave:<BR><BR><I>Urywen</I><BR><BR>Do not speak this password anywhere except when seeking passage into the Crystal Cave, as our adversaries are lurking in the shadows � they are everywhere.<BR><BR>Go with the light, friend.<BR><BR><I>- Frater Melkeer</I>";
            m_map[1060117] = "Speak the secret word that you read in the scroll stolen from the Vault to Horus the guard, using his <a href=";
            m_map[1060118] = "Very well Paladin, you have proven to me your identity.  I grant thee passage.<BR><BR>Be careful, however � I�ve heard that the cave has been infested with a vermin of some sort.  Our High Lord Melkeer was supposed to send some troops to clear the vermin out of the cave, but that was last week already.  I fear that he forgot.<BR><BR>If you can find it in your goodness to dispose of at least 5 of those vermin in there, I shall reward your efforts.  If however you are too busy, and I would understand if you were, don�t bother with the vermin.<BR><BR>You may now pass through the energy barrier to enter the Crystal Cave.   Take care honorable Paladin soul.  Walk in the light my friend.";
            m_map[1060119] = "Enter the Crystal Cave and find the Scroll of Calling.  The barrier will now allow you to pass.";
            m_map[1060120] = "You rummage through the scrolls until you find the Scroll of Calling.  You quickly put it in your pack.";
            m_map[1060121] = "You have returned with the scroll!  I knew I could count on you.  You can now perform the rite of calling at the Well of Tears.  This ritual will help charge the Well to prepare for the coming of Kronus.   You are prepared to do your part young Necromancer!<BR><BR>Just outside of this tower, you will find a path lined with red lanterns.  Follow this path to get to the Well of Tears.  Once you have arrived at the Well, use the scroll to perform the ritual of calling.  Performing the rite will empower the well and bring us that much closer to the arrival of Kronus.<BR><BR>Once you have completed the ritual, return here for your promised reward.";
            m_map[1060122] = "STOP WICKED ONE!";
            m_map[1060123] = "I will slay you before I allow you to complete your evil rites!";
            m_map[1060124] = "Step onto the teleporter near Mardoth and follow the path of glowing runes to the tomb of Maabus.";
            m_map[1060125] = "Find the Crystal Cave password by reading (double click) the golden scroll entitled ";
            m_map[1060126] = "You have disposed of the creatures as Horus has asked. See him on your way out of the Crystal Cave to claim your reward.";
            m_map[1060127] = "You have obtained the scroll of calling. See Mardoth for further instructions.";
            m_map[1060128] = "Follow the red lanterns to the Well of Tears where you will perform the calling of Kronus.";
            m_map[1060129] = "You have arrived at the well, but no longer have the scroll of calling.  Use Mardoth's teleporter to return to the Crystal Cave and fetch another scroll from the box.";
            m_map[1060130] = "Use the Scroll of Calling (double click) near the Well of Tears to charge the waters for the arrival of Kronus.";
            m_map[1060131] = "Victory! You have done as Mardoth has asked of you. Take as much of your foe's loot as you can carry and return to Mardoth for your reward.";
            m_map[1060132] = "Although you were slain by the cowardly paladin, you managed to complete the rite of calling as instructed. Return to Mardoth.";
            m_map[1060133] = "You have done as I asked... I knew I could count on you from the moment you walked in here!<BR><BR>The forces of evil are strong within you.  You will become a great Necromancer in this life - perhaps even the greatest.<BR><BR>My work for you is done here.  I release you from my service to go into the world and fight for our cause...<BR><BR>Oh...I almost forgot - your reward.  Here is a magical weapon and 2000 gold for you, in the form of a check.  Don't spend it all in one place though, eh?<BR><BR>Actually, before you can spend any of it at all, you will have to <a href=";
            m_map[1060134] = "Use the enchanted sextant in your pack to locate the nearest bank.  Go there and speak with the Banker.";
            m_map[1060135] = "My new string";
            m_map[1060136] = "Locate the nearest Bank using the enchanted sextant in your pack.  Once there, <a href=";
            m_map[1060137] = "<I>The banker smiles at you and greets you in a loud and robust voice...</I><BR><BR>Well hello there adventurer! I see you've learned how to cash checks. Wonderful! Let me tell you a bit about the banks in this world...<BR><BR>Anything that you place into any bank box, can be retrieved from any other bank box in the land. For instance, if you place an item into a bank box in Britain, it can be retrieved from your bank box in Moonglow or any other city.<BR><BR> Bank boxes are very secure. So secure, in fact, that no one can ever get into your bank box except for yourself. Security is hard to come by these days, but you can trust in the banking system of Britannia! We shall not let you down! <BR><BR>I hope to be seeing much more of you as your riches grow! May your bank box overflow with the spoils of your adventures.<BR><BR>Farewell adventurer, you are now free to explore the world on your own.";
            m_map[1060138] = "<I>In case you change your mind later...</I><BR><BR>You may re-start this quest at any time, simply by returning to Mardoth's home and speaking with him using his context menu.<BR><BR>";
            m_map[1060139] = "You have made my work easy for me, ~1_NAME~.  My task here is done.";
