            m_map[1060187] = "You have arrived in the Vault of Secrets. You can feel the protective magic in this place restricting you, making you feel nearly claustrophobic.<BR><BR>Just ahead of you and out of your reach, you see a collection of scrolls and books, one of them being entitled 'Scroll of Abraxus' . You can only assume that this scroll holds the current password required to enter the Crystal Cave.";
            m_map[1060188] = "The wicked may not enter!";
