            m_map[1060196] = "<a href=";
            m_map[1060197] = "You are not dead, and thus cannot be resurrected!";
            m_map[1060198] = "May your wealth bring blessings to those in need, if tithed upon this most sacred site.";
            m_map[1060199] = "Double click your Horde Minion to open his pack and retrieve the Scroll of Abraxus that he looted for you.";
            m_map[1060200] = "You have already performed the Krouns calling.";
            m_map[1060201] = "Victory!";
            m_map[1060202] = "*Bleeding*";
            m_map[1060203] = "You have had ~1_HEALED_AMOUNT~ hit points of damage healed.";
            m_map[1060204] = "You cannot poison that! You can only poison infectious weapons, food or drink.";
            m_map[1060205] = "You cannot poison that! You can only poison infectious weapons.";
            m_map[1060206] = "The Inquisitor's Resolution";
            m_map[1060207] = "Titan's Hammer";
            m_map[1060208] = "You are no longer mortally wounded.";
            m_map[1060209] = "<I>Uzeraan greets you as you approach...</I><BR><BR>Greetings traveler!<BR><BR>I am Uzeraan, the lord of this house and overseer of this fine city, Haven.  I know we have just met, but time is short and we need to reinforce the troops in the mountain pass, so I will not waste your time with pleasantries.<BR><BR>We have been trying to fight back the wicked <I>Horde Minions</I> which have recently begun attacking our cities - but to no avail.  We desperately need help!<BR><BR>Your first task will be to assess the situation in the mountain pass, and help our troops defeat the Horde Minions there.<BR><BR>Before I send you into battle however, it is time that I teach you a thing or two about the way of the Paladin.<BR><BR><U>The Paladin</U><BR><BR>Paladins are the holy warriors of the realm who have dedicated themselves as protectors of the virtues and vanquishers of all that is evil.<BR><BR>Paladins have several <a href = ";
            m_map[1060210] = "<U>The Paladin</U><BR><BR>Paladins are the holy warriors of the realm who have dedicated themselves as protectors of the virtues and vanquishers of all that is evil.<BR><BR>Paladins have several special abilities that are not available to the ordinary warrior.  Due to the spiritual nature of these abilities, the Paladin requires some amount of mana to activate them.  In addition to mana, the Paladin is also required to spend a certain amount of <a href = ";
            m_map[1060211] = "<I>Cleanse by Fire</I> is the basic Cure ability for the Paladin.  The Paladin uses the Cleanse by Fire ability to neutralize any poisons from a target.  When he does this, he takes an amount of fire damage based on a combination of his Karma and Chivalry levels.  The lower the Paladin's Karma, the higher the fire damage.  The higher the Paladin's Chivalry skill is, the lower the amount of fire damage taken.";
            m_map[1060212] = "<I>Close Wounds</I> is the basic healing ability for a Paladin.  Using this ability, allows the Paladin to target another player or creature for divine healing.  The amount of Hit Points healed depends on the Paladin�s level of Karma and their skill in Chivalry.  A lower level of Karma lowers the amount of healing but a higher skill level in Chivalry will raise the amount.";
            m_map[1060213] = "The <I>Consecrate Weapon</I> ability allows the Paladin to temporarily imbue the weapon he is holding with holy magic.<BR><BR> The result is a weapon that deals damage of a type equal to the target�s worst resistance.  In other words,  if a consecrated weapon attacks a Fire Elemental, whose worst resistance is to cold, each hit with the Consecrated Weapon will deal cold damage to that fire elemental.<BR><BR>The duration of the effect is based off of the Paladin's level of Karma and Chivalry skill.  Lower Karma will shorten the effect, but higher Chivalry skill will lengthen the effect.";
            m_map[1060214] = "The <I>Dispel Evil</I> Paladin ability affects a small area around the Paladin.  Any evil creatures that come into the affected area may be destroyed or repelled, causing them to flee from combat.  This ability targets evil summoned creatures as well as non-summoned evil creatures.<BR><BR><I>Dispel Evil</I> can also target player Necromancers that are under effect of the <I>Wraith Form</I> spell.   The ability will cause transformed Necromancers to suffer some amount of Mana and Stamina loss.<BR><BR>The chance for successful use of this ability is modified by the Paladin's level of Karma and Chivalry skill.  While lower Karma will decrease the effectiveness of this ability, higher skill in Chivalry will increase it's effectiveness.";
            m_map[1060215] = "The Paladin�s <I>Divine Fury</I> ability allows him to wage a raging battle against the forces of evil, causing him to swing faster, hit better, and do more damage.  While under the effect of this Holy Fury, the Paladin's ability to defend himself is severely lowered.<BR><BR>In order to commit himself to the proper state of mind for this ability, the Paladin must be at full mana.";
            m_map[1060216] = "Your shot was successful";
            m_map[1060217] = "The <I>Enemy of One</I> Paladin ability causes the <I>next</I> creature the Paladin strikes to become his �mortal enemy�.  For the duration of the effect, whenever the Paladin strikes a creature that is his sworn �mortal enemy�, his damage is greatly increased.<BR><BR>Because the Paladin is so completely focused on a specific enemy type, however, all other creature types will have their damage against the Paladin increased when they strike him.";
            m_map[1060218] = "The Paladin�s <I>Holy Light</I> ability is the only direct-damage ability that the Paladin possesses.  Calling on the powers of his faith, he may call forth a magnificent beacon of holy light which damages all enemies in a small radius around the caster.";
            m_map[1060219] = "The Paladin�s <I>Noble Sacrifice</I> ability allows him to sacrifice himself for the greater good of those in the area.  When the ability is used, the Paladin is taken down to one (1) Hit Point, one (1) Stamina, and one (1) Mana.<BR><BR>In response to the Paladin's sacrifice, all of the dead in the affected area are offered resurrection, while all of the living are Cured and Healed.";
            m_map[1060220] = "The Paladin�s <I>Remove Curse</I> ability allows him to remove all <I>Curse</I> type effects from a single target.  Curses include all Necromancer curses, as well as the spells Feeblemind, Clumsy, Weaken, and Paralyze.";
            m_map[1060221] = "The Paladin ability <I>Sacred Journey</I> mimics the mage spell of <I>Recall</I> almost exactly, in that it allows a Paladin to instantly travel to any location for which he has a marked recall rune.<BR><BR>The Paladin cannot take a <I>Sacred Journey</I> if he is targeting or is being targeted by any creature, or is in combat. ";
            m_map[1060222] = "Tithing points are gained by tithing gold to the Virtue Shrines.  A Paladin who tithes gold to the shrine is making manifest his devotion to the concepts and beliefs that the Shrines exemplify.<BR><BR>Once gained through an act of tithing, these 'points' may be used by the Paladin to summon the divine abilities granted to his class.<BR><BR>Each use of a Paladin Ability consumes Tithing Points in addition to the pure energy of Mana.";
            m_map[1060223] = "Players may tithe gold to the Virtue Shrines by opening the context sensitive menu interface on the shrine's Ankh.  There they may choose the <a href=";
            m_map[1060224] = "The Paladin has many special abilities he can call forth through the use of his <I>Book of Chivalry</I>.<BR><BR>The Book Of Chivalry can be thought of as the Paladin's spell book.  To use an ability, simply open the Book of Chivalry to the appropriate page and double click the icon of the ability you wish to activate<BR><BR>The following abilities are available to the Paladin at various points of his development:<BR><BR>* Cleanse by Fire<BR>* Close Wounds<BR>* Consecreate Weapon<BR>* Dispel Evil<BR>* Divine Fury<BR>* Enemy of One<BR>* Holy Light<BR>* Noble Sacrifice<BR>* Remove Curse<BR>* Sacred Journey";
            m_map[1060225] = "Paladins are the holy warriors of the realm who have dedicated themselves as protectors of the virtues and vanquishers of all that is evil.<BR><BR>Paladins have several special abilities that are not available to the ordinary warrior. Due to the spiritual nature of these abilities, the Paladin requires some amount of mana to activate them. In addition to mana, the Paladin is also required to spend a certain amount of tithing points each time a special ability is used.<BR><BR>Tithing points and mana are automatically consumed when a special Paladin ability is activated. All Paladin abilities are activated through the <I>Book of Chivalry</I>";
            m_map[1060226] = "Why, would you say, have you chosen not to take this Ultima Online tutorial quest?";
