            m_map[1060749] = "<I>Schmendrick barely pays you any attention as you approach him. His mind seems to be occupied with something else. You explain to him that you came for the scroll of power and after a long while he begins to speak, but apparently still not giving you his full attention...</I><BR><BR>Hmmm.. peculiar indeed. Very strange activity here indeed... I wonder...<BR><BR>Hmmm. Oh yes! Scroll, you say? I don't have it, sorry. My apprentice was carrying it, and he ran off to somewhere in this cave. Find him and you will find the scroll.<BR><BR>Be sure to bring the scroll to Uzeraan once you have it. He's the only person aside from myself who can read the ancient markings on the scroll. I need to figure out what's going on down here before I can leave. Strange activity indeed...<BR><BR>One more thing...<BR><BR>Be careful of the restless souls wandering about. They seem to be in the habit of spontaneously attacking people.  Perhaps using your paladin ability <a href=";
