            m_map[1061333] = "Temporarily causes the Target to become invisible.";
            m_map[1061334] = "Binds a rune to the Caster�s current Location.  The Mage�s Recall spell and the Paladin�s Sacred Journey ability can both be used on the rune to teleport the Caster to the location of binding.";
            m_map[1061335] = "Casts the Curse spell on a Target, and any creatures within a two tile radius.";
            m_map[1061336] = "Conjures a field of paralyzing energy that affects any creature that enters it with the effects of the Paralyze spell.";
            m_map[1061337] = "Reveals the presence of any invisible or hiding creatures or players within a radius around the targeted tile.";
            m_map[1061338] = "Damages nearby targets with a series of lightning bolts that deal Energy damage.";
            m_map[1061339] = "Conjures a temporary field of energy on the ground at the Target Location that blocks all movement.";
            m_map[1061340] = "Envelopes the target in a column of magical flame the deals Fire damage.";
            m_map[1061341] = "Targeting a rune marked with the Mark spell opens a temporary portal to the rune�s marked location.  The portal can be used by anyone to travel to that location.";
            m_map[1061342] = "Drains mana from the Target and transfers it to the Caster. The amount of mana drained is determined by a comparison between the Caster�s Evaluate Intelligence skill and the Target�s Resisting Spells skill";
            m_map[1061343] = "Attempts to dispel any summoned creature within an eight tile radius.";
            m_map[1061344] = "Summons a swarm of fiery meteors that strike all targets within a radius around the Target Location.  The total Fire damage dealt is split between all Targets of the spell.";
            m_map[1061345] = "Temporarily transforms the Caster into a creature selected from a specified list.  While polymorphed, other players will see the Caster as a criminal.";
            m_map[1061346] = "Causes a violent shaking of the earth that damages all nearby creatures and characters.";
            m_map[1061347] = "Summons a spinning mass of energy that selects a Target to attack based off of its intelligence and proximity.  The Energy Vortex disappears after a set amount of time. Requires 1 pet control slot.";
            m_map[1061348] = "Resurrects a player�s ghost.  Cannot be used on NPCs or monsters.";
            m_map[1061349] = "An air elemental is summoned to serve the Caster. Requires 2 pet control slots.";
            m_map[1061350] = "A daemon is summoned to serve the Caster. Results in a large Karma loss for the Caster. Requires 5 pet control slots.";
            m_map[1061351] = "An earth elemental is summoned to serve the caster. Requires 2 pet control slots";
            m_map[1061352] = "A fire elemental is summoned to serve the caster. Requires 4 pet control slots.";
            m_map[1061353] = "A water elemental is summoned to serve the caster. Requires 3 pet control slots.";
            m_map[1061390] = "Animates the Targeted corpse, creating a mindless, wandering undead.  The strength of the risen undead is greatly modified by the Fame of the original creature.";
            m_map[1061391] = "Temporarily creates a dark pact between the Caster and the Target.  Any damage dealt by the Target to the Caster is increased, but the Target receives the same amount of damage.";
            m_map[1061392] = "Transmogrifies the flesh of the Target creature or player to resemble rotted corpse flesh, making them more vulnerable to Fire and Poison damage, but increasing their Resistance to Physical and Cold damage.";
            m_map[1061393] = "Temporarily imbues a weapon with a life draining effect.";
            m_map[1061394] = "Curses the Target so that the next harmful event that affects them is magnified.";
            m_map[1061395] = "Transforms the Caster into a horrific demonic beast, which deals more damage, and recovers hit points faster, but can no longer cast any spells except for Necromancer Transformation spells.  Caster remains in this form until they recast the Horrific Beast spell.";
            m_map[1061396] = "Transforms the Caster into a lich, increasing their mana regeneration and some Resistances, while lowering their Fire Resist and slowly sapping their life.  Caster remains in this form until they recast the Lich Form spell.";
            m_map[1061397] = "Attempts to place a curse on the Target that increases the mana cost of any spells they cast, for a duration based off a comparison between the Caster�s Spirit Speak skill and the Target�s Resisting Spells skill.";
            m_map[1061398] = "Temporarily causes intense physical pain to the Target, dealing Direct damage.  Once the spell wears off, if the Target is still alive, some of the Hit Points lost through the Pain Spike are restored.";
            m_map[1061399] = "Creates a blast of poisonous energy centered on the Target.  The main Target is inflicted with a large amount of Poison damage, and all valid Targets in a radius around the main Target are inflicted with a lesser effect.";
            m_map[1061400] = "Temporarily chokes off the air supply of the Target with poisonous fumes.  The Target is inflicted with Poison damage over time. The amount of damage dealt each �hit� is based off of the Caster�s Spirit Speak skill and the Target�s current Stamina.";
            m_map[1061401] = "Allows the Caster to summon a Familiar from a selected list. A Familiar will follow and fight with its owner, in addition to granting unique bonuses to the Caster, dependent upon the type of Familiar summoned.";
            m_map[1061402] = "Transforms the Caster into a powerful Vampire, which increases his Stamina and Mana regeneration while lowering his Fire Resistance.  Vampires also perform Life Drain when striking their enemies. Caster remains in this form until they recast the Vampiric Embrace spell.";
            m_map[1061403] = "Summons a vile Spirit which haunts the Target until either the Target or the Spirit is dead.  Vengeful Spirits have the ability to track down their Targets wherever they may travel.  A Spirit�s strength is determined by the Necromancy and Spirit Speak skills of the Caster.";
            m_map[1061404] = "Creates a withering frost around the Caster, which deals Cold Damage to all valid targets in a radius.";
            m_map[1061405] = "Transforms the Caster into an ethereal Wraith, lowering some Elemental Resists, while increasing their Physical resist.  Wraith Form also allows the caster to always succeed when using the Recall spell, and causes a Mana Drain effect when hitting enemies. Caster remains in this form until they recast the Wraith Form spell.";
            m_map[1061490] = "Cures the target of poisons, but causes the caster to be burned by fire damage. The amount of fire damage is lessened if the caster has high Karma.";
            m_map[1061491] = "Heals the target of damage.  The caster�s Karma affects the amount of damage healed.";
            m_map[1061492] = "Temporarily enchants the weapon the caster is currently wielding.  The type of damage the weapon inflicts when hitting a target will be converted to the target�s worst Resistance type. Duration of the effect is affected by the caster�s Karma.";
            m_map[1061493] = "Attempts to dispel evil summoned creatures and cause other evil creatures to flee from combat.  Transformed Necromancers may also take Stamina and Mana Damage.  Caster�s Karma and Chivalry, and Target�s Fame or Necromancy affect Dispel chance.";
            m_map[1061494] = "Temporarily increases the Paladin�s swing speed, chance to hit, and damage dealt, while lowering the Paladin�s defenses.  Upon casting, the Paladin�s Stamina is also refreshed. Duration of the spell is affected by Caster�s Karma.";
            m_map[1061495] = "The next target hit becomes the Paladin�s Mortal Enemy.  All damage dealt to that exact creature type is increased, but the Paladin takes extra damage from all other creature types. Mortal Enemy creature types will highlight Orange to the Paladin.  Duration of the spell is affected by the Caster�s Karma.";
            m_map[1061496] = "Deals energy damage to all valid targets in a radius around the caster. Amount of damage dealt is affected by Caster�s Karma.";
            m_map[1061497] = "Attempts to Resurrect, Cure, and Heal all targets in a radius around the caster. If any target is successfully assisted, the Paladin�s current Hit Points, Mana, and Stamina are greatly reduced.  Amount of damage healed is affected by the Caster�s Karma.";
            m_map[1061498] = "Attempts to remove all Curse effects from Target. Curses include Mage spells such as Clumsy, Weaken, Feeblemind, and Paralyze, as well as all Necromancer curses. Chance of removing curse is affected by the Caster�s Karma.";
            m_map[1061499] = "Targeting a rune or ship key allows the caster to teleport to the marked location.  Caster may not flee from combat in this manner.";
