            m_map[1061653] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to put your Broadsword into your hand; to do this, you click and hold your left mouse button on the Broadsword, drag the sword onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
