            m_map[1061656] = "<BODY><BASEFONT COLOR=#DFDFC0>To cast this spell, you'll double click the words, <BASEFONT COLOR=#FFFFFF>Pain Spike<BASEFONT COLOR=#DFDFC0>, in your spellbook, and then left click on the mongbat with the targeting cursor. Repeat this until you've defeated the mongbat.</BASEFONT></BODY>";
            m_map[1061657] = "You study the item in an attempt to learn more of its craftsmanship and use.";
            m_map[1061658] = "<BODY><BASEFONT COLOR=#DFDFC0>Skip this Quest and go to Umbra</BASEFONT></BODY>";
            m_map[1061659] = "<BODY><BASEFONT COLOR=#DFDFC0>To leave this area, take the stairs in the corner to the central chamber. Then ascend up the stairs in the middle of that chamber. This will take you to the city of Umbra where you'll meet Mardoth. He'll be waiting to speak with you.</BASEFONT></BODY>";
            m_map[1061660] = "<BODY><BASEFONT COLOR=#DFDFC0>Oh, and... I beg of you... please don't tell Mardoth I lost your gold. Please!!</BASEFONT></BODY>";
