            m_map[1061662] = "Animate Dead";
            m_map[1061663] = "The Animate Dead spell allows the Necromancer to animate the corpses of dead creatures, creating mindless, wandering undead.<BR><BR>The type of undead created from this spell is dependent on both the Necromancer's skill in Spirit Speak and Necromancy, as well as the type of creature and its fame when it was alive.";
            m_map[1061664] = "Summon Familiar";
            m_map[1061665] = "This spell summons an evil familiar to the caster's side.<BR><BR>The caster may only have 1 familiar at a time, and they count towards a player's Follower limit. When a caster has summoned a particular type of familiar, the caster gains some special abilities:<BR><BR>- Horde Minion<BR>- Shadow Wisp<BR>- Dark Wolf<BR>- Death Adder<BR>- Vampire Bat<BR><BR>";
            m_map[1061666] = "Book of Chivalry";
            m_map[1061667] = "The Book of Chivalry, used by Paladins, is akin to the mage's spellbook.  Within the Book of Chivalry are icons used to activate the Paladin's special abilities.  In addition, the Paladin can also inspect the requirements and effects of each ability within the Book of Chivalry.<BR><BR>Books of Chivalry can be <a href = ";
            m_map[1061668] = "Sacred Journey";
            m_map[1061669] = "The Paladin ability Sacred Journey mimics the effect of the mage spell of <a href = ";
            m_map[1061670] = "Close Wounds";
            m_map[1061671] = "<I>Close Wounds<I> is the basic healing spell for a Paladin.  The Paladin uses the ability and then targets the creature he wishes to Heal.  The amount of Hit Points healed depends on the paladin�s <a href = ";
            m_map[1061672] = "If you release your familiar, everything in its backpack will be destroyed!  Are you sure you want to release your familiar?";
            m_map[1061673] = "You have too many followers to summon a familiar.";
            m_map[1061674] = "The Necromancer";
            m_map[1061675] = "Necromancers are those who have dedicated their lives to bring death, decay and destruction to Britannia by drawing on the powers of death itself.<BR><BR>Those who wield the power of death have at their disposal an impressive array of spells that aims to bring a gruesome and horrific end to anything that comes between the Necromancer and complete power.<BR><BR>In addition, Necromancers also make excellent melee warriors since any necromantic spell can be cast whilst wielding a weapon (unlike spells of conventional magery).";
            m_map[1061676] = "Blood Oath";
            m_map[1061677] = "Spells of Necromancy";
            m_map[1061678] = "The spells of Necromancy may be cast by those who have sufficient skill in Necromancy.  All necromantic spells have a mana and <a href = ";
            m_map[1061679] = "Spirit Speak";
            m_map[1061680] = "The Spirit Speak skill is used to heal yourself by channeling spiritual energy.  Spiritual energy may be channeled from either a corpse or the person using the skill.  If a corpse is not available, then the user will channel their own energy, effectively trading mana for hit points.<BR><BR>The amount of damage healed depends on the amount of residual spirit energy that still lies within the corpse.";
