            m_map[1061692] = "If you are leaving the tower, you should learn about the Radar Map.<BR><BR>The Radar Map (or Overhead View) can be opened by pressing 'ALT-R' on your keyboard. It shows your immediate surroundings from a bird's eye view.<BR><BR>Pressing ALT-R twice, will enlarge the Radar Map a little. Use the Radar Map often as you travel throughout the world to familiarize yourself with your surroundings.";
            m_map[1061693] = "Ignores the Target�s Resists but deals slightly lower damage than the weapon's maximum potential.";
