            m_map[1062083] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to put your Bone Harvester into your hand; to do this, you click and hold your left mouse button on the Bone Harvester, drag the Bone Harvester onto your paperdoll, and then release.</BASEFONT></BODY>";
