            m_map[1062085] = "House placement features are currently unavailable.  You can test house placement right now but you cannot place a permanent house.  If you wish to place a permanent house, please wait a few minutes and try again.";
            m_map[1062086] = "Another player is attempting to initiate a house trade with you.  In order for you to see this window, both you and the other person are standing within two paces of the house to be traded.  If you click OKAY below, a house trade scroll will appear in your trade window and you can complete the transaction.  This scroll is a distinctive blue color and will show the name of the house, the name of the owner of that house, and the sextant coordinates of the center of the house when you hover your mouse over it.  In order for the transaction to be successful, you both must accept the trade and you both must remain within two paces of the house sign.<BR><BR>Accepting this house in trade will <a href = ";
