            m_map[1062115] = "Housing";
            m_map[1062116] = "This topic covers the basics of housing in UO, from placement to trading to customization.  Please see Related Topics above for more information.";
            m_map[1062117] = "HOUSE PLACEMENT";
            m_map[1062118] = "You can create a house by using a <B>house placement tool</B>.  This device can be purchased from an Architect NPC in many towns across the land.  The tool itself is inexpensive, but in order to place a house you will need to have sufficient funds in your bank box to pay for it.  In addition to the tool and funds, you must also have an open spot of land outside of town that is level and free of obstructions.  If you have found such a spot, then double-click your House Placement Tool and choose the type of house to place from the menu.  Next, you will see a ghosted image of the selected house on your targeting cursor.  Position the ghosted house and click to try to place it.  If placement fails, you will be notified as to the reason, and you can try again.  There are several important rules about house placement, which are detailed in the paragraphs following: <a href = ";
            m_map[1062119] = "LOCATIONS";
            m_map[1062120] = "<B>Locations:</B>  <a href = ";
            m_map[1062121] = "TERRAIN";
            m_map[1062122] = "<B>Terrain:</B>  Houses can only be <a href = ";
            m_map[1062123] = "OTHER HOUSES";
            m_map[1062124] = "<B>Other Houses:</B>  When <a href = ";
            m_map[1062125] = "OWNERSHIP RESTRICTIONS";
            m_map[1062126] = "<B>Ownership Restrictions:  </B>You may only <a href = ";
            m_map[1062127] = "HOUSE TRADING";
            m_map[1062128] = "You can buy a house from another player or sell a house to another player, using the standard Trade Window.  It is not possible to exchange houses this way.  In order to have a house traded to you, you must meet all house <a href = ";
            m_map[1062129] = "HOUSE CONVERSION";
            m_map[1062130] = "If you have a static non-customizable house, it may be possible to convert it into a <a href = ";
            m_map[1062131] = "HOUSE RESTRICTIONS";
            m_map[1062132] = "You are limited to owning one house on your account across all shards.  If you own a house on one shard, you cannot own a house on another shard.  If at any time you place a new house or receive a house in trade, your house will become condemned.  A condemned house will decay within 5 days.  The only way to un-condemn a house is to trade it to another player.  If you trade away your new house, this will <B>not</B> un-condemn your other house.<BR><BR>Whenever you place a house or receive on in trade with another player, you may not place another house or receive another house in trade for seven days, even if you demolish the house or trade it to another player.<BR><BR>In order to own a <a href = ";
            m_map[1062133] = "HOUSE CUSTOMIZATION";
            m_map[1062134] = "Customizable houses have two modes: <a href = ";
