            m_map[1062171] = "TRANSPARENCY SELECTION";
            m_map[1062172] = "These controls allow you to change the visibility of walls and floors on different stories of the house, to make it easer to design around them.  Each of the buttons in this column correspond to one story of your house.  Each time you click the button, transparency settings move to the next setting in the cycle.  When you <a href = ";
            m_map[1062173] = "STORY SELECTION";
            m_map[1062174] = "To edit a different story of your house, use the buttons in the rightmost column on your house customization interface.  Each button corresponds to one story of your house.  Simply click a button to be transported to that story.  When you do this, <a href = ";
            m_map[1062175] = "STRUCTURAL SUPPORT";
            m_map[1062176] = "Your custom house design must (to a certain degree) obey the laws of physics.  This means that you can't have floors floating on air and hovering columns.  Every <a href = ";
            m_map[1062177] = "SAVING A DESIGN";
            m_map[1062178] = "If you are not ready to <a href = ";
            m_map[1062179] = "COMMITTING A NEW HOUSE DESIGN";
            m_map[1062180] = "Once you are completed re-designing your house, you are ready to commit the design.  In order to do so, you must have funds in your bank (in the form of gold and/or checks) to cover the <a href = ";
            m_map[1062181] = "HOUSE VALUE";
            m_map[1062182] = "Non-customizable houses have fixed costs.  The cost to place each house type is displayed on the house placement tool menu.  If you demolish a non-customizable house or covert it into a customizable one, you are refunded 90% of this amount (also referred to as the house value).";
            m_map[1062183] = "CUSTOMIZATION COSTS";
            m_map[1062184] = "The cost to commit a house design is based on the number of components in the house, including the foundation itself.  The current cost of a house is displayed in the lower-right corner of the house design menu.  When committing a new design, you are refunded 90% of the value of the old design and must pay the cost displayed.";
            m_map[1062185] = "NORMAL MODE";
            m_map[1062186] = "In normal mode, customizable houses behave just like any other house -- you can walk around on them or in them, store objects inside, and so forth.  See also:  <a href = ";
            m_map[1062187] = "CUSTOMIZATION MODE";
            m_map[1062188] = "In Customization Mode, all access to the house is blocked except to the person customizing the house.  In this mode, all other players see the house as it was prior to entering customization mode, but hey cannot enter it or interact with it in any way.  The player actually customizing the house, however, can see and edit a new in-progress design.  When you are customizing a house, you are invisible and safe from attack.  You can walk through the walls of your house and walk on air without falling.  This allows you to change your house design conveniently and in perfect safety.  Note, however, that you cannot do anything else at all in this mode.  While customizing your house, you cannot open your backpack, use any objects, use any skills, speak to other players, or leave the house.  It is much like being a ghost.  See also: <a href = ";
            m_map[1062189] = "MOVING CRATE";
            m_map[1062190] = "The house moving crate is a special container that holds your locked down items, secure containers, vendors, barkeepers, and house add-ons while you edit your house.  When you enter <a href = ";
            m_map[1062191] = "UNPACKING";
            m_map[1062192] = "When you <a href = ";
            m_map[1062193] = "UNPACKING VENDORS AND BARKEEPS";
            m_map[1062194] = "Vendors and barkeepers are invisible when they are inside a <a href = ";
            m_map[1062195] = "personal bless deed for ~1_NAME~";
            m_map[1062196] = "HOUSE CUSTOMIZATION";
            m_map[1062197] = "This feature allows you to create a truly unique home by laying out the floor plan and choosing building materials for the walls, floors, and other components.  In order to build or own a custom house, your account must be upgraded to <I>Ultima Online: Age of Shadows</I>.  Not all houses are customizable.  In order to build your own house, you need to obtain a customizable <a href = ";
            m_map[1062198] = "DIRT LOTS";
            m_map[1062199] = "Dirt lots are a special type of house that can be <a href = ";
            m_map[1062200] = "A personal bless deed has been placed in your backpack.";
            m_map[1062201] = "Only the owner, ~1_NAME~, can use this deed.";
            m_map[1062202] = "This deed allows you to bless an item.  The blessed item cannot be stolen from this character, and will remain with this character when death occurs.  The blessed effects of the item WILL NOT work for any other character, including other characters on your account.";
            m_map[1062203] = "Blessed for ~1_NAME~";
            m_map[1062204] = "You personally bless the item for this character.";
            m_map[1062205] = "Unfortunately you are playing on a *NON-Age-Of-Shadows* game installation and cannot be transported to Malas.  You will not be able to take your new player quest in Malas without an AOS client.  You are now being taken to the city of Haven on the Trammel facet.";
