            m_map[1062914] = "In the second age of Britannia, the peaceful town of Trinsic was attacked by the forces of chaos. After a fierce, bloody battle, the town was overrun and destroyed. This rose commemorates the Honor of the Trinsic defenders.";
            m_map[1062915] = "Shamino�s Best Crossbow";
            m_map[1062916] = "Once a king of Sosaria, Shamino was one of Lord British�s greatest Companions. Hailing from the city of Skara Brae, known for its spiritual people, Shamino followed the life of a ranger and was perhaps the best marksman in the land. This crossbow design is one created especially for him by Iolo, his long-time companion.";
            m_map[1062917] = "The Tapestry of Sosaria";
            m_map[1062918] = "The history of the world is recorded in this tapestry, starting with the first days of Britannia to Third Dawn�s age of prosperity and opportunity. It was designed by one of Lord British�s most loyal companions, Iolo, a master bard and storyteller.";
            m_map[1062919] = "Hearth of the Home Fire";
            m_map[1062920] = "When Lord Blackthorn waged a dark campaign to steal control of Britannia, the citizens often stayed home at night, not daring to leave their homes. The good people of Britannia spent those cold nights huddled around the warmth of a blazing fireplace like this one.";
            m_map[1062921] = "The Holy Sword";
            m_map[1062922] = "The fifth age, known as the Age of Shadows, was a difficult one. Necromancers had learned to raise the dead from their graves, and holy Paladins joined ranks to wipe the dark art of Necromancy from the world. It is a struggle that still continues. Paladins, thanks to a blacksmith with arcane knowledge, now have the Holy Sword to help in their quest.";
            m_map[1062923] = "Ancient Samurai Helm";
            m_map[1062924] = "Strange items from a strange land are being found. Rumors abound of a new land with new warriors and new ways to wage war. If the rumors are true, Britannia might never be the same. This strange helm was brought back on a trade vessel. Its exotic beauty pales in the face of its durability.";
            m_map[1062925] = "Petals:  ~1_COUNT~";
            m_map[1062926] = "Petal of the Rose of Trinsic";
            m_map[1062927] = "You have eaten one of these recently and eating another would provide no benefit.";
