            m_map[1063022] = "Haochi's Trials";
            m_map[1063023] = "<i>As you enter the courtyard you notice a faded sign. It reads: </i><br><br>Welcome to your new home, Samurai.<br><br> Though your skills are only a shadow of what they can be some day, you must prove your adherence to the code of the Bushido.<br><br>Seek Daimyo Haochi for guidance.<br><br><i>Will you accept the challenge?</i>";
            m_map[1063024] = "You cannot perform this special move right now.";
            m_map[1063025] = "<i>Alliance</i>";
            m_map[1063026] = "Speak to Daimyo Haochi.";
            m_map[1063027] = "<div align=center>You have challenged this guild to war!</div>";
            m_map[1063028] = "<I>In case you change your mind later...</I><BR><BR>You may re-start this quest at any time while you are here. Simply return to Daimyo Haochi and speak with him. Once you travel to the city, you will not be able to return. <BR><BR>";
            m_map[1063029] = "Greetings. I am Daimyo Haochi, the Feudal Lord of this region. <BR><BR>Since you are here at my side, you must wish to learn the ways of the Samurai.<BR><BR> Wielding a blade is easy, anyone can grasp a sword�s hilt. Learning how to fight properly and skillfully is to become an Armsman.<BR><BR> Learning how to master weapons, and even more importantly when not to use them, is the Way of the Warrior. The Way of the Samurai. The Code of the Bushido. That is why you are here. <BR><BR>You will go through 7 trials to prove your adherence to the Samurai code. <BR><BR> The first trial will test your decision making skills. You only have to enter the area beyond the green passageway. <BR><BR>Do not attempt to hurry your trials. The guards will only let you through to each trial when I have deemed you ready.<br><br>As a last resort you may use the golden teleporter tiles in each trial area but do so at your own risk. You may not be able to return and complete your trials once you have chosen to escape.";
            m_map[1063030] = "Follow the green path. The guards will now let you through.";
            m_map[1063031] = "Beyond you are two troubled groups.<BR><BR> The Cursed Souls were once proud warriors that were ensorcelled by an evil mage. The mage trapped and killed them later but the spell has not lifted from their souls in death. <BR><BR>The Young Ronin were former Samurai in training who lost their way. They are loyal only to those with enough coin in their pocket. <BR><BR>You must decide who needs to be fought to the death. You may wish to <a href=";
            m_map[1063032] = "Kill 3 Young Ronin or 3 Cursed Souls. Return to Daimyo Haochi when you have finished.";
            m_map[1063033] = "To view the surrounding area, you should learn about the Radar Map.<BR><BR>The Radar Map (or Overhead View) can be opened by pressing 'ALT-R' on your keyboard. It shows your immediate surroundings from a bird's eye view.<BR><BR>Pressing ALT-R twice, will enlarge the Radar Map a little. Use the Radar Map often as you travel throughout the world to familiarize yourself with your surroundings.";
            m_map[1063034] = "You are already in a guild!";
            m_map[1063035] = "Abbreviation:";
            m_map[1063036] = "A guild name cannot be more than ~1_val~ characters in length.";
            m_map[1063037] = "An abbreviation cannot exceed ~1_val~ characters in length.";
            m_map[1063038] = "Cursed Souls killed:  ~1_COUNT~";
            m_map[1063039] = "Young Ronin killed:  ~1_COUNT~";
            m_map[1063040] = "You have just gained some <a href=";
            m_map[1063041] = "You have just gained some <a href=";
            m_map[1063042] = "Continue slaying the Cursed Souls!";
            m_map[1063043] = "Continue slaying the Young Ronin!";
            m_map[1063044] = "The first trial is complete. Return to Daimyo Haochi.";
            m_map[1063045] = "It is good that you rid the land of the Cursed Souls so they can be at peace in death. They had been cursed for doing what they thought was an honorable deed. Now they can have respect in their death.<BR><BR> I have placed a reward in your pack. <BR><BR>The second trial will test your courage. You only have to follow the yellow path to see what awaits you.";
            m_map[1063046] = "It is good that you rid the land of those dishonorable Samurai. Perhaps they will learn a greater lesson in death.<BR><BR> I have placed a reward in your pack.<BR><BR> The second trial will test your courage. You only have to follow the yellow path to see what awaits you.";
            m_map[1063047] = "Follow the yellow path. The guards will now let you through.";
            m_map[1063048] = "Whom do you wish to invite into your guild?";
            m_map[1063049] = "~1_val~ is not accepting guild invitations.";
            m_map[1063050] = "~1_val~ is already a member of your guild!";
            m_map[1063051] = "~1_val~ is already a member of a guild.";
            m_map[1063052] = "~1_val~ is currently considering another guild invitation.";
            m_map[1063053] = "You invite ~1_val~ to join your guild.";
            m_map[1063054] = "You fail to join.";
            m_map[1063055] = "You are now ignoring guild invitations.";
            m_map[1063056] = "You have joined ~1_val~.";
            m_map[1063057] = "Beyond the guards is a test of courage.  You must face your fear and attack a great beast. You must choose which beast to slay for there is more than one beyond the courtyard doors. <BR><BR>The imp entered the courtyard unaware of its surroundings. The dragon came knowingly, hunting for the flesh of humans � A feast for the beast. <BR><BR>You must rid the courtyard of these beasts but you may only choose one to attack. Go and choose wisely.";
            m_map[1063058] = "Choose your opponent and attack one with all your skill.";
            m_map[1063059] = "Fear remains in your eyes but you have learned that not all is what it appears to be. <BR><BR>You must have known the dragon would slay you instantly. You elected the weaker opponent though the imp did not come here to destroy. You have much to learn. <BR><BR>In these lands, death is not forever. The shrines can make you whole again as can a helpful mage or healer. <BR><BR>Seek them out when you have been mortally wounded. <BR><BR>The next trial will test your benevolence. You only have to walk the blue path.";
            m_map[1063060] = "You faced the dragon knowing it would be your certain death. That is the courage of a Samurai. <BR><BR>Your spirit speaks as a Samurai already. <BR><BR>In these lands, death is not forever. The shrines can make you whole again as can a helpful mage or healer. <BR><BR>Seek them out when you have been mortally wounded. <BR><BR>The next trial will test your benevolence. You only have to walk the blue path. ";
            m_map[1063061] = "The next trial will test your benevolence. Follow the blue path. The guards will now let you through.";
            m_map[1063062] = "A pack of wolves circle your feet. They have been injured and are in pain. A quick death will end their suffering.<br><br>Use your Honorable Execution skill or other means to finish off a wounded wolf. Do so and return to Daimyo Haochi.";
            m_map[1063063] = "Use your Honorable Execution skill to finish off the wounded wolf. Double click the icon in your Book of Bushido to activate the skill. When you are done, return to Daimyo Haochi.";
            m_map[1063064] = "Return to Daimyo Haochi.";
            m_map[1063065] = "<I>Daimyo Haochi smiles as you walk up to him. Quietly he says:</I><BR><BR> A Samurai understands the need to help others even as he wields a blade against them. <BR><BR>You have shown compassion. A true Samurai is benevolent even to an enemy. For this you have been rewarded. <BR><BR>And now you must prove yourself again. Walk the red path.  We will talk again later.";
            m_map[1063066] = "Follow the red path and pass through the guards to the entrance of the fourth trial.";
            m_map[1063067] = "<I>You approach a disheveled gypsy standing near a small shed. You sense that she has not eaten nor bathed in quite some time. <BR><BR>Around her is a large colony of mangy and diseased cats. It appears she has spent what little money she�s earned to feed the cats instead of herself. <BR><BR>You have a decision to make. You can give her gold so she can buy some food for her animals and herself. You can also remove the necessity of the extra mouths to feed so she may concentrate on saving herself.</i><br><br>If you elect to give the gypsy money, you can do so by clicking your stack of gold and selecting �1�. Then dragging it and dropping it on the Gypsy.";
            m_map[1063068] = "Give the gypsy gold or hunt one of the cats to eliminate the undue need it has placed on the gypsy.";
            m_map[1063069] = "The wolves no longer need your assistance.";
            m_map[1063070] = "You showed respect by helping another out while allowing the gypsy what little dignity she has left. <BR><BR>Now she will be able to feed herself and gain enough energy to walk to her camp. <BR><BR>The cats are her family members� cursed by an evil mage. <BR><BR>Once she has enough strength to walk back to the camp, she will be able to undo the spell. <BR><BR>You have been rewarded for completing your trial. And now you must prove yourself again. <BR><BR>Please retrieve my katana from the treasure room and return it to me.";
            m_map[1063071] = "Respect comes from allowing another to make their own decisions. By denying the gypsy her animals, you negate the respect she is due. Perhaps you will have learned something to use next time a similar situation arises. <BR><BR> And now you must prove yourself again. Please retrieve my katana from the treasure room and return it to me.";
            m_map[1063072] = "Retrieve Daimyo Haochi�s katana from the treasure room.";
            m_map[1063073] = "Give the sword to Daimyo Haochi. ";
            m_map[1063074] = "What? You have returned without the sword? Go back and look for it again.";
            m_map[1063075] = "I saw you drop the sword earlier. Take care not to lose it this time.";
            m_map[1063076] = "Thank you for returning this sword to me and leaving the remaining treasure alone. <BR><BR>Your training is nearly complete. Before you have your final trial, you should pay homage to Samurai who came before you.  <BR><BR>Go into the Altar Room and light a candle for them. Afterwards, return to me.";
            m_map[1063077] = "I thank you for returning this sword. However, you should admonished for also taking treasure that was not asked for nor given back.  <BR><BR>Think about your actions youngling. <BR><BR>Your training is nearly complete. Before you have your final trial, you should pay homage to Samurai who came before you.  <BR><BR>Go into the Altar Room and light a candle for them. Afterwards, return to me.";
            m_map[1063078] = "Light one of the candles near the altar and return to Daimyo Haochi.";
            m_map[1063079] = "You have done well young Samurai. There is but one thing left to do. <BR><BR>In the final room is the holding cell containing young Ninjas who came to take my life. They were caught and placed in my custody. <BR><BR>Take care of these miscreants and show them where your loyalty lies. <BR><BR>This is your final act as a Samurai in training.";
            m_map[1063080] = "Three young Ninja must be dealt with. Your job is to kill them. When you have done so, return to Daimyo Haochi.";
            m_map[1063081] = "That creature can only be ridden by master Tamers.";
