            m_map[1063124] = "<i>Advanced Search Options</i>";
            m_map[1063125] = "You have proven yourself young one. You will continue to improve as your skills are honed with age. <BR><BR>Now it is time for you to explore the lands. Beyond this path lies Zento City, your future home.  On these grounds you will find a golden oval object known as a Moongate, step through it and you'll find yourself in Zento.<BR><BR>You may want to visit Ansella Gryen when you arrive. <BR><BR>You have learned the ways. You are an honorable warrior, a Samurai in the highest regards. <BR><BR>Please accept the gifts I have placed in your pack. You have earned them. Farewell for now.";
            m_map[1063126] = "You have proven yourself young one. You will continue to improve as your skills are honed with age. <BR><BR>Now it is time for you to explore the lands. Beyond this path lies Zento City, your future home. On these grounds you will find a golden oval object known as a Moongate, step through it and you'll find yourself in Zento.<BR><BR>You may want to visit Ansella Gryen when you arrive. <BR><BR>You have learned the ways. You are an honorable warrior, a Samurai in the highest regards. <BR><BR>Please accept the gifts I have placed in your pack. You have earned them. Farewell for now.";
