            m_map[1063167] = "You prepare to strike quickly.";
            m_map[1063168] = "You attack with lightning precision!";
            m_map[1063169] = "Your opponent's quick strike causes extra damage!";
            m_map[1063170] = "The creature you were about to swing your weapon into has perished already!";
            m_map[1063171] = "You transfer the momentum of your weapon into another enemy!";
            m_map[1063172] = "You were hit by the momentum of a Samurai's weapon!";
            m_map[1063173] = "Emino's Undertaking";
            m_map[1063174] = "Your value as a Ninja must be proven. Find Daimyo Emino and accept the test he offers.";
            m_map[1063175] = "Ah, another fledgling unfurls its wings. Welcome to my home young one. <BR><BR>I am Daimyo Emino, a passionate collector of sorts. One who is vengeful towards those impeding my reign. <BR><BR>You have the look of someone who could help me but your skills are untested. Are you willing to prove your mettle as my hireling? <BR><BR>Elite Ninja Zoel awaits you in the backyard. He will lead you to the first trial. You will be directed further when you arrive at your destination. You should speak to him before exploring the yard or cave entrance.";
            m_map[1063176] = "Find Elite Ninja Zoel immediately!";
            m_map[1063177] = "<I>Zoel studies your face as you approach him. Wryly, he says:</I><BR><BR> Daimyo Emino has sent another already? The stains from the last have not yet dried! <BR><BR>No matter, we�ll finish you off and clean it all at once, eh? <BR><BR>Now to the point, your only task is to survive in the abandoned inn.<BR><BR>You will be instructed when you need to act and when you should return to one of us. <BR><BR>Only a true Ninja is deft enough to finish and remain alive.<BR><BR>Your future... or your demise... lies in this cave beyond. <BR><BR>Now go.";
            m_map[1063178] = "Potion of Escape";
            m_map[1063179] = "Enter the cave and walk through it. You will be tested as you travel along the path.";
            m_map[1063180] = "A glowing archway stands before you. <BR><BR>To either side of its frame are mounted demon heads, breathing fire and watching your every move. <BR><BR>To pass through, you must first vanish from the demons� sight. Only then can you slowly traverse the entryway.";
            m_map[1063181] = "You�ll need to hide in order to pass through the door. <BR><BR>To find out how to use active skills, visit the <a href = ";
            m_map[1063182] = "Through the door lies a short passageway. The path ends abruptly at a strange tile on the floor.  The special tile is known as a teleporter.  Step on the teleporter tile and you will be transported to a new location.";
            m_map[1063183] = "The special tile is known as a teleporter. Step on the teleporter tile and you will be transported to a new location.";
            m_map[1063184] = "<I>Daimyo Emino smiles as you approach him:</I> <BR><BR>I see that you have survived both the first trial and Zoel�s temper. <BR><BR>For that you have been rewarded with Leggings and Gloves befitting your occupation. The material is the only armor a <b><I>True Ninja</i></b> needs. <BR><BR>You have yet to prove yourself fully, young hireling. Another trial must be met. Off to Zoel you go. Bring him this note so he knows we have spoken.";
            m_map[1063185] = "Bring the note to Elite Ninja Zoel and speak with him again. He is near the cave entrance. You can hand the note to Zoel by dragging it and dropping it on his body.";
            m_map[1063186] = "A Note for Zoel";
            m_map[1063187] = "You have lost my note? I will scribe another for you. Try not to lose this one.";
            m_map[1063188] = "You decide against dropping this important note.";
            m_map[1063189] = "<I>Zoel quickly grabs the scroll from your hand and reads the note:</i> <BR><BR>Still alive then? You�ll have to impress me further before I will give my approval of you to Daimyo Emino. <BR><BR>You must return to the inn and begin the next trial. <BR><BR>We believe an associate has, shall we say, inadvertently negated our contract. <BR><BR>Find out what information you can and return to Daimyo Emino with the news. And be careful not to lose your head.<BR><BR>The Blue Teleporter Tile in Daimyo Emino�s residence will lead you to your fate. I suggest you hurry. <BR><BR>...And take care to tread softly. There is no greater traitor than a heavy footfall upon a path.";
            m_map[1063190] = "Take the Blue Teleporter Tile from Daimyo Emino's house to the Abandoned Inn. Quietly look around to gain information.";
            m_map[1063191] = "They won�t find me here.";
            m_map[1063192] = "Ah, a quiet hideout.";
            m_map[1063193] = "I wonder if I can find a sharpening stone around here.";
            m_map[1063194] = "Who locked me in this room?";
            m_map[1063195] = "Must have been strong ale to land me in this place.";
            m_map[1063196] = "You quietly approach the door and see a woman named Jedah Entille speaking to a shady figure in dark clothing. You move closer so you can overhear the conversation. Fortunately, your entrance did not alert the preoccupied party. <BR><BR>Jedah�s brash voice permeates the air:<I><BR><BR> Now that it is hidden, we�ll hide out here until Daimyo Emino forgets about us. Once he realizes his beloved sword is missing, he�ll surely start looking for the thieves. We will be long gone by that time. </I><BR><BR>After overhearing the conversation, you understand why you were sent on this trial. You must immediately tell Daimyo Emino what you have learned.";
            m_map[1063197] = "Go back through the blue teleporter and tell Daimyo Emino what you�ve overheard.";
            m_map[1063198] = "You stand on the strange floor tile but nothing happens.";
            m_map[1063199] = "<I>Daimyo Emino frowns as you relay the information. He pauses for a moment before speaking to you:</i> <BR><BR>Jedah was once one of my most promising students, but her greed will be her downfall. <BR><BR>I will send one of my disciples to deal with her later. It is more important to get that sword back first. <BR><BR>I�m counting on you to find it. She would have kept it close to her. Take the White Teleporter, located in my backyard, and check inside boxes and chests around the treasure room of the inn and return it to me when you find it.<BR><BR>Be very careful. Jedah was an expert with traps and no doubt she�s protecting the sword with them. <BR><BR>If you find a trap, try timing it and you may be able to avoid damage. <BR><BR>I�ve provided you with several heal potions in case you become injured. <BR><BR>In the bag you will also find more clothing appropriate to your new found profession. <BR><BR>Please return the sword to me. I implore you not to take anything else that may be hidden in the Inn. <BR><BR>Thank you.";
            m_map[1063200] = "Take the white teleporter and check the chests for the sword. Leave everything else behind. Avoid damage from traps you may encounter. To use a potion, make sure at least one hand is free and double click on the bottle.";
            m_map[1063201] = "A narrow hallway greets the teleporter. The enclosed space is the perfect setting for dangerous traps. Walk through the hallway being careful to avoid the traps. You may be able to time the traps to avoid injury.";
            m_map[1063202] = "Walk through the hallway being careful to avoid the traps. You may be able to time the traps to avoid injury.";
            m_map[1063203] = "The lid of the chest refuses to budge at first, but slowly you are able to pry the lid open. <BR><BR>Inside lies the sword you have been in search of.  You quickly take the sword and stash it in your backpack.  Bring the sword back to Daimyo Emino.";
            m_map[1063204] = "Take the sword and bring it back to Daimyo Emino.";
            m_map[1063205] = "Screams echo through the chamber as you walk away from the chest. Jedah�s Henchmen have become cognizant of your presence. <BR><BR>It is time for your Ninja Spirit to come alive. Slay 3 of the Henchmen before returning to Daimyo Emino. ";
            m_map[1063206] = "Kill three henchmen.";
            m_map[1063207] = "Henchmen killed:";
            m_map[1063208] = "Continue killing the henchmen!";
            m_map[1063209] = "You have not completed your duties.";
            m_map[1063210] = "You have proven your fighting skills. Bring the Sword to Daimyo Emino immediately. Be sure to follow the path back to the teleporter.";
            m_map[1063211] = "Go to Daimyo Emino. Go back through the chamber the way you came.<BR><BR> Give Daimyo Emino the sword when you've returned to his side.";
            m_map[1063212] = "What? You have returned without the sword? You need to go back and get it again!";
            m_map[1063213] = "I saw you drop the sword earlier. Take care not to lose it this time.";
            m_map[1063214] = "Daimyo Emino�s Katana";
            m_map[1063215] = "You have proven yourself young one. You will continue to improve as your skills become honed with age. <BR><BR>Now it is time for you to explore the lands. To the right of the cave entrance you will find a luminous oval object known as a Moongate, step through it and you'll find yourself in the city of Zento, your future home.<BR><BR>You may want to visit Ansella Gryen when you arrive. <BR><BR>Thank you for returning this sword to me. For that you will be rewarded.";
            m_map[1063216] = "Beyond this path lies Zento City, your future home. To the right of the cave entrance you will find a luminous oval object known as a Moongate, step through it and you'll find yourself in Zento.<BR><BR>You may want to visit Ansella Gryen when you arrive. <BR><BR>Please accept the gifts I have placed in your pack. You have earned them. Farewell for now.";
            m_map[1063217] = "You have earned these gifts for returning the sword. For that I thank you. <BR><BR>However, your reward has been lessened by your greed in the treasure room.  Do not think I did not notice your full pockets.";
            m_map[1063218] = "You cannot use that ability in this form.";
