            m_map[1063243] = "Attacking the animal now would bring great shame upon you.";
            m_map[1063244] = "~1_val~ does not belong to your faction.";
            m_map[1063245] = "Ha!  Why shouldst I listen to thee, for thou'rt not the sheriff of this town!";
            m_map[1063246] = "Thou'rt not the boss of me.";
            m_map[1063247] = "The guard is watching you carefully!  It would be unwise to remove another item from here.";
            m_map[1063248] = "<i>The guards let you through without question, and pay you no mind as you walk into the Daimyo's treasure cache.  A vast fortune in gold, gemstones, and jewelry is stored here!  Surely, the Daimyo wouldn't miss a single small item...<br><br>You spot the sword quickly amongst the cache of gemstones and other valuables.  In one quick motion you retrieve it and stash it in your pack.</i>";
