            m_map[1063262] = "Return to the inn and search for Daimyo Emino's katana.";
            m_map[1063263] = "Attempts to deliver a killing attack to your opponent, gaining a swing speed boost afterwards.  Failing to slay your enemy results in massive resistance penalties for a short duration.";
            m_map[1063264] = "Places you in a defensive stance of confidence, allowing you to gain stamina and health each time you parry.";
            m_map[1063265] = "Puts you in an evasive stance for a short duration, allowing you to parry magical attacks like dragon breath and energy bolt.";
            m_map[1063266] = "Places you in a defensive stance that allows you to automatically counter attack the next time you successfully parry.";
            m_map[1063267] = "An attack with a large bonus to your chance to hit.";
            m_map[1063268] = "If you strike an opponent with this ability, you will automatically strike another nearby opponent.  You receive a damage bonus if you kill the first opponent.";
            m_map[1063279] = "Increases both your damage and the percentage chance for ";
            m_map[1063280] = "After receiving a Death Strike, if the opponent moves more than five steps, or five seconds elapses, they will suffer direct damage determined by the attacker's Ninjitsu.";
            m_map[1063281] = "Allows you to transform into an animal, gaining special bonuses.  If you are running while casting this spell, you will automatically transform into your last selected animal type.";
            m_map[1063282] = "An attack that does greater damage based on how far you travel to your opponent from the location where you initiate the Ki Attack.  You must reach your target in under 2 seconds.";
            m_map[1063283] = "An attack from stealth that inflicts a defense penalty on your opponent for a short duration.  You cannot re-enter stealth for 5 seconds after a Surprise Attack.";
            m_map[1063284] = "An attack from stealth with a damage bonus based on your Ninjitsu and the distance you have tracked your opponent.";
            m_map[1063285] = "Allows you to teleport while maintaining stealth, but only if you succeed in a stealth check at your destination.";
            m_map[1063286] = "Creates a mirror image of yourself that may absorb damage when you are standing within 4 steps of it.  A mirror image consumes a follower slot and will disappear in 30 to 60 seconds.";
