            m_map[1063314] = "Terrible Hatchlings";
            m_map[1063315] = "The Deathwatch Beetle Hatchlings have trampled through my fields again, what a nuisance! Please help me get rid of the terrible hatchlings. If you kill 10 of them, you will be rewarded. The Deathwatch Beetle Hatchlings live in The Waste - the desert close to this city.<BR><BR>Will you accept this challenge?";
            m_map[1063316] = "Kill 10 Deathwatch Beetle Hatchlings and return to Ansella Gryen.";
            m_map[1063317] = "<I>In case you change your mind later...</I><BR><BR>You may re-start this quest at any time while you are still considered (young). Simply return to Ansella Gryen and speak with her.<BR><BR>";
            m_map[1063318] = "Deathwatch Beetle Hatchlings killed:";
