            m_map[1063320] = "Great job! One less terrible hatchling in the Waste!<BR><BR> Once you've killed 10 of the Deathwatch Beetle Hatchlings, return to Ansella for your reward!";
            m_map[1063321] = "Thank you for helping me get rid of these vile beasts! You have been rewarded for your good deeds. If you wish to help me in the future, visit me again.<br><br>Farewell.";
            m_map[1063322] = "Before you can help me with the Terrible Hatchlings, you'll need to finish the quest you've already taken!";
