            m_map[1063460] = "<BODY><BASEFONT COLOR=#DFDFC0>Skip this Quest and go to Emino's Residence</BASEFONT></BODY>";
            m_map[1063461] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to put your Shuko into your hands; to do this, you click and hold your left mouse button on the Shuko, drag the weapon onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
            m_map[1063462] = "<BODY><BASEFONT COLOR=#DFDFC0>First, you need to open your paperdoll and your inventory. We're going to put your Bokuto into your hand; to do this, you click and hold your left mouse button on the Bokuto, drag the weapon onto your paperdoll, and then release the mouse button.</BASEFONT></BODY>";
            m_map[1063463] = "<BODY><BASEFONT COLOR=#DFDFC0>To leave this area, take the stairs in the corner to the central chamber. Then ascend up the stairs in the middle of that chamber. This will take you to Emino's Residence where you'll meet Emino. He'll be waiting to speak with you.</BASEFONT></BODY>";
            m_map[1063464] = "<BODY><BASEFONT COLOR=#DFDFC0>To leave this area, take the stairs in the corner to the central chamber. Then ascend up the stairs in the middle of that chamber. This will take you to Haochi's Grounds where you'll meet Haochi. He'll be waiting to speak with you.</BASEFONT></BODY>";
            m_map[1063465] = "<BODY><BASEFONT COLOR=#DFDFC0>Oh, and... I beg of you... please don't tell Emino I lost your gold. Please!!</BASEFONT></BODY>";
            m_map[1063466] = "<BODY><BASEFONT COLOR=#DFDFC0>Oh, and... I beg of you... please don't tell Haochi I lost your gold. Please!!</BASEFONT></BODY>";
