        private static Dictionary<int, string> m_map = new Dictionary<int, string>();
        public static Dictionary<int, string> Lookup { get { return m_map; } }
        public static bool HasArticle(int labelnumber)
        {
            if (m_map.ContainsKey(labelnumber))
                if (m_map[labelnumber].StartsWith("a ", StringComparison.OrdinalIgnoreCase) || m_map[labelnumber].StartsWith("an ", StringComparison.OrdinalIgnoreCase))
                    return true;
            return false;
        }
